INSERT INTO `property` (`id`, `owner_id`, `vocabulary_id`, `local_name`, `label`, `comment`) VALUES
	(1, NULL, 1, 'title', 'Title', 'A name given to the resource.'),
	(2, NULL, 1, 'creator', 'Creator', 'An entity primarily responsible for making the resource.'),
	(3, NULL, 1, 'subject', 'Subject', 'The topic of the resource.'),
	(4, NULL, 1, 'description', 'Description', 'An account of the resource.'),
	(5, NULL, 1, 'publisher', 'Publisher', 'An entity responsible for making the resource available.'),
	(6, NULL, 1, 'contributor', 'Contributor', 'An entity responsible for making contributions to the resource.'),
	(7, NULL, 1, 'date', 'Date', 'A point or period of time associated with an event in the lifecycle of the resource.'),
	(8, NULL, 1, 'type', 'Type', 'The nature or genre of the resource.'),
	(9, NULL, 1, 'format', 'Format', 'The file format, physical medium, or dimensions of the resource.'),
	(10, NULL, 1, 'identifier', 'Identifier', 'An unambiguous reference to the resource within a given context.'),
	(11, NULL, 1, 'source', 'Source', 'A related resource from which the described resource is derived.'),
	(12, NULL, 1, 'language', 'Language', 'A language of the resource.'),
	(13, NULL, 1, 'relation', 'Relation', 'A related resource.'),
	(14, NULL, 1, 'coverage', 'Coverage', 'The spatial or temporal topic of the resource, the spatial applicability of the resource, or the jurisdiction under which the resource is relevant.'),
	(15, NULL, 1, 'rights', 'Rights', 'Information about rights held in and over the resource.'),
	(16, NULL, 1, 'audience', 'Audience', 'A class of entity for whom the resource is intended or useful.'),
	(17, NULL, 1, 'alternative', 'Alternative Title', 'An alternative name for the resource.'),
	(18, NULL, 1, 'tableOfContents', 'Table Of Contents', 'A list of subunits of the resource.'),
	(19, NULL, 1, 'abstract', 'Abstract', 'A summary of the resource.'),
	(20, NULL, 1, 'created', 'Date Created', 'Date of creation of the resource.'),
	(21, NULL, 1, 'valid', 'Date Valid', 'Date (often a range) of validity of a resource.'),
	(22, NULL, 1, 'available', 'Date Available', 'Date (often a range) that the resource became or will become available.'),
	(23, NULL, 1, 'issued', 'Date Issued', 'Date of formal issuance (e.g., publication) of the resource.'),
	(24, NULL, 1, 'modified', 'Date Modified', 'Date on which the resource was changed.'),
	(25, NULL, 1, 'extent', 'Extent', 'The size or duration of the resource.'),
	(26, NULL, 1, 'medium', 'Medium', 'The material or physical carrier of the resource.'),
	(27, NULL, 1, 'isVersionOf', 'Is Version Of', 'A related resource of which the described resource is a version, edition, or adaptation.'),
	(28, NULL, 1, 'hasVersion', 'Has Version', 'A related resource that is a version, edition, or adaptation of the described resource.'),
	(29, NULL, 1, 'isReplacedBy', 'Is Replaced By', 'A related resource that supplants, displaces, or supersedes the described resource.'),
	(30, NULL, 1, 'replaces', 'Replaces', 'A related resource that is supplanted, displaced, or superseded by the described resource.'),
	(31, NULL, 1, 'isRequiredBy', 'Is Required By', 'A related resource that requires the described resource to support its function, delivery, or coherence.'),
	(32, NULL, 1, 'requires', 'Requires', 'A related resource that is required by the described resource to support its function, delivery, or coherence.'),
	(33, NULL, 1, 'isPartOf', 'Is Part Of', 'A related resource in which the described resource is physically or logically included.'),
	(34, NULL, 1, 'hasPart', 'Has Part', 'A related resource that is included either physically or logically in the described resource.'),
	(35, NULL, 1, 'isReferencedBy', 'Is Referenced By', 'A related resource that references, cites, or otherwise points to the described resource.'),
	(36, NULL, 1, 'references', 'References', 'A related resource that is referenced, cited, or otherwise pointed to by the described resource.'),
	(37, NULL, 1, 'isFormatOf', 'Is Format Of', 'A related resource that is substantially the same as the described resource, but in another format.'),
	(38, NULL, 1, 'hasFormat', 'Has Format', 'A related resource that is substantially the same as the pre-existing described resource, but in another format.'),
	(39, NULL, 1, 'conformsTo', 'Conforms To', 'An established standard to which the described resource conforms.'),
	(40, NULL, 1, 'spatial', 'Spatial Coverage', 'Spatial characteristics of the resource.'),
	(41, NULL, 1, 'temporal', 'Temporal Coverage', 'Temporal characteristics of the resource.'),
	(42, NULL, 1, 'mediator', 'Mediator', 'An entity that mediates access to the resource and for whom the resource is intended or useful.'),
	(43, NULL, 1, 'dateAccepted', 'Date Accepted', 'Date of acceptance of the resource.'),
	(44, NULL, 1, 'dateCopyrighted', 'Date Copyrighted', 'Date of copyright.'),
	(45, NULL, 1, 'dateSubmitted', 'Date Submitted', 'Date of submission of the resource.'),
	(46, NULL, 1, 'educationLevel', 'Audience Education Level', 'A class of entity, defined in terms of progression through an educational or training context, for which the described resource is intended.'),
	(47, NULL, 1, 'accessRights', 'Access Rights', 'Information about who can access the resource or an indication of its security status.'),
	(48, NULL, 1, 'bibliographicCitation', 'Bibliographic Citation', 'A bibliographic reference for the resource.'),
	(49, NULL, 1, 'license', 'License', 'A legal document giving official permission to do something with the resource.'),
	(50, NULL, 1, 'rightsHolder', 'Rights Holder', 'A person or organization owning or managing rights over the resource.'),
	(51, NULL, 1, 'provenance', 'Provenance', 'A statement of any changes in ownership and custody of the resource since its creation that are significant for its authenticity, integrity, and interpretation.'),
	(52, NULL, 1, 'instructionalMethod', 'Instructional Method', 'A process, used to engender knowledge, attitudes and skills, that the described resource is designed to support.'),
	(53, NULL, 1, 'accrualMethod', 'Accrual Method', 'The method by which items are added to a collection.'),
	(54, NULL, 1, 'accrualPeriodicity', 'Accrual Periodicity', 'The frequency with which items are added to a collection.'),
	(55, NULL, 1, 'accrualPolicy', 'Accrual Policy', 'The policy governing the addition of items to a collection.'),
	(185, 1, 5, 'P1_is_identified_by', 'is identified by', 'This property describes the naming or identification of any real-world item by a name or any other identifier.\nThis property is intended for identifiers in general use, which form part of the world the model intends to describe, and not merely for internal database identifiers which are specific to a technical system, unless these latter also have a more general use outside the technical context. This property includes in particular identification by mathematical expressions such as coordinate systems used for the identification of instances of E53 Place. The property does not reveal anything about when, where and by whom this identifier was used. A more detailed representation can be made using the fully developed (i.e., indirect) path through E15 Identifier Assignment.\nThis property is a shortcut for the path from E1 CRM Entity through P140i was attributed by, E15 Identifier Assignment, P37 assigned to E42 Identifier.\nIt is also a shortcut for the path from E1 CRM Entity through P1 is identified by, E41 Appellation, P139 has alternative form to E41 Appellation.'),
	(186, 1, 5, 'P1i_identifies', 'identifies', NULL),
	(187, 1, 5, 'P2_has_type', 'has type', 'This property allows sub typing of CIDOC CRM entities –a form of specialisation – through the use of a terminological hierarchy, or thesaurus.\nThe CIDOC CRM is intended to focus on the high-level entities and relationships needed to describe data structures. Consequently, it does not specialise entities any further than is required for this immediate purpose. However, entities in the isA hierarchy of the CIDOC CRM may by specialised into any number of sub entities, which can be defined in the E55 Type hierarchy. E41 Appellation, for example, may be specialised into “e-mail address”, “telephone number”, “post office box”, “URL” etc. none of which figures explicitly in the CIDOC CRM hierarchy. A comprehensive explanation about refining CIDOC CRM concepts by E55 Type is given in the section “About Types” in the section on “Specific Modelling Constructs” of this document.\nThis property is a shortcut for the path from E1 CRM Entity through P41i was classified by, E17 Type Assignment, P42 assigned to E55 Type.'),
	(188, 1, 5, 'P2i_is_type_of', 'is type of', NULL),
	(189, 1, 5, 'P3_has_note', 'has note', 'This property is a container for all informal descriptions about an object that have not been expressed in terms of CIDOC CRM constructs.\nIn particular, it captures the characterisation of the item itself, its internal structures, appearance etc.\nLike property P2 has type (is type of), this property is a consequence of the restricted focus of the CIDOC CRM. The aim is not to capture, in a structured form, everything that can be said about an item; indeed, the CIDOC CRM formalism is not regarded as sufficient to express everything that can be said. Good practice requires use of distinct note fields for different aspects of a characterisation. The P3.1 has type property of P3 has note allows differentiation of specific notes, e.g., “construction”, “decoration” etc.\nAn item may have many notes, but a note is attached to a specific item.'),
	(190, 1, 5, 'P4_has_time-span', 'has time-span', 'This property associates an instance of E2 Temporal Entity with the instance of E52 Time-Span during which it was on-going. The associated instance of E52 Time-Span is understood as the real time-span during which the phenomena making up the temporal entity instance were active. More than one instance of E2 Temporal Entity may share a common instance of E52 Time-Span only if they come into being and end being due to identical declarations or events.'),
	(191, 1, 5, 'P4i_is_time-span_of', 'is time-span of', NULL),
	(192, 1, 5, 'P5_consists_of', 'consists of', 'This property describes the decomposition of an instance of E3 Condition State into discrete, subsidiary states.\nIt is assumed that the sub-states into which the condition state is analysed form a logical whole - although the entire story may not be completely known – and that the sub-states are in fact constitutive of the general condition state. For example, a general condition state of “in ruins” may be decomposed into the individual stages of decay.\nThis property is transitive and asymmetric.'),
	(193, 1, 5, 'P5i_forms_part_of', 'forms part of', NULL),
	(194, 1, 5, 'P7_took_place_at', 'took place at', 'This property describes the spatial location of an instance of E4 Period.\nThe related instance of E53 Place should be seen as a wider approximation of the geometric area within which the phenomena that characterise the period in question occurred, see below. P7 took place at (witnessed) does not convey any meaning other than spatial positioning (frequently on the surface of the earth). For example, the period “Révolution française” can be said to have taken place in “France in 1789”; the “Victorian” period may be said to have taken place in “Britain from 1837-1901” and its colonies, as well as other parts of Europe and North America. An instance of E4 Period can take place at multiple non-contiguous, non-overlapping locations.\nThis property is a shortcut of the more fully developed path from E4 Period through P161 has spatial projection, E53 Place, P89 falls within to E53 Place. E4 Period is a subclass of E92 Spacetime Volume. By the definition of P161 has spatial projection an instance of E4 Period takes place on all its spatial projections, that is, instances of E53 Place. Something happening at a given place can also be considered to happen at a larger place containing the first. For example, the assault on the Bastille 14-th July 1789 took place in the area covered by Paris in 1789 but also in the area covered by France in 1789.'),
	(195, 1, 5, 'P7i_witnessed', 'witnessed', NULL),
	(196, 1, 5, 'P8_took_place_on_or_within', 'took place on or within', 'This property describes the location of an instance of E4 Period with respect to an instance of E19 Physical Object.\nThis property is a shortcut of the more fully developed path from E4 Period through P7 took place at, E53 Place, P156i is occupied by E18 Physical Thing.\nIt describes a period that can be located with respect to the space defined by an E19 Physical Object such as a ship or a building. The precise geographical location of the object during the period in question may be unknown or unimportant.\nFor example, the French and German armistice of 22-nd June 1940 was signed in the same railway carriage as the armistice of 11-th November 1918.'),
	(197, 1, 5, 'P8i_witnessed', 'witnessed', NULL),
	(198, 1, 5, 'P9_consists_of', 'consists of', 'This property associates an instance of E4 Period with another instance of E4 Period that is defined by a subset of the phenomena that define the former. Therefore, the spacetime volume of the latter must fall within the spacetime volume of the former.\nThis property is transitive and asymmetric.'),
	(199, 1, 5, 'P9i_forms_part_of', 'forms part of', NULL),
	(200, 1, 5, 'P10_falls_within', 'falls within', 'This property associates an instance of E92 Spacetime Volume with another instance of E92 Spacetime Volume that falls within the latter. In other words, all points in the former are also points in the latter.\nThis property is transitive and reflexive.'),
	(201, 1, 5, 'P10i_contains', 'contains', NULL),
	(202, 1, 5, 'P11_had_participant', 'had participant', 'This property describes the active or passive participation of instances of E39 Actors in an instance of E5 Event.\nIt documents known events in which an instance of E39 Actor has participated during the course of that actor’s life or history. The instances of E53 Place and E52 Time-Span where and when these events happened provide us with constraints about the presence of the related instances of E39 Actor in the past. Collective actors, i.e., instances of E74 Group, may physically participate in events via their representing instances of E21 Persons only. The participation of multiple actors in an event is most likely an indication of their acquaintance and interaction.\nThe property implies that the actor was involved in the event but does not imply any causal relationship. For instance, someone having been portrayed can be said to have participated in the creation of the portrait.'),
	(203, 1, 5, 'P11i_participated_in', 'participated in', NULL),
	(204, 1, 5, 'P12_occurred_in_the_presence_of', 'occurred in the presence of', 'This property describes the active or passive presence of an E77 Persistent Item in an instance of E5 Event without implying any specific role.\nIt documents known events in which an instance of E77 Persistent Item was present during the course of its life or history. For example, an object may be the desk, now in a museum, on which a treaty was signed. The instance of E53 Place and the instance of E52 Time-Span where and when these events happened provide us with constraints about the presence of the related instance E77 Persistent Item in the past. Instances of E90 Symbolic Object, in particular information objects, are physically present in events via at least one of the instances of E18 Physical Thing carrying them. Note, that the human mind can be such a carrier. A precondition for a transfer of information to a person or another new physical carrier is the presence of the respective information object and this person or physical thing in one event.'),
	(205, 1, 5, 'P12i_was_present_at', 'was present at', NULL),
	(206, 1, 5, 'P13_destroyed', 'destroyed', 'This property links an instance of E6 Destruction to an instance of E18 Physical Thing that has been destroyed by it.\nDestruction implies the end of an item’s life as a subject of cultural documentation – the physical matter of which the item was composed may in fact continue to exist. An instance of E6 Destruction may be contiguous with an instance of E12 Production that brings into existence a derived object composed partly of matter from the destroyed object.'),
	(207, 1, 5, 'P13i_was_destroyed_by', 'was destroyed by', NULL),
	(208, 1, 5, 'P14_carried_out_by', 'carried out by', 'This property describes the active participation of an instance of E39 Actor in an instance of E7 Activity.\nIt implies causal or legal responsibility. The P14.1 in the role of property of the property specifies the nature of an Actor’s participation.'),
	(209, 1, 5, 'P14i_performed', 'performed', NULL),
	(210, 1, 5, 'P15_was_influenced_by', 'was influenced by', 'This is a high-level property, which captures the relationship between an instance of E7 Activity and anything, that is, an instance of E1 CRM Entity that may have had some bearing upon it.\nThe property has more specific sub properties.'),
	(211, 1, 5, 'P15i_influenced', 'influenced', NULL),
	(212, 1, 5, 'P16_used_specific_object', 'used specific object', 'This property describes the use of material or immaterial things in a way essential to the performance or the outcome of an instance of E7 Activity.\nThis property typically applies to tools, instruments, moulds, raw materials and items embedded in a product. It implies that the presence of the object in question was a necessary condition for the action. For example, the activity of writing this text required the use of a computer. An immaterial thing can be used if at least one of its carriers is present. For example, the software tools on a computer.\nAnother example is the use of a particular name by a particular group of people over some span to identify a thing, such as a settlement. In this case, the physical carriers of this name are at least the people understanding its use.'),
	(213, 1, 5, 'P16i_was_used_for', 'was used for', NULL),
	(214, 1, 5, 'P17_was_motivated_by', 'was motivated by', 'This property describes an item or items that are regarded as a reason for carrying out the instance of E7 Activity.\nFor example, the discovery of a large hoard of treasure may call for a celebration, an order from headquarters can start a military manoeuvre.'),
	(215, 1, 5, 'P17i_motivated', 'motivated', NULL),
	(216, 1, 5, 'P19_was_intended_use_of', 'was intended use of', 'This property relates an instance of E7 Activity with instances of E71 Human-Made Thing, created specifically for use in the activity.\nThis is distinct from the intended use of an item in some general type of activity such as the book of common prayer which was intended for use in Church of England services (see P101 had as general use (was use of)).'),
	(217, 1, 5, 'P19i_was_made_for', 'was made for', NULL),
	(218, 1, 5, 'P20_had_specific_purpose', 'had specific purpose', 'This property identifies the relationship between a preparatory activity, an instance of E7 Activity and the instance of E5 Event it is intended to be preparation for.\nThis includes activities, orders and other organisational actions, taken in preparation for other activities or events.\nP20 had specific purpose (was purpose of) implies that an activity succeeded in achieving its aim. If it does not succeed, such as the setting of a trap that did not catch anything, one may document the unrealized intention using P21 had general purpose (was purpose of): E55 Type and/or P33 used specific technique (was used by): E29 Design or Procedure.'),
	(219, 1, 5, 'P20i_was_purpose_of', 'was purpose of', NULL),
	(220, 1, 5, 'P21_had_general_purpose', 'had general purpose', 'This property describes an intentional relationship between an instance of E7 Activity and some general goal or purpose, described as an instance of E55 Type.\nThis may involve activities intended as preparation for some type of activity or event. P21 had general purpose (was purpose of) differs from P20 had specific purpose (was purpose of) in that no occurrence of an event is implied as the purpose.'),
	(221, 1, 5, 'P21i_was_purpose_of', 'was purpose of', NULL),
	(222, 1, 5, 'P22_transferred_title_to', 'transferred title to', 'This property identifies the instance of E39 Actor that acquires the legal ownership of an object as a result of an instance of E8 Acquisition.\nThe property will typically describe an Actor purchasing or otherwise acquiring an object from another Actor. However, title may also be acquired, without any corresponding loss of title by another Actor, through legal fieldwork such as hunting, shooting or fishing.\nIn reality the title is either transferred to or from someone, or both.'),
	(223, 1, 5, 'P22i_acquired_title_through', 'acquired title through', NULL),
	(224, 1, 5, 'P23_transferred_title_from', 'transferred title from', 'This property identifies the instance(s) of E39 Actor who relinquish legal ownership as the result of an instance of E8 Acquisition.\nThe property will typically be used to describe a person donating or selling an object to a museum. In reality title is either transferred to or from someone, or both.'),
	(225, 1, 5, 'P23i_surrendered_title_through', 'surrendered title through', NULL),
	(226, 1, 5, 'P24_transferred_title_of', 'transferred title of', 'This property identifies the instance(s) of E18 Physical Thing involved in an instance of E8 Acquisition.\nIn reality, an acquisition must refer to at least one transferred item.'),
	(227, 1, 5, 'P24i_changed_ownership_through', 'changed ownership through', NULL),
	(228, 1, 5, 'P25_moved', 'moved', 'This property identifies an instance of E19 Physical Object that was moved by an instance of E9 Move. A move must concern at least one object.\nThe property implies the object’s passive participation. For example, Monet’s painting “Impression sunrise” was moved for the first Impressionist exhibition in 1874.'),
	(229, 1, 5, 'P25i_moved_by', 'moved by', NULL),
	(230, 1, 5, 'P26_moved_to', 'moved to', 'This property identifies a destination, an instance of E53 place, of an instance of E9 Move.\nA move will be linked to a destination, such as the move of an artifact from storage to display. A move may be linked to many terminal instances of E53 Place by multiple instances of this property. In this case the move describes a distribution of a set of objects. The area of the move includes the origin(s), route and destination(s).\nTherefore, the described destination is an instance of E53 Place which P89 falls within (contains) the instance of E53 Place the move P7 took place at.'),
	(231, 1, 5, 'P26i_was_destination_of', 'was destination of', NULL),
	(232, 1, 5, 'P27_moved_from', 'moved from', 'This property identifies an origin, an instance of E53 Place, of an instance of E9 Move.\nA move will be linked to an origin, such as the move of an artifact from storage to display. A move may be linked to many starting instances of E53 Place by multiple instances of this property. In this case the move describes the picking up of a set of objects. The area of the move includes the origin(s), route and destination(s).\nTherefore, the described origin is an instance of E53 Place which P89 falls within (contains) the instance of E53 Place the move P7 took place at.'),
	(233, 1, 5, 'P27i_was_origin_of', 'was origin of', NULL),
	(234, 1, 5, 'P28_custody_surrendered_by', 'custody surrendered by', 'This property identifies the instance(s) of E39 Actor who surrender custody of an instance of E18 Physical Thing in an instance of E10 Transfer of Custody.\nThe property will typically describe an Actor surrendering custody of an object when it is handed over to someone else’s care. On occasion, physical custody may be surrendered involuntarily – through accident, loss or theft.\nIn reality, custody is either transferred to someone or from someone, or both.'),
	(235, 1, 5, 'P28i_surrendered_custody_through', 'surrendered custody through', NULL),
	(236, 1, 5, 'P29_custody_received_by', 'custody received by', 'This property identifies the instance(s) E39 Actor who receive custody of an instance of E18 Physical Thing in an instance of E10 Transfer of Custody.\nThe property will typically describe Actors receiving custody of an object when it is handed over from another Actor’s care. On occasion, physical custody may be received involuntarily or illegally – through accident, unsolicited donation, or theft.\nIn reality, custody is either transferred to someone or from someone, or both.'),
	(237, 1, 5, 'P29i_received_custody_through', 'received custody through', NULL),
	(238, 1, 5, 'P30_transferred_custody_of', 'transferred custody of', 'This property identifies the instance(s) of E18 Physical Thing concerned in an instance of E10 Transfer of Custody.\nThe property will typically describe the object that is handed over by an instance of E39 Actor to to the custody of another instance of E39 Actor. On occasion, physical custody may be transferred involuntarily or illegally – through accident, unsolicited donation, or theft.'),
	(239, 1, 5, 'P30i_custody_transferred_through', 'custody transferred through', NULL),
	(240, 1, 5, 'P31_has_modified', 'has modified', 'This property identifies the instance of E18 Physical Thing modified in an instance of E11 Modification.'),
	(241, 1, 5, 'P31i_was_modified_by', 'was modified by', NULL),
	(242, 1, 5, 'P32_used_general_technique', 'used general technique', 'This property identifies the technique or method, modelled as an instance of E55 Type, that was employed in an instance of E7 Activity.\nThese techniques should be drawn from an external E55 Type hierarchy of consistent terminology of general techniques or methods such as embroidery, oil-painting, carbon dating, etc. Specific documented techniques should be described as instances of E29 Design or Procedure.'),
	(243, 1, 5, 'P32i_was_technique_of', 'was technique of', NULL),
	(244, 1, 5, 'P33_used_specific_technique', 'used specific technique', 'This property identifies a specific instance of E29 Design or Procedure in order to carry out an instance of E7 Activity or parts of it.\nThe property differs from P32 used general technique (was technique of) in that P33 refers to an instance of E29 Design or Procedure, which is a concrete information object in its own right rather than simply being a term or a method known by tradition.\nTypical examples would include intervention plans for conservation or the construction plans of a building.'),
	(245, 1, 5, 'P33i_was_used_by', 'was used by', NULL),
	(246, 1, 5, 'P34_concerned', 'concerned', 'This property identifies the instance of E18 Physical Thing that was assessed during an instance of E14 Condition Assessment activity.\nConditions may be assessed either by direct observation or using recorded evidence. In the latter case the instance of E18 Physical Thing does not need to be present or extant at the time of assessment.'),
	(247, 1, 5, 'P34i_was_assessed_by', 'was assessed by', NULL),
	(248, 1, 5, 'P35_has_identified', 'has identified', 'This property identifies the instance of E3 Condition State that was observed in an instance of E14 Condition Assessment activity.'),
	(249, 1, 5, 'P35i_was_identified_by', 'was identified by', NULL),
	(250, 1, 5, 'P37_assigned', 'assigned', 'This property records the identifier that was assigned to an item in an instance of P37 Identifier Assignment.\nThe same identifier may be assigned on more than one occasion.\nAn Identifier might be created prior to an assignment.'),
	(251, 1, 5, 'P37i_was_assigned_by', 'was assigned by', NULL),
	(252, 1, 5, 'P38_deassigned', 'deassigned', 'This property records the identifier that was deassigned from an instance of E1 CRM Entity.\nDe-assignment of an identifier may be necessary when an item is taken out of an inventory, a new numbering system is introduced or items are merged or split up.\nThe same identifier may be deassigned on more than one occasion.'),
	(253, 1, 5, 'P38i_was_deassigned_by', 'was deassigned by', NULL),
	(254, 1, 5, 'P39_measured', 'measured', 'This property associates an instance of E16 Measurement with the instance of E18 Physical Thing upon which it acted. The instance of E16 Measurement is specific to the measured object. An instance of E18 Physical Thing may be measured more than once with different results, constituting different instances of E16 Measurement.'),
	(255, 1, 5, 'P39i_was_measured_by', 'was measured by', NULL),
	(256, 1, 5, 'P40_observed_dimension', 'observed dimension', 'This property records the dimension that was observed in an E16 Measurement Event.\nE54 Dimension can be any quantifiable aspect of E70 Thing. Weight, image colour depth and monetary value are dimensions in this sense. One measurement activity may determine more than one dimension of one object.\nDimensions may be determined either by direct observation or using recorded evidence. In the latter case the measured Thing does not need to be present or extant.\nEven though knowledge of the value of a dimension requires measurement, the dimension may be an object of discourse prior to, or even without, any measurement being made.'),
	(257, 1, 5, 'P40i_was_observed_in', 'was observed in', NULL),
	(258, 1, 5, 'P41_classified', 'classified', 'This property records the item to which a type was assigned in an E17 Type Assignment activity.\nAny instance of a CIDOC CRM entity may be assigned a type through type assignment. Type assignment events allow a more detailed path from E1 CRM Entity through P41i was classified by, E17 Type Assignment, P42 assigned, to E55 Type for assigning types to objects compared to the shortcut offered by P2 has type (is type of).'),
	(259, 1, 5, 'P41i_was_classified_by', 'was classified by', NULL),
	(260, 1, 5, 'P42_assigned', 'assigned', 'This property records the type that was assigned to an entity by an E17 Type Assignment activity.\nType assignment events allow a more detailed path from E1 CRM Entity through P41i was classified by, E17 Type Assignment, P42 assigned, to E55 Type for assigning types to objects compared to the shortcut offered by P2 has type (is type of).\nFor example, a fragment of an antique vessel could be assigned the type “attic red figured belly handled amphora” by expert A. The same fragment could be assigned the type “shoulder handled amphora” by expert B.\nA Type may be intellectually constructed independent from assigning an instance of it.'),
	(261, 1, 5, 'P42i_was_assigned_by', 'was assigned by', NULL),
	(262, 1, 5, 'P43_has_dimension', 'has dimension', 'This property records an instance of E54 Dimension of some instance of E70 Thing.\nIn the case that the recorded property is a result of a measurement of an instance of E18 Physical Thing, this property is a shortcut of the more fully developed path from E18 Physical Thing through P39i was measured by, E16 Measurement, P40 observed dimension to E54 Dimension.\nIt offers no information about how and when an E54 Dimension was established, nor by whom. Knowledge about an instance of E54 Dimension need not be the result of a measurement; it may be the result of evaluating data or other information, which should be documented as an instance of E13 Attribute Assignment.\nAn instance of E54 Dimension is specific to an instance of E70 Thing.'),
	(263, 1, 5, 'P43i_is_dimension_of', 'is dimension of', NULL),
	(264, 1, 5, 'P44_has_condition', 'has condition', 'This property records an E3 Condition State for some E18 Physical Thing.\nThis property is a shortcut of the more fully developed path from E18 Physical Thing through P34i was assessed by, E14 Condition Assessment, P35 has identified to E3 Condition State. It offers no information about how and when the E3 Condition State was established, nor by whom.\nAn instance of Condition State is specific to an instance of E18 Physical Thing.'),
	(265, 1, 5, 'P44i_is_condition_of', 'is condition of', NULL),
	(266, 1, 5, 'P45_consists_of', 'consists of', 'This property identifies the instances of E57 Materials of which an instance of E18 Physical Thing is composed.\nAll physical things consist of physical materials. P45 consists of (is incorporated in) allows the different materials to be recorded. P45 consists of (is incorporated in) refers here to observed material as opposed to the consumed raw material.\nA material, such as a theoretical alloy, may not have any physical instances.'),
	(267, 1, 5, 'P45i_is_incorporated_in', 'is incorporated in', NULL),
	(268, 1, 5, 'P46_is_composed_of', 'is composed of', 'This property associates an instance of E18 Physical Thing with another instance of Physical Thing that forms part of it. The spatial extent of the composing part is included in the spatial extent of the whole.\nComponent elements, since they are themselves instances of E18 Physical Thing, may be further analysed into sub-components, thereby creating a hierarchy of part decomposition. An instance of E18 Physical Thing may be shared between multiple wholes, for example two buildings may share a common wall. This property does not specify when and for how long a component element resided in the respective whole. If a component is not part of a whole from the beginning of existence or until the end of existence of the whole, the classes E79 Part Addition and E90 Part Removal can be used to document when a component became part of a particular whole and/or when it stopped being a part of it. For the time-span of being part of the respective whole, the component is completely contained in the place the whole occupies.\nThis property is intended to describe specific components that are individually documented, rather than general aspects. Overall descriptions of the structure of an instance of E18 Physical Thing are captured by the P3 has note property.\nThe instances of E57 Material of which an instance of E18 Physical Thing is composed should be documented using P45 consists of (is incorporated in).\nThis property is transitive and asymmetric.'),
	(269, 1, 5, 'P46i_forms_part_of', 'forms part of', NULL),
	(270, 1, 5, 'P48_has_preferred_identifier', 'has preferred identifier', 'This property records the preferred instance of E42 Identifier that was used to identify an instance of E1 CRM Entity at the time this property was recorded.\nMore than one preferred identifier may have been assigned to an item over time.\nUse of this property requires an external mechanism for assigning temporal validity to the respective CIDOC CRM instance.\nThe fact that an identifier is a preferred one for an organisation can be better expressed in a context independent form by assigning a suitable instance of E55 Type to the respective instance of E15 Identifier Assignment using the P2 has type property.'),
	(271, 1, 5, 'P48i_is_preferred_identifier_of', 'is preferred identifier of', NULL),
	(272, 1, 5, 'P49_has_former_or_current_keeper', 'has former or current keeper', 'This property identifies the instance of E39 Actor who has or has had custody of an instance of E18 Physical Thing at some time. This property leaves open the question if parts of this physical thing have been added or removed during the time-spans it has been under the custody of this actor, but it is required that at least a part which can unambiguously be identified as representing the whole has been under this custody for its whole time. The way, in which a representative part is defined, should ensure that it is unambiguous who keeps a part and who the whole and should be consistent with the identity criteria of the kept instance of E18 Physical Thing.\nThe distinction with P50 has current keeper (is current keeper of) is that P49 has former or current keeper (is former or current keeper of) leaves open the question as to whether the specified keepers are current.\nThis property is a shortcut for the more detailed path from E18 Physical Thing through P30i custody transferred through, E10 Transfer of Custody, P28 custody surrendered by or P29 custody received by to E39 Actor.'),
	(273, 1, 5, 'P49i_is_former_or_current_keeper_of', 'is former or current keeper of', NULL),
	(274, 1, 5, 'P50_has_current_keeper', 'has current keeper', 'This property identifies the instance of E39 Actor that had custody of an instance of E18 Physical Thing at the time of validity of the record or database containing the statement that uses this property.\nThis property is a shortcut for the more detailed path from E18 Physical Thing through, P30i custody transferred through, E10 Transfer of Custody, P29 custody received by to E39 Actor, if and only if the custody has not been surrendered by the receiving actor at any later time'),
	(275, 1, 5, 'P50i_is_current_keeper_of', 'is current keeper of', NULL),
	(276, 1, 5, 'P51_has_former_or_current_owner', 'has former or current owner', 'This property identifies an instance of E39 Actor that is or had been the legal owner (i.e., title holder) of an instance of E18 Physical Thing at some time.\nThe distinction with P52 has current owner (is current owner of) is that P51 has former or current owner (is former or current owner of) does not indicate whether the specified owners are current.\nThis property is a shortcut for the more detailed path from E18 Physical Thing through P24i changed ownership through, E8 Acquisition, P23 transferred title from, or P22 transferred title to to E39 Actor.'),
	(277, 1, 5, 'P51i_is_former_or_current_owner_of', 'is former or current owner of', NULL),
	(278, 1, 5, 'P52_has_current_owner', 'has current owner', 'This property identifies the instance of E21 Person or E74 Group that was the owner of an instance of E18 Physical Thing at the time of validity of the record or database containing the statement that uses this property.\nThis property is a shortcut for the more detailed path from E18 Physical Thing through, P24i changed ownership through, E8 Acquisition, P22 transferred title to to E39 Actor, if and only if this acquisition event is the most recent.'),
	(279, 1, 5, 'P52i_is_current_owner_of', 'is current owner of', NULL),
	(280, 1, 5, 'P53_has_former_or_current_location', 'has former or current location', 'This property identifies an instance of E53 Place as the former or current location of an instance of E18 Physical Thing.\nIn the case of instances of E19 Physical Object, the property does not allow any indication of the Time-Span during which the instance of E19 Physical Object was located at this instance of E53 Place, nor if this is the current location.\nIn the case of immobile objects, the Place would normally correspond to the Place of creation.\nThis property is a shortcut. A more detailed representation can make use of the fully developed (i.e., indirect) path from E19 Physical Object, though, P25i moved by, E9 Move, P26 moved to or P27 moved from to E53 Place.'),
	(281, 1, 5, 'P53i_is_former_or_current_location_of', 'is former or current location of', NULL),
	(282, 1, 5, 'P54_has_current_permanent_location', 'has current permanent location', 'This property records the foreseen permanent location of an instance of E19 Physical Object at the time of validity of the record or database containing the statement that uses this property.\nP54 has current permanent location (is current permanent location of) is similar to P55 has current location (currently holds). However, it indicates the E53 Place currently reserved for an object, such as the permanent storage location or a permanent exhibit location. The object may be temporarily removed from the permanent location, for example when used in temporary exhibitions or loaned to another institution. The object may never actually be located at its permanent location.'),
	(283, 1, 5, 'P54i_is_current_permanent_location_of', 'is current permanent location of', NULL),
	(284, 1, 5, 'P55_has_current_location', 'has current location', 'This property records the location of an instance of E19 Physical Object at the time of validity of the record or database containing the statement that uses this property.\nThis property is a specialisation of P53 has former or current location (is former or current location of). It indicates that the instance of E53 Place associated with the instance of E19 Physical Object is the current location of the object. The property does not allow any indication of how long the object has been at the current location.\nThis property is a shortcut. A more detailed representation can make use of the fully developed (i.e., indirect) path from E19 Physical Object, through, P25i moved by, E9 Move, P26 moved to to E53 Place if and only if this Move is the most recent.'),
	(285, 1, 5, 'P55i_currently_holds', 'currently holds', NULL),
	(286, 1, 5, 'P56_bears_feature', 'bears feature', 'This property links an instance of E19 Physical Object to an instance of E26 Physical Feature that it bears.\nAn instance of E26 Physical Feature can only exist on one object. One object may bear more than one E26 Physical Feature. An instance of E27 Site should be considered as an instance of E26 Physical Feature on the surface of the Earth.\nAn instance B of E26 Physical Feature being a detail of the structure of another instance A of E26 Physical Feature can be linked to B by use of the property P46 is composed of (forms part of). This implies that the subfeature B is P56i is found on the same E19 Physical Object as A.\nThis property is a shortcut. A more detailed representation can make use of the fully developed (i.e., indirect) path E19 Physical Object, through, P59 has section, E53 Place, P53i is former or current location of to E26 Physical Feature.'),
	(287, 1, 5, 'P56i_is_found_on', 'is found on', NULL),
	(288, 1, 5, 'P57_has_number_of_parts', 'has number of parts', 'This property documents the number of parts, an instance of E60 Number, of which an instance of E19 Physical Object is composed.\nThis may be used as a method of checking inventory counts with regard to aggregate or collective objects. What constitutes a part or component depends on the context and requirements of the documentation. Normally, the parts documented in this way would not be considered as worthy of individual attention.\nFor a more complete description, objects may be decomposed into their components and constituents using P46 is composed of (forms parts of) and P45 consists of (is incorporated in). This allows each element to be described individually.'),
	(289, 1, 5, 'P59_has_section', 'has section', 'This property links an area, i.e., an instance of E53 Place to the instance of E18 Physical Thing upon which it is found. This area may either be identified by a name, or by a geometry in terms of a coordinate system adapted to the shape of the respective instance of E18 Physical Thing. Typically, names identifying sections of physical objects are composed of the name of a kind of part and the name of the object itself, such as "The poop deck of H.M.S. Victory", which is composed of "poop deck" and "H.M.S. Victory".'),
	(290, 1, 5, 'P59i_is_located_on_or_within', 'is located on or within', NULL),
	(291, 1, 5, 'P62_depicts', 'depicts', 'This property identifies something that is depicted by an instance of E24 Physical Human-Made Thing. Depicting is meant in the sense that an instance of E24 Physical Human-Made Thing intentionally shows, through its optical qualities or form, a representation of the entity depicted. Photographs are by default regarded as being intentional in this sense. Anything that is designed to change the properties of the depiction, such as an e-book reader, is specifically excluded. The property does not pertain to inscriptions or any other information encoding.\nThis property is a shortcut of the more fully developed path from E24 Physical Human-Made Thing through P65 shows visual item, E36 Visual Item, P138 represents to E1 CRM Entity. P62.1 mode of depiction allows the nature of the depiction to be refined.'),
	(292, 1, 5, 'P62i_is_depicted_by', 'is depicted by', NULL),
	(293, 1, 5, 'P65_shows_visual_item', 'shows visual item', 'This property documents an instance of E36 Visual Item shown by an instance of E24 Physical Human-Made Thing.\nThis property is similar to P62 depicts (is depicted by) in that it associates an instance of E24 Physical Human-Made Thing with a visual representation. However, P65 shows visual item (is shown by) differs from the P62 depicts (is depicted by) property in that it makes no claims about what the instance of E36 Visual Item is deemed to represent. An instance of E36 Visual Item identifies a recognisable image or visual symbol, regardless of what this image may or may not represent.\nFor example, all recent British coins bear a portrait of Queen Elizabeth II, a fact that is correctly documented using P62 depicts (is depicted by). Different portraits have been used at different periods, however. P65 shows visual item (is shown by) can be used to refer to a particular portrait.\nP65 shows visual item (is shown by) may also be used for Visual Items such as signs, marks and symbols, for example the \'Maltese Cross\' or the \'copyright symbol’ that have no particular representational content.\nThis property is part of the fully developed path E24 Physical Human-Made Thing, P65 shows visual item, E36 Visual Item, P138 represents to E1 CRM Entity which is shortcut by, P62 depicts (is depicted by).'),
	(294, 1, 5, 'P65i_is_shown_by', 'is shown by', NULL),
	(295, 1, 5, 'P67_refers_to', 'refers to', 'This property documents that an instance of E89 Propositional Object makes a statement about an instance of E1 CRM Entity. P67 refers to (is referred to by) has the P67.1 has type link to an instance of E55 Type. This is intended to allow a more detailed description of the type of reference. This differs from P129 is about (is subject of), which describes the primary subject or subjects of the instance of E89 Propositional Object.'),
	(296, 1, 5, 'P67i_is_referred_to_by', 'is referred to by', NULL),
	(297, 1, 5, 'P68_foresees_use_of', 'foresees use of', 'This property identifies an instance of E57 Material foreseen to be used by an instance of E29 Design or Procedure.\nE29 Designs and procedures commonly foresee the use of particular instances of E57 Material. The fabrication of adobe bricks, for example, requires straw, clay and water. This property enables this to be documented.\nThis property is not intended for the documentation of instances of E57 Materials that were used on a particular occasion when an instance of E29 Design or Procedure was executed.'),
	(298, 1, 5, 'P68i_use_foreseen_by', 'use foreseen by', NULL),
	(299, 1, 5, 'P69_has_association_with', 'has association with', 'This property generalises relationships like whole-part, sequence, prerequisite or inspired by between instances of E29 Design or Procedure. Any instance of E29 Design or Procedure may be associated with other designs or procedures. The property is considered to be symmetrical unless otherwise indicated by P69.1 has type. The property is not transitive\nThis property is a directed relationship. The P69.1 has type property of P69 has association with allows the nature of the association to be specified reading from domain to range; examples of types of association between instances of E29 Design or Procedure include: has part, follows, requires, etc.\nInstances of this property are considered to be symmetric, in case no directed sense is provided for them by the property P69.1 has type.\nThe property can typically be used to model the decomposition of the description of a complete workflow into a series of separate procedures.'),
	(300, 1, 5, 'P69i_is_associated_with', 'is associated with', NULL),
	(301, 1, 5, 'P70_documents', 'documents', 'This property describes the CRM Entities documented as instances of E31 Document.\nDocuments may describe any conceivable entity, hence the link to the highest-level entity in the CIDOC CRM class hierarchy. This property is intended for cases where a reference is regarded as making a proposition about reality. This may be of a documentary character, in the scholarly or scientific sense, or a more general statement.'),
	(302, 1, 5, 'P70i_is_documented_in', 'is documented in', NULL),
	(303, 1, 5, 'P71_lists', 'lists', 'This property associates an instance of E32 Authority Document, with an instance of E1 CRM Entity which it lists for reference purposes.'),
	(304, 1, 5, 'P71i_is_listed_in', 'is listed in', NULL),
	(305, 1, 5, 'P72_has_language', 'has language', 'This property associates an instance(s) of E33 Linguistic Object with an instance of E56 Language in which it is, at least partially, expressed.\nLinguistic Objects are composed in one or more human Languages. This property allows these languages to be documented.'),
	(306, 1, 5, 'P72i_is_language_of', 'is language of', NULL),
	(307, 1, 5, 'P73_has_translation', 'has translation', 'This property links an instance of E33 Linguistic Object (A), to another instance of E33 Linguistic Object (B) which is the translation of A.\nWhen an instance of E33 Linguistic Object is translated into a new language a new instance of E33 Linguistic Object is created, despite the translation being conceptually similar to the source.\nThis property is asymmetric.'),
	(308, 1, 5, 'P73i_is_translation_of', 'is translation of', NULL),
	(309, 1, 5, 'P74_has_current_or_former_residence', 'has current or former residence', 'This property describes the current or former place of residence (an instance of E53 Place) of an instance of E39 Actor.\nThe residence may be either the place where the actor resides, or a legally registered address of any kind.'),
	(310, 1, 5, 'P74i_is_current_or_former_residence_of', 'is current or former residence of', NULL),
	(311, 1, 5, 'P75_possesses', 'possesses', 'This property associates an instance of E39 Actor to an instance of E30 Right over which the actor holds or has held a legal claim.'),
	(312, 1, 5, 'P75i_is_possessed_by', 'is possessed by', NULL),
	(313, 1, 5, 'P76_has_contact_point', 'has contact point', 'This property associates an instance of E39 Actor to an instance of E41 Appellation which a communication service uses to direct communications to this actor, such as an e-mail address, fax number, or postal address.'),
	(314, 1, 5, 'P76i_provides_access_to', 'provides access to', NULL),
	(315, 1, 5, 'P79_beginning_is_qualified_by', 'beginning is qualified by', 'This property associates an instance of E52 Time-Span with a note detailing the scholarly or scientific opinions and justifications about the certainty, precision, sources etc. of its beginning. Such notes may also be used to elaborate arguments about constraints or to give explanations of alternatives.'),
	(316, 1, 5, 'P80_end_is_qualified_by', 'end is qualified by', 'This property associates an instance of E52 Time-Span with a note detailing the scholarly or scientific opinions and justifications about the end of this time-span concerning certainty, precision, sources etc. This property may also be used to describe arguments constraining possible dates and to distinguish reasons for alternative dates.'),
	(317, 1, 5, 'P81_ongoing_throughout', 'ongoing throughout', 'This property associates an instance of E52 Time-Span with an instance of E61 Time Primitive specifying a minimum period of time covered by it. Since Time-Spans may not have precisely known temporal extents, the CIDOC CRM supports statements about the minimum and maximum temporal extents of Time-Spans. This property allows a Time-Span’s minimum temporal extent (i.e., its inner boundary) to be assigned an E61 Time Primitive value. Time Primitives are treated by the CIDOC CRM as application or system specific date intervals, and are not further analysed. If different sources of evidence justify different minimum extents without contradicting each other, the smallest interval including all these extents will be the best estimate. This should be taken into account for information integration.'),
	(318, 1, 5, 'P81a_end_of_the_begin', 'end of the begin', NULL),
	(319, 1, 5, 'P81b_begin_of_the_end', 'begin of the end', NULL),
	(320, 1, 5, 'P82_at_some_time_within', 'at some time within', 'This property describes the maximum period of time within which an E52 Time-Span falls. Since Time-Spans may not have precisely known temporal extents, the CIDOC CRM supports statements about the minimum and maximum temporal extents of Time-Spans. This property allows a Time-Span’s maximum temporal extent (i.e., its outer boundary) to be assigned an E61 Time Primitive value. Time Primitives are treated by the CIDOC CRM as application or system specific date intervals, and are not further analysed. If different sources of evidence justify different maximum extents without contradicting each other, the resulting intersection of all these extents will be the best estimate. This should be taken into account for information integration.'),
	(321, 1, 5, 'P82a_begin_of_the_begin', 'begin of the begin', NULL),
	(322, 1, 5, 'P82b_end_of_the_end', 'end of the end', NULL),
	(323, 1, 5, 'P86_falls_within', 'falls within', 'This property describes the inclusion relationship between two instances of E52 Time-Span.\nThis property supports the notion that the temporal extent of an instance of E52 Time-Span falls within the temporal extent of another instance of E52 Time-Span. It addresses temporal containment only, and no contextual link between the two instances of E52 Time-Span is implied. This property is transitive and reflexive.'),
	(324, 1, 5, 'P86i_contains', 'contains', NULL),
	(325, 1, 5, 'P89_falls_within', 'falls within', 'This property identifies an instance of E53 Place that falls wholly within the extent of another instance of E53 Place.\nIt addresses spatial containment only and does not imply any relationship between things or phenomena occupying these places.\nThis property is transitive and reflexive.'),
	(326, 1, 5, 'P89i_contains', 'contains', NULL),
	(327, 1, 5, 'P90_has_value', 'has value', 'This property allows an instance of E54 Dimension to be approximated by an instance of E60 Number primitive.'),
	(328, 1, 5, 'P90a_has_lower_value_limit', 'has lower value limit', NULL),
	(329, 1, 5, 'P90b_has_upper_value_limit', 'has upper value limit', NULL),
	(330, 1, 5, 'P91_has_unit', 'has unit', 'This property shows the type of unit an instance of E54 Dimension was expressed in.'),
	(331, 1, 5, 'P91i_is_unit_of', 'is unit of', NULL),
	(332, 1, 5, 'P92_brought_into_existence', 'brought into existence', 'This property links an instance of E63 Beginning of Existence to the instance of E77 Persistent Item brought into existence by it.\nIt allows a “start” to be attached to any instance of E77 Persistent Item being documented, i.e., as instances of E70 Thing, E72 Legal Object, E39 Actor, E41 Appellation and E55 Type.'),
	(333, 1, 5, 'P92i_was_brought_into_existence_by', 'was brought into existence by', NULL),
	(334, 1, 5, 'P93_took_out_of_existence', 'took out of existence', 'This property links an instance of E64 End of Existence to the instance of E77 Persistent Item taken out of existence by it.\nIn the case of immaterial things, the instance of E64 End of Existence is considered to take place with the destruction of the last physical carrier.\nThis allows an “end” to be attached to any instance of E77 Persistent Item being documented i.e., instances of E70 Thing, E72 Legal Object, E39 Actor, E41 Appellation and E55 Type. For many instances of E77 Persistent Item we know the maximum life-span and can infer that they must have ended to exist. We assume in that case an instance of E64 End of Existence, which may be as unnoticeable as forgetting the secret knowledge by the last representative of some indigenous nation.'),
	(335, 1, 5, 'P93i_was_taken_out_of_existence_by', 'was taken out of existence by', NULL),
	(336, 1, 5, 'P94_has_created', 'has created', 'This property links an instance of E65 Creation to the instance of E28 Conceptual Object created by it.\nIt represents the act of conceiving the intellectual content of the instance of E28 Conceptual Object. It does not represent the act of creating the first physical carrier of the instance of E28 Conceptual Object. As an example, this is the composition of a poem, not its commitment to paper.'),
	(337, 1, 5, 'P94i_was_created_by', 'was created by', NULL),
	(338, 1, 5, 'P95_has_formed', 'has formed', 'This property associates the instance of E66 Formation with the instance of E74 Group that it founded.'),
	(339, 1, 5, 'P95i_was_formed_by', 'was formed by', NULL),
	(340, 1, 5, 'P96_by_mother', 'by mother', 'This property links an instance of E67 Birth to an instance of E21 Person in the role of birth-giving mother.\nNote that biological fathers are not necessarily participants in the Birth (see P97 from father (was father for)). The instance of E21 Person being born is linked to the instance of E67 Birth with the property P98 brought into life (was born). This is not intended for use with general natural history material, only people. There is no explicit method for modelling conception and gestation except by using extensions.'),
	(341, 1, 5, 'P96i_gave_birth', 'gave birth', NULL),
	(342, 1, 5, 'P97_from_father', 'from father', 'This property links an instance of E67 Birth to an instance of E21 Person in the role of biological father.\nNote that biological fathers are not seen as necessary participants in the birth, whereas birth-giving mothers are (see P96 by mother (gave birth)). The Person being born is linked to the Birth with the property P98 brought into life (was born).\nThis is not intended for use with general natural history material, only people. There is no explicit method for modelling conception and gestation except by using extensions.\nAn instance of E67 Birth is normally (but not always) associated with one biological father.'),
	(343, 1, 5, 'P97i_was_father_for', 'was father for', NULL),
	(344, 1, 5, 'P98_brought_into_life', 'brought into life', 'This property links an instance of E67 Birth event to an instance of E21 Person in the role of offspring.\nTwins, triplets etc. are brought into life by the same instance of E67 Birth. This is not intended for use with general Natural History material, only people. There is no explicit method for modelling conception and gestation except by using extensions.'),
	(345, 1, 5, 'P98i_was_born', 'was born', NULL),
	(346, 1, 5, 'P99_dissolved', 'dissolved', 'This property associates the instance of E68 Dissolution with the instance of E74 Group that it disbanded.'),
	(347, 1, 5, 'P99i_was_dissolved_by', 'was dissolved by', NULL),
	(348, 1, 5, 'P100_was_death_of', 'was death of', 'This property links an instance of E69 Death to the instance of E21 Person that died.\nAn instance of E69 Death may involve multiple people, for example in the case of a battle or disaster.\nThis is not intended for use with general natural history material, only people.'),
	(349, 1, 5, 'P100i_died_in', 'died in', NULL),
	(350, 1, 5, 'P101_had_as_general_use', 'had as general use', 'This property associates an instance of E70 Thing with an instance of E55 Type that describes the type of use that it was actually employed for.\nIt allows the relationship between particular things, both physical and immaterial, and the general methods and techniques of real use to be documented. This may well be different from the intended functional purpose of the instance of E70 Thing (which can be documented with P103 was intended for (was intention of)). For example, it could be recorded that a particular wooden crate had a general use as a shelf support on a market stall even though it had been originally intended for carrying vegetables.\nThe use of this property is intended to allow the documentation of usage patterns attested in historical records or through scientific investigation (for instance ceramic residue analysis). It should not be used to document the intended, and thus assumed, use of an object.'),
	(351, 1, 5, 'P101i_was_use_of', 'was use of', NULL),
	(352, 1, 5, 'P102_has_title', 'has title', 'This property associates an instance of E35 Title has been applied to an instance of E71 Human-Made Thing.\nThe P102.1 has type property of the P102 has title (is title of) property enables the relationship between the title and the thing to be further clarified, for example, if the title was a given title, a supplied title etc.\nIt allows any human-made material or immaterial thing to be given a title. It is possible to imagine a title being created without a specific object in mind.'),
	(353, 1, 5, 'P102i_is_title_of', 'is title of', NULL),
	(354, 1, 5, 'P103_was_intended_for', 'was intended for', 'This property links an instance of E71 Human-Made Thing to an instance of E55 Type describing its intended usage.\nIt creates a relation between specific human-made things, both physical and immaterial, to types of intended methods and techniques of use. Note: A link between specific human-made things and a specific use activity should be expressed using P19 was intended use of (was made for).'),
	(355, 1, 5, 'P103i_was_intention_of', 'was intention of', NULL),
	(356, 1, 5, 'P104_is_subject_to', 'is subject to', 'This property links a particular instance of E72 Legal Object to the instances of E30 Right to which it is subject.\nThe Right is held by an E39 Actor as described by P75 possesses (is possessed by).'),
	(357, 1, 5, 'P104i_applies_to', 'applies to', NULL),
	(358, 1, 5, 'P105_right_held_by', 'right held by', 'This property identifies the instance of E39 Actor who holds the instances of E30 Right to an instance of E72 Legal Object.\nIt is a superproperty of P52 has current owner (is current owner of) because ownership is a right that is held on the owned object.\nThis property is a shortcut of the fully developed path from E72 Legal Object, P104 is subject to, E30 Right, P75i is possessed by to E39 Actor.'),
	(359, 1, 5, 'P105i_has_right_on', 'has right on', NULL),
	(360, 1, 5, 'P106_is_composed_of', 'is composed of', 'This property associates an instance of E90 Symbolic Object with a part of it that is by itself an instance of E90 Symbolic Object, such as fragments of texts or clippings from an image.\nThis property is transitive asymmetric.'),
	(361, 1, 5, 'P106i_forms_part_of', 'forms part of', NULL),
	(362, 1, 5, 'P107_has_current_or_former_member', 'has current or former member', 'This property associates an instance of E74 Group with an instance of E39 Actor that is or has been a member thereof.\nInstances of E74 Group and E21 Person may all be members of instances of E74 Group. An instance of E74 Group may be founded initially without any member.\nThis property is a shortcut of the more fully developed path from E74 Group, P144i gained member by, E85 Joining, P143 joined to E39 Actor.\nThe property P107.1 kind of member can be used to specify the type of membership or the role the member has in the group.'),
	(363, 1, 5, 'P107i_is_current_or_former_member_of', 'is current or former member of', NULL),
	(364, 1, 5, 'P108_has_produced', 'has produced', 'This property identifies the instance of E24 Physical Human-Made Thing that came into existence as a result of the instance of E12 Production.\nThe identity of an instance of E24 Physical Human-Made Thing is not defined by its matter, but by its existence as a subject of documentation. An E12 Production can result in the creation of multiple instances of E24 Physical Human-Made Thing.'),
	(365, 1, 5, 'P108i_was_produced_by', 'was produced by', NULL),
	(366, 1, 5, 'P109_has_current_or_former_curator', 'has current or former curator', 'This property identifies the instance of E39 Actor who assumed or have assumed overall curatorial responsibility for an instance of E78 Curated Holding.\nIt does not allow a history of curation to be recorded. This would require use of an event initiating a curator being responsible for a collection.'),
	(367, 1, 5, 'P109i_is_current_or_former_curator_of', 'is current or former curator of', NULL),
	(368, 1, 5, 'P110_augmented', 'augmented', 'This property identifies the instance of E24 Physical Human-Made Thing that is added to (augmented) in an instance of E79 Part Addition.\nAlthough an instance of E79 Part Addition event normally concerns only one instance of E24 Physical Human-Made Thing, it is possible to imagine circumstances under which more than one item might be added to (augmented). For example, the artist Jackson Pollock trailing paint onto multiple canvasses.'),
	(369, 1, 5, 'P110i_was_augmented_by', 'was augmented by', NULL),
	(370, 1, 5, 'P111_added', 'added', 'This property identifies the instance of E18 Physical Thing that is added during an instance of E79 Part Addition activity.'),
	(371, 1, 5, 'P111i_was_added_by', 'was added by', NULL),
	(372, 1, 5, 'P112_diminished', 'diminished', 'This property identifies the instance of E18 Physical Thing that was diminished by an instance of E80 Part Removal.\nAlthough an instance of E80 Part removal activity normally concerns only one instance of E18 Physical Thing, it is possible to imagine circumstances under which more than one item might be diminished by a single instance of E80 Part Removal activity.'),
	(373, 1, 5, 'P112i_was_diminished_by', 'was diminished by', NULL),
	(374, 1, 5, 'P113_removed', 'removed', 'This property identifies the instance of E18 Physical Thing that is removed during an instance of E80 Part Removal activity.'),
	(375, 1, 5, 'P113i_was_removed_by', 'was removed by', NULL),
	(376, 1, 5, 'P121_overlaps_with', 'overlaps with', 'This symmetric property associates an instance of E53 Place with another instance of E53 Place geometrically overlapping it.\nIt does not specify anything about the shared area. This property is purely spatial. It does not imply that phenomena that define, by their extent, places related by P121 overlaps with have ever covered a common area at the same time or even coexisted. In contrast, spatiotemporal overlaps described by P132 spatiotemporally overlaps are the total of areas simultaneously covered by the related spacetime volumes.\nThis property is symmetric. This property is reflexive.'),
	(377, 1, 5, 'P122_borders_with', 'borders with', 'This symmetric property associates an instance of E53 Place with another instance of E53 Place which shares a part of its border.\nThis property is purely spatial. It does not imply that the phenomena that define, by their extent, places related by P122 borders with have ever shared a respective border at the same time or even coexisted. In particular, this may be the case when the respective common border is formed by a natural feature.\nThis property is not transitive. This property is symmetric.'),
	(378, 1, 5, 'P123_resulted_in', 'resulted in', 'This property identifies the instance or instances of E18 Physical Thing that are the result of an instance of E81 Transformation. New items replace the transformed item or items, which cease to exist as units of documentation. The physical continuity between the old and the new is expressed by the links to the common instance of E81 Transformation.'),
	(379, 1, 5, 'P123i_resulted_from', 'resulted from', NULL),
	(380, 1, 5, 'P124_transformed', 'transformed', 'This property identifies the instance or instances E18 Physical Thing that have ceased to exist due to an instance of E81 Transformation.\nThe item that has ceased to exist and was replaced by the result of the Transformation. The continuity between both items, the new and the old, is expressed by the links to the common instance of E81 Transformation.'),
	(381, 1, 5, 'P124i_was_transformed_by', 'was transformed by', NULL),
	(382, 1, 5, 'P125_used_object_of_type', 'used object of type', 'This property associates an instance of E7 Activity to an instance of E55 Type, which classifies an instance of E70 Thing used in an instance of E7 Activity, when the specific instance is either unknown or not of interest, such as use of "a hammer".\nThis property is a shortcut of the more fully developed path from E7 Activity through P16 used specific object, E70 Thing, P2 has type, to E55 Type'),
	(383, 1, 5, 'P125i_was_type_of_object_used_in', 'was type of object used in', NULL),
	(384, 1, 5, 'P126_employed', 'employed', 'This property identifies the instance of E57 Material employed in an instance of E11 Modification.\nThe instance of E57 Material used during the instance of E11 Modification does not necessarily become incorporated into the instance of E24 Physical Human-Made Thing that forms the subject of the instance of E11 Modification.'),
	(385, 1, 5, 'P126i_was_employed_in', 'was employed in', NULL),
	(386, 1, 5, 'P127_has_broader_term', 'has broader term', 'This property associates an instance of E55 Type with another instance of E55 Type that has a broader meaning.\nIt allows instances of E55 Types to be organised into hierarchies. This is the sense of "broader term generic (BTG)" as defined in ISO 25964-2:2013 (International Organization for Standardization 2013).\nThis property is transitive. This property is asymmetric.'),
	(387, 1, 5, 'P127i_has_narrower_term', 'has narrower term', NULL),
	(388, 1, 5, 'P128_carries', 'carries', 'This property identifies an instance E90 Symbolic Object carried by an instance of E18 Physical Thing. Since an instance of E90 Symbolic Object is defined as an immaterial idealization over potentially multiple carriers, any individual realization on a particular physical carrier may be defective, due to deterioration or shortcomings in the process of creating the realization compared to the intended ideal. As long as such defects do not substantially affect the complete recognition of the respective symbolic object, it is still regarded as carrying an instance of this E90 Symbolic Object. If these defects are of scholarly interest, the particular realization can be modelled as an instance of E25 Human-Made Feature. Note, that any instance of E90 Symbolic Object incorporated (P165) in the carried symbolic object is also carried by the same instance of E18 Physical Thing.'),
	(389, 1, 5, 'P128i_is_carried_by', 'is carried by', NULL),
	(390, 1, 5, 'P129_is_about', 'is about', 'This property documents that an instance of E89 Propositional Object has as subject an instance of E1 CRM Entity.\nThis differs from P67 refers to (is referred to by), which refers to an instance of E1 CRM Entity, in that it describes the primary subject or subjects of an instance of E89 Propositional Object.'),
	(391, 1, 5, 'P129i_is_subject_of', 'is subject of', NULL),
	(392, 1, 5, 'P130_shows_features_of', 'shows features of', 'This property generalises the notions of "copy of" and "similar to" into a directed relationship, where the domain expresses the derivative or influenced item and the range the source or influencing item, if such a direction can be established. The property can also be used to express similarity in cases that can be stated between two objects only, without historical knowledge about its reasons. The property expresses a symmetric relationship in case no direction of influence can be established either from evidence on the item itself or from historical knowledge. This holds in particular for siblings of a derivation process from a common source or non-causal cultural parallels, such as some weaving patterns.\nThe P130.1 kind of similarity property of the P130 shows features of (features are also found on) property enables the relationship between the domain and the range to be further clarified, in the sense from domain to range, if applicable. For example, it may be expressed if both items are product “of the same mould”, or if two texts “contain identical paragraphs”.\nIf the reason for similarity is a sort of derivation process, i.e., that the creator has used or had in mind the form of a particular thing during the creation or production, this process should be explicitly modelled. In these cases, P130 shows features of can be regarded as a shortcut of such a process. However, the current model does not contain any path specific enough to infer this property. Specializations of the CIDOC CRM may however be more explicit, for instance describing the use of moulds etc.\nThis property is not transitive. This property is irreflexive.'),
	(393, 1, 5, 'P130i_features_are_also_found_on', 'features are also found on', NULL),
	(394, 1, 5, 'P132_spatiotemporally_overlaps_with', 'spatiotemporally overlaps with', 'This symmetric property associates two instances of E92 Spacetime Volume that have some of their extents in common. If only the fuzzy boundaries of the instances of E92 Spacetime Volume overlap, this property cannot be determined from observation alone and therefore should not be applied. However, there may be other forms of justification that the two instances of E92 Spacetime Volume must have some of their extents in common regardless of where and when precisely.\nIf this property holds for two instances of E92 Spacetime Volume then it cannot be the case that P133 is spatiotemporally separated from also holds for the same two instances. Furthermore, there are cases where neither P132 spatiotemporally overlaps with nor P133 is spatiotemporally separated from holds between two instances of E92 Spacetime Volume. This would occur where only an overlap of the fuzzy boundaries of the two instances of E92 Spacetime Volume occurs and no other evidence is available.\nThis property is not transitive. This property is symmetric. This property is reflexive.'),
	(395, 1, 5, 'P133_is_spatiotemporally_separated_from', 'is spatiotemporally separated from', 'This symmetric property associates two instances of E92 Spacetime Volume that have no extents in common. If only the fuzzy boundaries of the instances of E92 Spacetime Volume overlap, this property cannot be determined from observation alone and therefore should not be applied. However, there may be other forms of justification that the two instances of E92 Spacetime Volume must not have any of their extents in common regardless of where and when precisely.\nIf this property holds for two instances of E92 Spacetime Volume then it cannot be the case that P132 spatiotemporally overlaps with also holds for the same two instances. Furthermore, there are cases where neither P132 spatiotemporally overlaps with nor P133 is spatiotemporally separated from holds between two instances of E92 Spacetime Volume. This would occur where only an overlap of the fuzzy boundaries of the two instances of E92 Spacetime Volume occurs and no other evidence is available.\nThis property is not transitive. This property is symmetric. This property is irreflexive.'),
	(396, 1, 5, 'P134_continued', 'continued', 'This property associates two instances of E7 Activity, where the domain is considered as an intentional continuation of the range. A continuation of an activity may happen when the continued activity is still ongoing or after the continued activity has completely ended. The continuing activity may have started already before it decided to continue the other one. Continuation implies a coherence of intentions and outcomes of the involved activities.\nThis property is not transitive. This property is asymmetric.'),
	(397, 1, 5, 'P134i_was_continued_by', 'was continued by', NULL),
	(398, 1, 5, 'P135_created_type', 'created type', 'This property identifies the instance of E55 Type, which is created in an instance of E83 Type Creation activity.'),
	(399, 1, 5, 'P135i_was_created_by', 'was created by', NULL),
	(400, 1, 5, 'P136_was_based_on', 'was based on', 'This property identifies one or more instances of E1 CRM Entity that were used as evidence to declare a new instance of E55 Type.\nThe examination of these items is often the only objective way to understand the precise characteristics of a new type. Such items should be deposited in a museum or similar institution for that reason. The taxonomic role renders the specific relationship of each item to the type, such as "holotype" or "original element".'),
	(401, 1, 5, 'P136i_supported_type_creation', 'supported type creation', NULL),
	(402, 1, 5, 'P137_exemplifies', 'exemplifies', 'This property associates an instance of E1 CRM Entity with an instance of E55 Type for which it has been declared to be a particularly characteristic example.\nThe P137.1 in the taxonomic role property of P137 exemplifies (is exemplified by) allows differentiation of taxonomic roles. The taxonomic role renders the specific relationship of this example to the type, such as "prototypical", "archetypical", "lectotype", etc. The taxonomic role "lectotype" is not associated with the instance of E83 Type Creation itself but is selected in a later phase.'),
	(403, 1, 5, 'P137i_is_exemplified_by', 'is exemplified by', NULL),
	(404, 1, 5, 'P138_represents', 'represents', 'This property establishes the relationship between an instance of E36 Visual Item and the instance of E1 CRM Entity that it visually represents.\nAny entity may be represented visually. This property is part of the fully developed path from E24 Physical Human-Made Thing through P65 shows visual item (is shown by), E36 Visual Item, P138 represents (has representation) to E1 CRM Entity, which is shortcut by P62 depicts (is depicted by). P138.1 mode of representation allows the nature of the representation to be refined.\nThis property is also used for the relationship between an original and a digitisation of the original by the use of techniques such as digital photography, flatbed or infrared scanning. Digitisation is here seen as a process with a mechanical, causal component rendering the spatial distribution of structural and optical properties of the original and does not necessarily include any visual similarity identifiable by human observation.'),
	(405, 1, 5, 'P138i_has_representation', 'has representation', NULL),
	(406, 1, 5, 'P139_has_alternative_form', 'has alternative form', 'This property associates an instance of E41 Appellation with another instance of E41 Appellation that constitutes a derivative or variant of the former and that may also be used for identifying items identified by the former, in suitable contexts, independent from the particular item to be identified. This property should not be confused with additional variants of names used characteristically for a single, particular item, such as individual nicknames. It is a directed relationship, where the range expresses the derivative or variant and the domain the source of derivation or original form of variation, if such a direction can be established. Otherwise, the relationship is symmetric.\nMultiple names assigned to an object, which do not apply to all things identified with the specific instance of E41 Appellation, should be modelled as repeated values of P1 is identified by (identifies) of this object.\nP139.1 has type allows the type of derivation to be refined, for instance “transliteration from Latin 1 to ASCII”.'),
	(407, 1, 5, 'P139i_is_alternative_form_of', 'is alternative form of', NULL),
	(408, 1, 5, 'P140_assigned_attribute_to', 'assigned attribute to', 'This property associates an instance of E13 Attribute Assignment with the instance of E1 CRM Entity about which it made an attribution. The instance of E1 CRM Entity plays the role of the domain of the attribution.\nThe kind of attribution made should be documented using P177 assigned property of type (is type of property assigned).'),
	(409, 1, 5, 'P140i_was_attributed_by', 'was attributed by', NULL),
	(410, 1, 5, 'P141_assigned', 'assigned', 'This property associates an instance of E13 Attribute Assignment with the instance of E1 CRM Entity used in the attribution. The instance of E1 CRM Entity here plays the role of the range of the attribution.\nThe kind of attribution made should be documented using P177 assigned property of type (is type of property assigned).'),
	(411, 1, 5, 'P141i_was_assigned_by', 'was assigned by', NULL),
	(412, 1, 5, 'P142_used_constituent', 'used constituent', 'This property associates an instance of E15 Identifier Assignment with the instance of E90 Symbolic Object used as constituent of an instance of E42 Identifier in this act of assignment.'),
	(413, 1, 5, 'P142i_was_used_in', 'was used in', NULL),
	(414, 1, 5, 'P143_joined', 'joined', 'This property identifies the instance of E39 Actor that becomes member of an instance of E74 Group in an instance of E85 Joining.\nJoining events allow for describing actors becoming members of a group with the more detailed path E74 Group, P144i gained member by, E85 Joining, P143 joined, E39 Actor, compared to the shortcut offered by P107 has current or former member (is current or former member of).'),
	(415, 1, 5, 'P143i_was_joined_by', 'was joined by', NULL),
	(416, 1, 5, 'P144_joined_with', 'joined with', 'This property identifies the instance of E74 Group of which an instance of E39 Actor becomes a member through an instance of E85 Joining.\nAlthough a joining activity normally concerns only one instance of E74 Group, it is possible to imagine circumstances under which becoming member of one Group implies becoming member of another Group as well.\nJoining events allow for describing people becoming members of a group with a more detailed path from E74 Group through, P144i gained member by, E85 Joining, P143 joined, E39 Actor, compared to the shortcut offered by P107 has current or former member (is current or former member of).\nThe property P144.1 kind of member can be used to specify the type of membership or the role the member has in the group.'),
	(417, 1, 5, 'P144i_gained_member_by', 'gained member by', NULL),
	(418, 1, 5, 'P145_separated', 'separated', 'This property identifies the instance of E39 Actor that leaves an instance of E74 Group through an instance of E86 Leaving.'),
	(419, 1, 5, 'P145i_left_by', 'left by', NULL),
	(420, 1, 5, 'P146_separated_from', 'separated from', 'This property identifies the instance of E74 Group an instance of E39 Actor leaves through an instance of E86 Leaving.\nAlthough a leaving activity normally concerns only one instance of E74 Group, it is possible to imagine circumstances under which leaving one E74 Group implies leaving another E74 Group as well.'),
	(421, 1, 5, 'P146i_lost_member_by', 'lost member by', NULL),
	(422, 1, 5, 'P147_curated', 'curated', 'This property associates an instance of E87 Curation Activity with the instance of E78 Curated Holding with that is subject of that curation activity following some implicit or explicit curation plan.'),
	(423, 1, 5, 'P147i_was_curated_by', 'was curated by', NULL),
	(424, 1, 5, 'P148_has_component', 'has component', 'This property associates an instance of E89 Propositional Object with a structural part of it that is by itself an instance of E89 Propositional Object.\nThis property is transitive. This property is asymmetric.'),
	(425, 1, 5, 'P148i_is_component_of', 'is component of', NULL),
	(426, 1, 5, 'P150_defines_typical_parts_of', 'defines typical parts of', 'This property associates an instance of E55 Type “A” with an instance of E55 Type “B”, when items of type “A” typically form part of items of type “B”, such as “car motors” and “cars”.\nIt allows types to be organised into hierarchies based on one type describing a typical part of another. This property is equivalent to "broader term partitive (BTP)" as defined in ISO 2788 and “broaderPartitive” in SKOS.\nThis property is not transitive. This property is asymmetric.'),
	(427, 1, 5, 'P150i_defines_typical_wholes_for', 'defines typical wholes for', NULL),
	(428, 1, 5, 'P151_was_formed_from', 'was formed from', 'This property associates an instance of E66 Formation with an instance of E74 Group from which the new group was formed preserving a sense of continuity such as in mission, membership or tradition.'),
	(429, 1, 5, 'P151i_participated_in', 'participated in', NULL),
	(430, 1, 5, 'P152_has_parent', 'has parent', 'This property associates an instance of E21 Person with another instance of E21 Person who plays the role of the first instance’s parent, regardless of whether the relationship is biological parenthood, assumed or pretended biological parenthood or an equivalent legal status of rights and obligations obtained by a social or legal act.\nThis property is, among others, a shortcut of the fully developed paths from E21 Person through P98i was born, E67 Birth, P96 by mother to E21 Person, and from E21 Person through P98i was born, E67 Birth, P97 from father to E21 Person.\nThis property is not transitive. This property is irreflexive.'),
	(431, 1, 5, 'P152i_is_parent_of', 'is parent of', NULL),
	(432, 1, 5, 'P156_occupies', 'occupies', 'This property describes the largest volume in space, an instance of E53 Place, that an instance of E18 Physical Thing has occupied at any time during its existence, with respect to the reference space relative to the physical thing itself. This allows for describing the thing itself as a place that may contain other things, such as a box that may contain coins. In other words, it is the volume that contains all the points which the thing has covered at some time during its existence. The reference space for the associated place must be the one that is permanently at rest (P157 is at rest relative to) relative to the physical thing. For instances of E19 Physical Objects it is the one which is at rest relative to the object itself, i.e., which moves together with the object. For instances of E26 Physical Feature it is one which is at rest relative to the physical feature itself and the surrounding matter immediately connected to it. Therefore, there is a 1:1 relation between the instance E18 Physical Thing and the instance of E53 Place it occupies. We include in the occupied space the space filled by the matter of the physical thing and all its inner spaces.\nThis property implies the fully developed path from E18 Physical Thing through P196 defines, E92 Spacetime Volume, P161 has spatial projection to E53 Place. However, in contrast to P156 occupies, the property P161 has spatial projection does not constrain the reference space of the referred instance of E53 Place.\nIn contrast to P156 occupies, for the property P53 has former or current location the following holds:\nIt does not constrain the reference space of the referred instance of E53 Place.\nIt identifies a possibly wider instance of E53 Place at which a thing is or has been for some unspecified time-span.\nIf the reference space of the referred instance of E53 Place is not at rest with respect to the physical thing found there, the physical thing may move away after some time to another place and/or may have been at some other place before. The same holds for the fully developed path from E18 Physical Thing through P196 defines, E92 Spacetime Volume, P161 has spatial projection to E53 Place.'),
	(433, 1, 5, 'P156i_is_occupied_by', 'is occupied by', NULL),
	(434, 1, 5, 'P157_is_at_rest_relative_to', 'is at rest relative to', 'This property associates an instance of E53 Place with the instance of E18 Physical Thing that determines a reference space for this instance of E53 Place by being at rest with respect to this reference space. The relative stability of form of an instance of E18 Physical Thing defines its default reference space. The reference space is not spatially limited to the referred thing. For example, a ship determines a reference space in terms of which other ships in its neighbourhood may be described. Larger constellations of matter, such as continental plates, may comprise many physical features that are at rest with them and define the same reference space.'),
	(435, 1, 5, 'P157i_provides_reference_space_for', 'provides reference space for', NULL),
	(436, 1, 5, 'P160_has_temporal_projection', 'has temporal projection', 'This property describes the temporal projection of an instance of E92 Spacetime Volume. The property P4 has time-span is the same as P160 has temporal projection if it is used to document an instance of E4 Period or any subclass of it.'),
	(437, 1, 5, 'P160i_is_temporal_projection_of', 'is temporal projection of', NULL),
	(438, 1, 5, 'P161_has_spatial_projection', 'has spatial projection', 'This property associates an instance of an instance of E92 Spacetime Volume with an instance of E53 Place that is the result of the spatial projection of the instance of the E92 Spacetime Volume on a reference space.\nIn general, there can be more than one useful reference space (for reference space see P156 occupies and P157 is at rest relative to) to describe the spatial projection of a spacetime volume, for example, in describing a sea battle, the difference between the battle ship and the seafloor as reference spaces. Thus, it can be seen that the projection is not unique.\nThe spatial projection is the actual spatial coverage of a spacetime volume, which normally has fuzzy boundaries except for instances of E92 Spacetime Volumes which are geometrically defined in the same reference system as the range of this property are an exception to this and do not have fuzzy boundaries. Modelling explicitly fuzzy spatial projections serves therefore as a common topological reference of different spatial approximations rather than absolute geometric determination, for instance for relating outer or inner spatial boundaries for the respective spacetime volumes.\nIn case the domain of an instance of P161 has spatial projection is an instance of E4 Period, the spatial projection describes all areas that period was ever present at, for instance, the Roman Empire.\nThis property is part of the fully developed path from E18 Physical Thing through P196 defines, E92 Spacetime Volume, P161 has spatial projection to E53 Place, which in turn is implied by P156 occupies (is occupied by).\nThis property is part of the fully developed path from E4 Period through P161 has spatial projection, E53 Place, P89 falls within (contains) to E53 Place, which in turn is shortcut by P7 took place at (witnessed).'),
	(439, 1, 5, 'P161i_is_spatial_projection_of', 'is spatial projection of', NULL),
	(440, 1, 5, 'P164_is_temporally_specified_by', 'is temporally specified by', 'This property relates an instance of E93 Presence with the instance of E52 Time-Span that defines the time-slice of the spacetime volume that this instance of E93 Presence is related to via the property P166 was a presence of (had presence).\nThere are two typical cases for the determination of the related instance of E52 Time-Span. In the first, it is the temporal extent of an instance of E2 Temporal Entity (documented with P4 has time-span (is time-span of)): this then documents the simultaneity of the instance of E93 Presence and the instance of E2 Temporal Entity, even if the absolute time-span is not known, and can be regarded as a phenomenal time-span. In the second, the instance of E52 Time-Span is a date range declared in or derived from historical sources or provided by dating methods: this is a declarative time-span.'),
	(441, 1, 5, 'P164i_temporally_specifies', 'temporally specifies', NULL),
	(442, 1, 5, 'P165_incorporates', 'incorporates', 'This property associates an instance of E73 Information Object with an instance of E90 Symbolic Object (or any of its subclasses) that was included in it.\nThis property makes it possible to recognise the autonomous status of the incorporated signs, which were created in a distinct context, and can be incorporated in many instances of E73 Information Object, and to highlight the difference between structural and accidental whole-part relationships between conceptual entities.\nIt accounts for many cultural facts that are quite frequent and significant: the inclusion of a poem in an anthology, the re-use of an operatic aria in a new opera, the use of a reproduction of a painting for a book cover or a CD booklet, the integration of textual quotations, the presence of lyrics in a song that sets those lyrics to music, the presence of the text of a play in a movie based on that play, etc.\nIn particular, this property allows for modelling relationships of different levels of symbolic specificity, such as the natural language words making up a particular text, the characters making up the words and punctuation, the choice of fonts and page layout for the characters.\nWhen restricted to information objects, that is, seen as a property with E73 Information Object as domain and range the property is transitive.\nA digital photograph of a manuscript page incorporates the text of a manuscript page, if the respective text is defined as a sequence of symbols of a particular type, such as Latin characters, and the resolution and quality of the digital image is sufficient to resolve these symbols so they are readable on the digital image.\nThis property is asymmetric.'),
	(443, 1, 5, 'P165i_is_incorporated_in', 'is incorporated in', NULL),
	(444, 1, 5, 'P166_was_a_presence_of', 'was a presence of', 'This property associates an instance of E93 Presence with the instance of E92 Spacetime Volume of which it represents a temporal restriction (i.e.: a time-slice). Instantiating this property constitutes a necessary part of the identity of the respective instance of E93 Presence.'),
	(445, 1, 5, 'P166i_had_presence', 'had presence', NULL),
	(446, 1, 5, 'P167_was_within', 'was within', 'This property associates an instance of E93 Presence with an instance of E53 Place that geometrically includes the spatial projection of the respective instance of E93 Presence. Besides others, this property may be used to state in which space an object has been for some known time, such as a room of a castle or in a drawer. It may also be used to describe a confinement of the spatial extent of some realm during a known time-span.\nThis property is a shortcut of the more fully developed path from E93 Presence through P161 has spatial projection, E53 Place, P89 falls within (contains) to E53 Place.'),
	(447, 1, 5, 'P167i_includes', 'includes', NULL),
	(448, 1, 5, 'P168_place_is_defined_by', 'place is defined by', 'This property associates an instance of E53 Place with an instance of E94 Space Primitive that defines it. Syntactic variants or use of different scripts may result in multiple instances of E94 Space Primitive defining exactly the same place. Transformations between different reference systems always result in new definitions of places approximating each other and not in alternative definitions.'),
	(449, 1, 5, 'P169i_spacetime_volume_is_defined_by', 'spacetime volume is defined by', 'Scope note for \'P169\': This property associates an instance of E95 Spacetime Primitive with the instance of E92 Spacetime Volume it defines.'),
	(450, 1, 5, 'P170i_time_is_defined_by', 'time is defined by', 'Scope note for \'P170\': This property associates an instance of E61 Time Primitive with the instance of E52 Time-Span that constitutes the interpretation of the terms of the time primitive as an extent in absolute, real time.\nThe quantification allows several instances of E61 Time Primitive that are each expressed in different syntactic forms, to define the same instance of E52 Time-Span.'),
	(451, 1, 5, 'P171_at_some_place_within', 'at some place within', 'This property describes the maximum spatial extent within which an instance of E53 Place falls. Since instances of E53 Places may not have precisely known spatial extents, the CIDOC CRM supports statements about maximum spatial extents of instances of E53 Place. This property allows an instance of E53 Place’s maximum spatial extent (i.e., its outer boundary) to be assigned an instance of E94 Space Primitive value.\nThis property is a shortcut of the fully developed path from E53 Place, P89 falls within, E53 Place, P168 place is defined by to E94 Space Primitive through a declarative Place that is not explicitly documented, to a Space Primitive: declarative places are defined in CRMgeo (Doerr and Hiebel 2013).'),
	(452, 1, 5, 'P172_contains', 'contains', 'This property describes a minimum spatial extent which is contained within an instance of E53 Place. Since instances of E53 Place may not have precisely known spatial extents, the CIDOC CRM supports statements about minimum spatial extents of instances of E53 Place. This property allows an instance of E53 Places’s minimum spatial extent (i.e., its inner boundary or a point being within a Place) to be assigned an instance of E94 Space Primitive value.\nThis property is a shortcut of the fully developed path from E53 Place, P89i contains, E53 Place, P168 place is defined by to E94 Space Primitive'),
	(453, 1, 5, 'P173_starts_before_or_with_the_end_of', 'starts before or with the end of', 'This property specifies that the temporal extent of the domain instance A of E2 Temporal Entity starts before or simultaneously with the end of the temporal extent of the range instance B of E2 Temporal Entity.\nIn other words, if A = [A-start, A-end] and B = [B-start, B-end], we mean A-start ≤ B-end is true.\nThis property is part of the set of temporal primitives P173 – P176, P182 – P185.\nThis property corresponds to the disjunction (logical OR) of the following Allen temporal relations (Allen, 1983): {before, meets, met-by, overlaps, starts, started-by, contains, finishes, finished-by, equals, during, overlapped by}.\nThis property is not transitive.\n\nFigure 8: Temporal entity A starts before or with the end of temporal entity B. Here A is longer than B\n\nFigure 9: Temporal entity A starts before or with the end of temporal entity B. Here A is shorter than B'),
	(454, 1, 5, 'P173i_ends_after_or_with_the_start_of', 'ends after or with the start of', NULL),
	(455, 1, 5, 'P174_starts_before_the_end_of', 'starts before the end of', 'This property specifies that the temporal extent of the domain instance A of E2 Temporal Entity starts definitely before the end of the temporal extent of the range instance B of E2 Temporal Entity.\nIn other words, if A = [A-start, A-end] and B = [B-start, B-end], we mean A-start &lt; B-end is true.\nThis property is part of the set of temporal primitives P173 – P176, P182 – P185.\nThis property corresponds to a disjunction (logical OR) of the following Allen temporal relations (Allen, 1983): {before, meets, overlaps, starts, started-by, contains, finishes, finished-by, equals, during, overlapped by}\nTypically, this property is a consequence of a known influence of some event on another event or activity, such as a novel written by someone being continued by someone else, or the knowledge of a defeat on a distant battlefield causing people to end their ongoing activities. This property is not transitive. This property is irreflexive.\n\nFigure 10: Temporal entity A starts before the end of temporal entity B. Here A is longer than B\n\nFigure 11: Temporal entity A starts before the end of temporal entity B. Here A is shorter than B'),
	(456, 1, 5, 'P174i_ends_after_the_start_of', 'ends after the start of', NULL),
	(457, 1, 5, 'P175_starts_before_or_with_the_start_of', 'starts before or with the start of', 'This property specifies that the temporal extent of the domain instance A of E2 Temporal Entity starts before or simultaneously with the start of the temporal extent of the range instance B of E2 Temporal Entity.\nIn other words, if A = [A-start, A-end] and B = [B-start, B-end], we mean A-start ≤ B-start is true.\nThis property is part of the set of temporal primitives P173 – P176, P182 – P185.\nThis property corresponds to a disjunction (logical OR) of the following Allen temporal relations (Allen, 1983): {before, meets, overlaps, starts, started-by, contains, finished-by, equals}\nIn a model with fuzzy borders, this property will not be transitive.\nThis property is irreflexive.\n\nFigure 12: Temporal entity A starts before or with the start of temporal entity B. Here A is longer than B\n\nFigure 13: Temporal entity A starts before or with the start of temporal entity B. Here A is shorter than B'),
	(458, 1, 5, 'P175i_starts_after_or_with_the_start_of', 'starts after or with the start of', NULL),
	(459, 1, 5, 'P176_starts_before_the_start_of', 'starts before the start of', 'This property specifies that the temporal extent of the domain instance A of E2 Temporal Entity starts definitely before the start of the temporal extent of the range instance B of E2 Temporal Entity.\nIn other words, if A = [A-start, A-end] and B = [B-start, B-end], we mean A-start &lt; B-start is true.\nThis property is part of the set of temporal primitives P173 – P176, P182 – P185.\nThis property corresponds to a disjunction (logical OR) of the following Allen temporal relations (Allen, 1983): {before, meets, overlaps, contains, finished-by}. This property is transitive. This property is asymmetric.\n\nFigure 14: Temporal entity A starts before the start of temporal entity B. Here A is longer than B\n\nFigure 15: Temporal entity A starts before the start of temporal entity B. Here A is shorter than B'),
	(460, 1, 5, 'P176i_starts_after_the_start_of', 'starts after the start of', NULL),
	(461, 1, 5, 'P177_assigned_property_of_type', 'assigned property of type', 'This property associates an instance of E13 Attribute Assignment with the type of property or relation that this assignment maintains to hold between the item to which it assigns an attribute and the attribute itself. Note that the properties defined by the CIDOC CRM also constitute instances of E55 Type themselves. The direction of the assigned property of type is understood to be from the attributed item (the range of property P140 assigned attribute to) to the attribute item (the range of the property P141 assigned). More than one property type may be assigned to hold between two items.\nA comprehensive explanation about refining CIDOC CRM concepts by E55 Type is given in the section “About Types” in the section on “Specific Modelling Constructs” of this document.'),
	(462, 1, 5, 'P177i_is_type_of_property_assigned', 'is type of property assigned', NULL),
	(463, 1, 5, 'P179_had_sales_price', 'had sales price', 'This property establishes the relationship between an instance of E96 Purchase and the instance of E97 Monetary Amount that forms the compensation for the transaction. The monetary amount agreed upon may change in the course of the purchase activity.'),
	(464, 1, 5, 'P179i_was_sales_price_of', 'was sales price of', NULL),
	(465, 1, 5, 'P180_has_currency', 'has currency', 'This property establishes the relationship between an instance of E97 Monetary Amount and the instance of E98 Currency that it is measured in.'),
	(466, 1, 5, 'P180i_was_currency_of', 'was currency of', NULL),
	(467, 1, 5, 'P182_ends_before_or_with_the_start_of', 'ends before or with the start of', 'This property specifies that the temporal extent of the domain instance A of E2 Temporal Entity ends before or simultaneously with the start of the temporal extent of the range instance B of E2 Temporal Entity.\nIn other words, if A = [A-start, A-end] and B = [B-start, B-end], we mean A-end ≤ B-start is true.\nThis property is part of the set of temporal primitives P173 – P176, P182 – P185.\nThis property corresponds to a disjunction (logical OR) of the following Allen temporal relations (Allen, 1983): {before, meets}.\nThis property is transitive. This property is asymmetric.\n\nFigure 16: Temporal entity A ends before or with the start of temporal entity B. Here A is longer than B\n\nFigure 17: Temporal entity A ends before or with the start of temporal entity B. Here A is shorter than B'),
	(468, 1, 5, 'P182i_starts_after_or_with_the_end_of', 'starts after or with the end of', NULL),
	(469, 1, 5, 'P183_ends_before_the_start_of', 'ends before the start of', 'This property specifies that the temporal extent of the domain instance A of E2 Temporal Entity ends definitely before the start of the temporal extent of the range instance B of E2 Temporal Entity.\nIn other words, if A = [A-start, A-end] and B = [B-start, B-end], we mean A-end &lt; B-start is true.\nThis property is part of the set of temporal primitives P173 – P176, P182 – P185.\nThis property corresponds to the following Allen temporal relation (Allen, 1983) : {before}.\nThis property is transitive. This property is asymmetric.\n\nFigure 18: Temporal entity A ends before the start of temporal entity B. Here A is longer than B\n\nFigure 19: Temporal entity A ends before the start of temporal entity B. Here A is shorter than B'),
	(470, 1, 5, 'P183i_starts_after_the_end_of', 'starts after the end of', NULL),
	(471, 1, 5, 'P184_ends_before_or_with_the_end_of', 'ends before or with the end of', 'This property specifies that the temporal extent of the domain instance A of E2 Temporal Entity ends before or simultaneously with the end of the temporal extent of the range instance B of E2 Temporal Entity.\nIn other words, if A = [A-start, A-end] and B = [B-start, B-end], we mean A-end ≤ B-end is true.\nThis property is part of the set of temporal primitives P173 – P176, P182 – P185.\nThis property corresponds to a disjunction (logical OR) of the following Allen temporal relations (Allen, 1983): {before, meets, overlaps, finished by, start, equals, during, finishes}.\nThis property is irreflexive\n\nFigure 20: Temporal entity A ends before or with the end of temporal entity B. Here A is longer than B\n\nFigure 21: Temporal entity A ends before or with the end of temporal entity B. Here A is shorter than B'),
	(472, 1, 5, 'P184i_ends_with_or_after_the_end_of', 'ends with or after the end of', NULL),
	(473, 1, 5, 'P185_ends_before_the_end_of', 'ends before the end of', 'This property specifies that the temporal extent of the domain instance A of E2 Temporal Entity ends definitely before the end of the temporal extent of the range instance B of E2 Temporal Entity.\nIn other words, if A = [A-start, A-end] and B = [B-start, B-end], we mean A-end &lt; B-end is true.\nThis property is part of the set of temporal primitives P173 – P176, P182 – P185.\nThis property corresponds to a disjunction (logical OR) of the following Allen temporal relations (Allen, 1983): {before, meets, overlaps, starts, during}.\nThis property is transitive. This property is asymmetric.\n\nFigure 22: Temporal entity A ends before the end of temporal entity B. Here A is longer than B\n\nFigure 23: Temporal entity A ends before the end of temporal entity B. Here A is shorter than B'),
	(474, 1, 5, 'P185i_ends_after_the_end_of', 'ends after the end of', NULL),
	(475, 1, 5, 'P186_produced_thing_of_product_type', 'produced thing of product type', 'This property associates an instance of E12 Production with the instance of E99 Production Type, that is, the type of the things it produces.'),
	(476, 1, 5, 'P186i_is_produced_by', 'is produced by', NULL),
	(477, 1, 5, 'P187_has_production_plan', 'has production plan', 'This property associates an instance of E99 Product Type with an instance of E29 Design or Procedure that completely determines the production of instances of E18 Physical Thing. The resulting instances of E18 Physical Thing are considered exemplars of this instance of E99 Product Type when the process specified is correctly executed. Note that the respective instance of E29 Design or Procedure may not necessarily be fixed in a written/graphical form, and may require the use of tools or models unique to the product type. The same instance of E99 Product Type may be associated with several variant plans.'),
	(478, 1, 5, 'P187i_is_production_plan_for', 'is production plan for', NULL),
	(479, 1, 5, 'P188_requires_production_tool', 'requires production tool', 'This property associates an instance of E99 Product Type with an instance of E19 Physical Object that is needed for the production of an instance of E18 Physical Thing. When the process of production is correctly executed in accordance with the plan and using the specified instance of E19 Physical Object, the resulting instance of E18 Physical Thing is considered an exemplar of this instance of E99 Product Type. The instance of E19 Physical Object may bear distinct features that are transformed into characteristic features of the resulting instance of E18 Physical Thing. Examples include models and moulds.'),
	(480, 1, 5, 'P188i_is_production_tool_for', 'is production tool for', NULL),
	(481, 1, 5, 'P189_approximates', 'approximates', 'This property associates an instance of E53 Place with another instance of E53 Place, which is defined in the same reference space, and which is used to approximate the former. The property does not necessarily state the quality or accuracy of this approximation, but rather indicates the use of the first instance of place to approximate the second.\nIn common documentation practice, find or encounter spots e.g., in archaeology, botany or zoology are often related to the closest village, river or other named place without detailing the relation, e.g., if it is located within the village or in a certain distance of the specified place. In this case the stated “phenomenal” place found in the documentation can be seen as approximation of the actual encounter spot without more specific knowledge.\nIn more recent documentation often point coordinate information is provided that originates from GPS measurements or georeferencing from a map. This point coordinate information does not state the actual place of the encounter spot but tries to approximate it with a “declarative” place. The accuracy depends on the methodology used when creating the coordinates. It may be dependent on technical limitations like GPS accuracy but also on the method where the GPS location is taken in relation to the measured feature. If the methodology is known a maximum deviation from the measured point can be calculated and the encounter spot or feature may be related to the resulting circle using an instance of P171 at some place within.\nThis property is not transitive. This property is reflexive.'),
	(482, 1, 5, 'P189i_is_approximated_by', 'is approximated by', NULL),
	(483, 1, 5, 'P190_has_symbolic_content', 'has symbolic content', 'This property associates an instance of E90 Symbolic Object with a complete, identifying representation of its content in the form of an instance of E62 String.\nThis property only applies to instances of E90 Symbolic Object that can be represented completely in this form. The representation may be more specific than the symbolic level defining the identity condition of the represented. This depends on the type of the symbolic object represented. For instance, if a name has type "Modern Greek character sequence", it may be represented in a loss-free Latin transcription, meaning however the sequence of Greek letters.\nAs another example, if the represented object has type "English words sequence", American English or British English spelling variants may be chosen to represent the English word "colour" without defining a different symbolic object. If a name has type "European traditional name", no particular string may define its content.'),
	(484, 1, 5, 'P191_had_duration', 'had duration', 'This property describes the length of time covered by an instance of E52 Time-Span. It allows an instance of E52 Time-Span to be associated with an instance of E54 Dimension representing duration independent from the actual beginning and end. Indeterminacy of the duration value can be expressed by assigning a numerical interval to the property P90 has value of E54 Dimension.'),
	(485, 1, 5, 'P191i_was_duration_of', 'was duration of', NULL),
	(486, 1, 5, 'P195_was_a_presence_of', 'was a presence of', 'This property associates an instance of E93 Presence with the instance of E18 Physical Thing of which it represents a temporal restriction (i.e.: a time-slice) of the thing’s trajectory through spacetime. In other words, it describes where the instance of E18 Physical Thing was or moved around within a given time-span. Instantiating this property constitutes a necessary part of the identity of the respective instance of E93 Presence.\nThis property is a strong shortcut of the fully developed path from E18 Physical Thing through P196 defines, E92 Spacetime Volume, P166 was a presence of (had presence) to E93 Presence.'),
	(487, 1, 5, 'P195i_had_presence', 'had presence', NULL),
	(488, 1, 5, 'P196_defines', 'defines', 'This property associates an instance of E18 Physical Thing with the instance of E92 Spacetime Volume that constitutes the complete trajectory of its geometric extent through spacetime for the whole time of the existence of the instance of E18 Physical Thing.\nAn instance of E18 Physical Thing not only occupies a particular geometric space at each instant of its existence, but in the course of its existence it also forms a trajectory through spacetime, which occupies a real, that is phenomenal, volume in spacetime, i.e., the instance of E92 Spacetime Volume this property associates it with. This real spatiotemporal extent of the instance of E18 Physical Thing is regarded as being unique, in all its details and fuzziness; the identity and existence of the E92 Spacetime Volume depends uniquely on the identity of the instance of E18 Physical Thing, whose existence defines it. It constitutes a phenomenal spacetime volume as defined in CRMgeo (Doerr &amp; Hiebel, 2013).\nIncluded in this spacetime volume are both the spaces filled by the matter of the physical thing and any inner space that may exist, for instance the interior of a box. Physical things consisting of aggregations of physically unconnected objects, such as a set of chessmen, occupy a finite number of individually contiguous subsets of this spacetime volume equal to the number of objects that constitute the set and that are never connected during its existence.'),
	(489, 1, 5, 'P196i_is_defined_by', 'is defined by', NULL),
	(490, 1, 5, 'P197_covered_parts_of', 'covered parts of', 'This property associates an instance of E93 Presence with an instance of E53 Place that geometrically overlaps with the spatial projection of the respective instance of E93 Presence. A use case of this property is to state through which places an object or an instance of E21 Person has or was moved within a given time-span. It may also be used to describe a partial or complete, temporary or permanent extension of the spatial extent of some realm into a neighbouring region during a known time-span. It may also be used to describe a partial or complete, temporary or permanent extension of the spatial extent of some realm into a neighbouring region during a known time-span.\nThis property is a shortcut of the more fully developed path from E93 Presence through P161 has spatial projection, E53 Place, P121 overlaps with, to E53 Place.'),
	(491, 1, 5, 'P197i_was_partially_covered_by', 'was partially covered by', NULL),
	(492, 1, 5, 'P198_holds_or_supports', 'holds or supports', 'This property relates one instance of E18 Physical Thing which acts as a container or support to a supported or contained instance of E18 Physical Thing. Typical examples of E18 Physical Things which are intended to function as a container or support include shelves, folders or boxes. These containers or supports provide a stable surface which is intended for other physical objects to be placed upon for storage, display, transport or other similar functions.\nThis property is a shortcut of the more fully developed path from E18 Physical Thing through P59 has section, E53 Place, P53i is former or current location of, to E18 Physical Thing. It is not a sub-property of P46 is composed of, as the held or supported object is not a component of the container or support.\nThis property can be used to avoid explicitly instantiating the E53 Place which is defined by an instance of E18 Physical Thing, especially when the only intended use of that instance of E18 Physical Thing is to act as a container or surface for the storage of other instances of E18 Physical Thing. The place’s existence is defined by the existence of the container or surface, and will go out of existence at the same time as the destruction of the container or surface.\nThis property is transitive. This property is asymmetric.'),
	(493, 1, 5, 'P198i_is_held_or_supported_by', 'is held or supported by', NULL),
	(494, 1, 6, 'itemType', 'Item Type', 'The nature or genre of the content of one or more items within the collection.'),
	(495, 1, 6, 'itemFormat', 'Item Format', 'The media type, physical or digital, of one or more items within the collection.'),
	(496, 1, 6, 'dateItemsCreated', 'Date Items Created', 'A range of dates over which the individual items within the collection were created.'),
	(497, 1, 6, 'isLocatedAt', 'Is Located At', 'A location where the collection is held.'),
	(498, 1, 6, 'isAccessedVia', 'Is Accessed Via', 'A service that provides access to the items within the collection.'),
	(499, 1, 6, 'catalogueOrIndex', 'Catalogue or Index', 'A catalogue for, or index of, the collection.'),
	(500, 1, 6, 'associatedCollection', 'Associated Collection', 'A second collection that is associated with the current collection.'),
	(501, 1, 6, 'describedCollection', 'Described Collection', 'A collection that is described by the current collection.'),
	(502, 1, 7, 'maximumAttendeeCapacity', 'maximumAttendeeCapacity', 'The total number of individuals that may attend an event or venue.'),
	(503, 1, 7, 'printEdition', 'printEdition', 'The edition of the print product in which the NewsArticle appears.'),
	(504, 1, 7, 'actors', 'actors', 'An actor, e.g. in TV, radio, movie, video games etc. Actors can be associated with individual items or with a series, episode, clip.'),
	(505, 1, 7, 'actor', 'actor', 'An actor, e.g. in TV, radio, movie, video games etc., or in an event. Actors can be associated with individual items or with a series, episode, clip.'),
	(506, 1, 7, 'latitude', 'latitude', 'The latitude of a location. For example ```37.42242``` ([WGS 84](https://en.wikipedia.org/wiki/World_Geodetic_System)).'),
	(507, 1, 7, 'geoCoveredBy', 'geoCoveredBy', 'Represents a relationship between two geometries (or the places they represent), relating a geometry to another that covers it. As defined in [DE-9IM](https://en.wikipedia.org/wiki/DE-9IM).'),
	(508, 1, 7, 'requiredQuantity', 'requiredQuantity', 'The required quantity of the item(s).'),
	(509, 1, 7, 'price', 'price', 'The offer price of a product, or of a price component when attached to PriceSpecification and its subtypes.\\n\\nUsage guidelines:\\n\\n* Use the [[priceCurrency]] property (with standard formats: [ISO 4217 currency format](http://en.wikipedia.org/wiki/ISO_4217), e.g. "USD"; [Ticker symbol](https://en.wikipedia.org/wiki/List_of_cryptocurrencies) for cryptocurrencies, e.g. "BTC"; well known names for [Local Exchange Trading Systems](https://en.wikipedia.org/wiki/Local_exchange_trading_system) (LETS) and other currency types, e.g. "Ithaca HOUR") instead of including [ambiguous symbols](http://en.wikipedia.org/wiki/Dollar_sign#Currencies_that_use_the_dollar_or_peso_sign) such as \'$\' in the value.\\n* Use \'.\' (Unicode \'FULL STOP\' (U+002E)) rather than \',\' to indicate a decimal point. Avoid using these symbols as a readability separator.\\n* Note that both [RDFa](http://www.w3.org/TR/xhtml-rdfa-primer/#using-the-content-attribute) and Microdata syntax allow the use of a "content=" attribute for publishing simple machine-readable values alongside more human-friendly formatting.\\n* Use values from 0123456789 (Unicode \'DIGIT ZERO\' (U+0030) to \'DIGIT NINE\' (U+0039)) rather than superficially similar Unicode symbols.\n      '),
	(510, 1, 7, 'homeLocation', 'homeLocation', 'A contact location for a person\'s residence.'),
	(511, 1, 7, 'location', 'location', 'The location of, for example, where an event is happening, where an organization is located, or where an action takes place.'),
	(512, 1, 7, 'dayOfWeek', 'dayOfWeek', 'The day of the week for which these opening hours are valid.'),
	(513, 1, 7, 'cvdNumC19OFMechVentPats', 'cvdNumC19OFMechVentPats', 'numc19ofmechventpats - ED/OVERFLOW and VENTILATED: Patients with suspected or confirmed COVID-19 who are in the ED or any overflow location awaiting an inpatient bed and on a mechanical ventilator.'),
	(514, 1, 7, 'diversityStaffingReport', 'diversityStaffingReport', 'For an [[Organization]] (often but not necessarily a [[NewsMediaOrganization]]), a report on staffing diversity issues. In a news context this might be for example ASNE or RTDNA (US) reports, or self-reported.'),
	(515, 1, 7, 'publishingPrinciples', 'publishingPrinciples', 'The publishingPrinciples property indicates (typically via [[URL]]) a document describing the editorial principles of an [[Organization]] (or individual, e.g. a [[Person]] writing a blog) that relate to their activities as a publisher, e.g. ethics or diversity policies. When applied to a [[CreativeWork]] (e.g. [[NewsArticle]]) the principles are those of the party primarily responsible for the creation of the [[CreativeWork]].\n\nWhile such policies are most typically expressed in natural language, sometimes related information (e.g. indicating a [[funder]]) can be expressed using schema.org terminology.\n'),
	(516, 1, 7, 'billingDuration', 'billingDuration', 'Specifies for how long this price (or price component) will be billed. Can be used, for example, to model the contractual duration of a subscription or payment plan. Type can be either a Duration or a Number (in which case the unit of measurement, for example month, is specified by the unitCode property).'),
	(517, 1, 7, 'prescriptionStatus', 'prescriptionStatus', 'Indicates the status of drug prescription, e.g. local catalogs classifications or whether the drug is available by prescription or over-the-counter, etc.'),
	(518, 1, 7, 'monthlyMinimumRepaymentAmount', 'monthlyMinimumRepaymentAmount', 'The minimum payment is the lowest amount of money that one is required to pay on a credit card statement each month.'),
	(519, 1, 7, 'associatedMediaReview', 'associatedMediaReview', 'An associated [[MediaReview]], related by specific common content, topic or claim. The expectation is that this property would be most typically used in cases where a single activity is conducting both claim reviews and media reviews, in which case [[relatedMediaReview]] would commonly be used on a [[ClaimReview]], while [[relatedClaimReview]] would be used on [[MediaReview]].'),
	(520, 1, 7, 'associatedReview', 'associatedReview', 'An associated [[Review]].'),
	(521, 1, 7, 'infectiousAgent', 'infectiousAgent', 'The actual infectious agent, such as a specific bacterium.'),
	(522, 1, 7, 'occupancy', 'occupancy', 'The allowed total occupancy for the accommodation in persons (including infants etc). For individual accommodations, this is not necessarily the legal maximum but defines the permitted usage as per the contractual agreement (e.g. a double room used by a single person).\nTypical unit code(s): C62 for person'),
	(523, 1, 7, 'valueReference', 'valueReference', 'A secondary value that provides additional information on the original value, e.g. a reference temperature or a type of measurement.'),
	(524, 1, 7, 'jobLocation', 'jobLocation', 'A (typically single) geographic location associated with the job position.'),
	(525, 1, 7, 'geoRadius', 'geoRadius', 'Indicates the approximate radius of a GeoCircle (metres unless indicated otherwise via Distance notation).'),
	(526, 1, 7, 'steps', 'steps', 'A single step item (as HowToStep, text, document, video, etc.) or a HowToSection (originally misnamed \'steps\'; \'step\' is preferred).'),
	(527, 1, 7, 'step', 'step', 'A single step item (as HowToStep, text, document, video, etc.) or a HowToSection.'),
	(528, 1, 7, 'followup', 'followup', 'Typical or recommended followup care after the procedure is performed.'),
	(529, 1, 7, 'hasPOS', 'hasPOS', 'Points-of-Sales operated by the organization or person.'),
	(530, 1, 7, 'floorLevel', 'floorLevel', 'The floor level for an [[Accommodation]] in a multi-storey building. Since counting\n  systems [vary internationally](https://en.wikipedia.org/wiki/Storey#Consecutive_number_floor_designations), the local system should be used where possible.'),
	(531, 1, 7, 'variesBy', 'variesBy', 'Indicates the property or properties by which the variants in a [[ProductGroup]] vary, e.g. their size, color etc. Schema.org properties can be referenced by their short name e.g. "color"; terms defined elsewhere can be referenced with their URIs.'),
	(532, 1, 7, 'estimatesRiskOf', 'estimatesRiskOf', 'The condition, complication, or symptom whose risk is being estimated.'),
	(533, 1, 7, 'countryOfLastProcessing', 'countryOfLastProcessing', 'The place where the item (typically [[Product]]) was last processed and tested before importation.'),
	(534, 1, 7, 'releaseDate', 'releaseDate', 'The release date of a product or product model. This can be used to distinguish the exact variant of a product.'),
	(535, 1, 7, 'isSimilarTo', 'isSimilarTo', 'A pointer to another, functionally similar product (or multiple products).'),
	(536, 1, 7, 'trailer', 'trailer', 'The trailer of a movie or TV/radio series, season, episode, etc.'),
	(537, 1, 7, 'relatedCondition', 'relatedCondition', 'A medical condition associated with this anatomy.'),
	(538, 1, 7, 'postalCodePrefix', 'postalCodePrefix', 'A defined range of postal codes indicated by a common textual prefix. Used for non-numeric systems such as UK.'),
	(539, 1, 7, 'departureBusStop', 'departureBusStop', 'The stop or station from which the bus departs.'),
	(540, 1, 7, 'datasetTimeInterval', 'datasetTimeInterval', 'The range of temporal applicability of a dataset, e.g. for a 2011 census dataset, the year 2011 (in ISO 8601 time interval format).'),
	(541, 1, 7, 'temporalCoverage', 'temporalCoverage', 'The temporalCoverage of a CreativeWork indicates the period that the content applies to, i.e. that it describes, either as a DateTime or as a textual string indicating a time period in [ISO 8601 time interval format](https://en.wikipedia.org/wiki/ISO_8601#Time_intervals). In\n      the case of a Dataset it will typically indicate the relevant time period in a precise notation (e.g. for a 2011 census dataset, the year 2011 would be written "2011/2012"). Other forms of content, e.g. ScholarlyArticle, Book, TVSeries or TVEpisode, may indicate their temporalCoverage in broader terms - textually or via well-known URL.\n      Written works such as books may sometimes have precise temporal coverage too, e.g. a work set in 1939 - 1945 can be indicated in ISO 8601 interval format format via "1939/1945".\n\nOpen-ended date ranges can be written with ".." in place of the end date. For example, "2015-11/.." indicates a range beginning in November 2015 and with no specified final date. This is tentative and might be updated in future when ISO 8601 is officially updated.'),
	(542, 1, 7, 'cvdNumBedsOcc', 'cvdNumBedsOcc', 'numbedsocc - HOSPITAL INPATIENT BED OCCUPANCY: Total number of staffed inpatient beds that are occupied.'),
	(543, 1, 7, 'diseasePreventionInfo', 'diseasePreventionInfo', 'Information about disease prevention.'),
	(544, 1, 7, 'flightDistance', 'flightDistance', 'The distance of the flight.'),
	(545, 1, 7, 'exceptDate', 'exceptDate', 'Defines a [[Date]] or [[DateTime]] during which a scheduled [[Event]] will not take place. The property allows exceptions to\n      a [[Schedule]] to be specified. If an exception is specified as a [[DateTime]] then only the event that would have started at that specific date and time\n      should be excluded from the schedule. If an exception is specified as a [[Date]] then any event that is scheduled for that 24 hour period should be\n      excluded from the schedule. This allows a whole day to be excluded from the schedule without having to itemise every scheduled event.'),
	(546, 1, 7, 'catalogNumber', 'catalogNumber', 'The catalog number for the release.'),
	(547, 1, 7, 'costPerUnit', 'costPerUnit', 'The cost per unit of the drug.'),
	(548, 1, 7, 'comprisedOf', 'comprisedOf', 'Specifying something physically contained by something else. Typically used here for the underlying anatomical structures, such as organs, that comprise the anatomical system.'),
	(549, 1, 7, 'spokenByCharacter', 'spokenByCharacter', 'The (e.g. fictional) character, Person or Organization to whom the quotation is attributed within the containing CreativeWork.'),
	(550, 1, 7, 'salaryCurrency', 'salaryCurrency', 'The currency (coded using [ISO 4217](http://en.wikipedia.org/wiki/ISO_4217)) used for the main salary information in this job posting or for this employee.'),
	(551, 1, 7, 'acrissCode', 'acrissCode', 'The ACRISS Car Classification Code is a code used by many car rental companies, for classifying vehicles. ACRISS stands for Association of Car Rental Industry Systems and Standards.'),
	(552, 1, 7, 'exercisePlan', 'exercisePlan', 'A sub property of instrument. The exercise plan used on this action.'),
	(553, 1, 7, 'instrument', 'instrument', 'The object that helped the agent perform the action. E.g. John wrote a book with *a pen*.'),
	(554, 1, 7, 'endorsers', 'endorsers', 'People or organizations that endorse the plan.'),
	(555, 1, 7, 'transFatContent', 'transFatContent', 'The number of grams of trans fat.'),
	(556, 1, 7, 'guidelineDate', 'guidelineDate', 'Date on which this guideline\'s recommendation was made.'),
	(557, 1, 7, 'issueNumber', 'issueNumber', 'Identifies the issue of publication; for example, "iii" or "2".'),
	(558, 1, 7, 'position', 'position', 'The position of an item in a series or sequence of items.'),
	(559, 1, 7, 'workLocation', 'workLocation', 'A contact location for a person\'s place of work.'),
	(560, 1, 7, 'hiringOrganization', 'hiringOrganization', 'Organization or Person offering the job position.'),
	(561, 1, 7, 'broadcastChannelId', 'broadcastChannelId', 'The unique address by which the BroadcastService can be identified in a provider lineup. In US, this is typically a number.'),
	(562, 1, 7, 'query', 'query', 'A sub property of instrument. The query used on this action.'),
	(563, 1, 7, 'jobImmediateStart', 'jobImmediateStart', 'An indicator as to whether a position is available for an immediate start.'),
	(564, 1, 7, 'applicationSuite', 'applicationSuite', 'The name of the application suite to which the application belongs (e.g. Excel belongs to Office).'),
	(565, 1, 7, 'aircraft', 'aircraft', 'The kind of aircraft (e.g., "Boeing 747").'),
	(566, 1, 7, 'grantee', 'grantee', 'The person, organization, contact point, or audience that has been granted this permission.'),
	(567, 1, 7, 'medicineSystem', 'medicineSystem', 'The system of medicine that includes this MedicalEntity, for example \'evidence-based\', \'homeopathic\', \'chiropractic\', etc.'),
	(568, 1, 7, 'correctionsPolicy', 'correctionsPolicy', 'For an [[Organization]] (e.g. [[NewsMediaOrganization]]), a statement describing (in news media, the newsroom’s) disclosure and correction policy for errors.'),
	(569, 1, 7, 'sizeSystem', 'sizeSystem', 'The size system used to identify a product\'s size. Typically either a standard (for example, "GS1" or "ISO-EN13402"), country code (for example "US" or "JP"), or a measuring system (for example "Metric" or "Imperial").'),
	(570, 1, 7, 'playersOnline', 'playersOnline', 'Number of players on the server.'),
	(571, 1, 7, 'industry', 'industry', 'The industry associated with the job position.'),
	(572, 1, 7, 'menuAddOn', 'menuAddOn', 'Additional menu item(s) such as a side dish of salad or side order of fries that can be added to this menu item. Additionally it can be a menu section containing allowed add-on menu items for this menu item.'),
	(573, 1, 7, 'directApply', 'directApply', 'Indicates whether an [[url]] that is associated with a [[JobPosting]] enables direct application for the job, via the posting website. A job posting is considered to have directApply of [[True]] if an application process for the specified job can be directly initiated via the url(s) given (noting that e.g. multiple internet domains might nevertheless be involved at an implementation level). A value of [[False]] is appropriate if there is no clear path to applying directly online for the specified job, navigating directly from the JobPosting url(s) supplied.'),
	(574, 1, 7, 'evidenceOrigin', 'evidenceOrigin', 'Source of the data used to formulate the guidance, e.g. RCT, consensus opinion, etc.'),
	(575, 1, 7, 'actionableFeedbackPolicy', 'actionableFeedbackPolicy', 'For a [[NewsMediaOrganization]] or other news-related [[Organization]], a statement about public engagement activities (for news media, the newsroom’s), including involving the public - digitally or otherwise -- in coverage decisions, reporting and activities after publication.'),
	(576, 1, 7, 'utterances', 'utterances', 'Text of an utterances (spoken words, lyrics etc.) that occurs at a certain section of a media object, represented as a [[HyperTocEntry]].'),
	(577, 1, 7, 'studyLocation', 'studyLocation', 'The location in which the study is taking/took place.'),
	(578, 1, 7, 'accessibilityControl', 'accessibilityControl', 'Identifies input methods that are sufficient to fully control the described resource. Values should be drawn from the [approved vocabulary](https://www.w3.org/2021/a11y-discov-vocab/latest/#accessibilityControl-vocabulary).'),
	(579, 1, 7, 'maximumEnrollment', 'maximumEnrollment', 'The maximum number of students who may be enrolled in the program.'),
	(580, 1, 7, 'checkoutPageURLTemplate', 'checkoutPageURLTemplate', 'A URL template (RFC 6570) for a checkout page for an offer. This approach allows merchants to specify a URL for online checkout of the offered product, by interpolating parameters such as the logged in user ID, product ID, quantity, discount code etc. Parameter naming and standardization are not specified here.'),
	(581, 1, 7, 'musicBy', 'musicBy', 'The composer of the soundtrack.'),
	(582, 1, 7, 'lastReviewed', 'lastReviewed', 'Date on which the content on this web page was last reviewed for accuracy and/or completeness.'),
	(583, 1, 7, 'courseMode', 'courseMode', 'The medium or means of delivery of the course instance or the mode of study, either as a text label (e.g. "online", "onsite" or "blended"; "synchronous" or "asynchronous"; "full-time" or "part-time") or as a URL reference to a term from a controlled vocabulary (e.g. https://ceds.ed.gov/element/001311#Asynchronous).'),
	(584, 1, 7, 'competencyRequired', 'competencyRequired', 'Knowledge, skill, ability or personal attribute that must be demonstrated by a person or other entity in order to do something such as earn an Educational Occupational Credential or understand a LearningResource.'),
	(585, 1, 7, 'paymentMethod', 'paymentMethod', 'The name of the credit card or other method of payment for the order.'),
	(586, 1, 7, 'honorificPrefix', 'honorificPrefix', 'An honorific prefix preceding a Person\'s name such as Dr/Mrs/Mr.'),
	(587, 1, 7, 'bed', 'bed', 'The type of bed or beds included in the accommodation. For the single case of just one bed of a certain type, you use bed directly with a text.\n      If you want to indicate the quantity of a certain kind of bed, use an instance of BedDetails. For more detailed information, use the amenityFeature property.'),
	(588, 1, 7, 'tracks', 'tracks', 'A music recording (track)&#x2014;usually a single song.'),
	(589, 1, 7, 'track', 'track', 'A music recording (track)&#x2014;usually a single song. If an ItemList is given, the list should contain items of type MusicRecording.'),
	(590, 1, 7, 'mathExpression', 'mathExpression', 'A mathematical expression (e.g. \'x^2-3x=0\') that may be solved for a specific variable, simplified, or transformed. This can take many formats, e.g. LaTeX, Ascii-Math, or math as you would write with a keyboard.'),
	(591, 1, 7, 'isbn', 'isbn', 'The ISBN of the book.'),
	(592, 1, 7, 'identifier', 'identifier', 'The identifier property represents any kind of identifier for any kind of [[Thing]], such as ISBNs, GTIN codes, UUIDs etc. Schema.org provides dedicated properties for representing many of these, either as textual strings or as URL (URI) links. See [background notes](/docs/datamodel.html#identifierBg) for more details.\n        '),
	(593, 1, 7, 'countriesSupported', 'countriesSupported', 'Countries for which the application is supported. You can also provide the two-letter ISO 3166-1 alpha-2 country code.'),
	(594, 1, 7, 'checkinTime', 'checkinTime', 'The earliest someone may check into a lodging establishment.'),
	(595, 1, 7, 'deliveryMethod', 'deliveryMethod', 'A sub property of instrument. The method of delivery.'),
	(596, 1, 7, 'hasBioPolymerSequence', 'hasBioPolymerSequence', 'A symbolic representation of a BioChemEntity. For example, a nucleotide sequence of a Gene or an amino acid sequence of a Protein.'),
	(597, 1, 7, 'hasRepresentation', 'hasRepresentation', 'A common representation such as a protein sequence or chemical structure for this entity. For images use schema.org/image.'),
	(598, 1, 7, 'distribution', 'distribution', 'A downloadable form of this dataset, at a specific location, in a specific format. This property can be repeated if different variations are available. There is no expectation that different downloadable distributions must contain exactly equivalent information (see also [DCAT](https://www.w3.org/TR/vocab-dcat-3/#Class:Distribution) on this point). Different distributions might include or exclude different subsets of the entire dataset, for example.'),
	(599, 1, 7, 'bankAccountType', 'bankAccountType', 'The type of a bank account.'),
	(600, 1, 7, 'mediaItemAppearance', 'mediaItemAppearance', 'In the context of a [[MediaReview]], indicates specific media item(s) that are grouped using a [[MediaReviewItem]].'),
	(601, 1, 7, 'audio', 'audio', 'An embedded audio object.'),
	(602, 1, 7, 'playMode', 'playMode', 'Indicates whether this game is multi-player, co-op or single-player.  The game can be marked as multi-player, co-op and single-player at the same time.'),
	(603, 1, 7, 'foodWarning', 'foodWarning', 'Any precaution, guidance, contraindication, etc. related to consumption of specific foods while taking this drug.'),
	(604, 1, 7, 'vehicleInteriorType', 'vehicleInteriorType', 'The type or material of the interior of the vehicle (e.g. synthetic fabric, leather, wood, etc.). While most interior types are characterized by the material used, an interior type can also be based on vehicle usage or target audience.'),
	(605, 1, 7, 'assesses', 'assesses', 'The item being described is intended to assess the competency or learning outcome defined by the referenced term.'),
	(606, 1, 7, 'currentExchangeRate', 'currentExchangeRate', 'The current price of a currency.'),
	(607, 1, 7, 'numberOfBathroomsTotal', 'numberOfBathroomsTotal', 'The total integer number of bathrooms in some [[Accommodation]], following real estate conventions as [documented in RESO](https://ddwiki.reso.org/display/DDW17/BathroomsTotalInteger+Field): "The simple sum of the number of bathrooms. For example for a property with two Full Bathrooms and one Half Bathroom, the Bathrooms Total Integer will be 3.". See also [[numberOfRooms]].'),
	(608, 1, 7, 'experienceInPlaceOfEducation', 'experienceInPlaceOfEducation', 'Indicates whether a [[JobPosting]] will accept experience (as indicated by [[OccupationalExperienceRequirements]]) in place of its formal educational qualifications (as indicated by [[educationRequirements]]). If true, indicates that satisfying one of these requirements is sufficient.'),
	(609, 1, 7, 'legislationTransposes', 'legislationTransposes', 'Indicates that this legislation (or part of legislation) fulfills the objectives set by another legislation, by passing appropriate implementation measures. Typically, some legislations of European Union\'s member states or regions transpose European Directives. This indicates a legally binding link between the 2 legislations.'),
	(610, 1, 7, 'legislationApplies', 'legislationApplies', 'Indicates that this legislation (or part of a legislation) somehow transfers another legislation in a different legislative context. This is an informative link, and it has no legal value. For legally-binding links of transposition, use the <a href="/legislationTransposes">legislationTransposes</a> property. For example an informative consolidated law of a European Union\'s member state "applies" the consolidated version of the European Directive implemented in it.'),
	(611, 1, 7, 'distinguishingSign', 'distinguishingSign', 'One of a set of signs and symptoms that can be used to distinguish this diagnosis from others in the differential diagnosis.'),
	(612, 1, 7, 'legislationJurisdiction', 'legislationJurisdiction', 'The jurisdiction from which the legislation originates.'),
	(613, 1, 7, 'jurisdiction', 'jurisdiction', 'Indicates a legal jurisdiction, e.g. of some legislation, or where some government service is based.'),
	(614, 1, 7, 'spatialCoverage', 'spatialCoverage', 'The spatialCoverage of a CreativeWork indicates the place(s) which are the focus of the content. It is a subproperty of\n      contentLocation intended primarily for more technical and detailed materials. For example with a Dataset, it indicates\n      areas that the dataset describes: a dataset of New York weather would have spatialCoverage which was the place: the state of New York.'),
	(615, 1, 7, 'arrivalAirport', 'arrivalAirport', 'The airport where the flight terminates.'),
	(616, 1, 7, 'interactingDrug', 'interactingDrug', 'Another drug that is known to interact with this drug in a way that impacts the effect of this drug or causes a risk to the patient. Note: disease interactions are typically captured as contraindications.'),
	(617, 1, 7, 'availabilityStarts', 'availabilityStarts', 'The beginning of the availability of the product or service included in the offer.'),
	(618, 1, 7, 'vehicleSeatingCapacity', 'vehicleSeatingCapacity', 'The number of passengers that can be seated in the vehicle, both in terms of the physical space available, and in terms of limitations set by law.\\n\\nTypical unit code(s): C62 for persons.'),
	(619, 1, 7, 'relevantOccupation', 'relevantOccupation', 'The Occupation for the JobPosting.'),
	(620, 1, 7, 'phoneticText', 'phoneticText', 'Representation of a text [[textValue]] using the specified [[speechToTextMarkup]]. For example the city name of Houston in IPA: /ˈhjuːstən/.'),
	(621, 1, 7, 'vehicleInteriorColor', 'vehicleInteriorColor', 'The color or color combination of the interior of the vehicle.'),
	(622, 1, 7, 'broadcastSubChannel', 'broadcastSubChannel', 'The subchannel used for the broadcast.'),
	(623, 1, 7, 'targetPlatform', 'targetPlatform', 'Type of app development: phone, Metro style, desktop, XBox, etc.'),
	(624, 1, 7, 'naics', 'naics', 'The North American Industry Classification System (NAICS) code for a particular organization or business person.'),
	(625, 1, 7, 'color', 'color', 'The color of the product.'),
	(626, 1, 7, 'risks', 'risks', 'Specific physiologic risks associated to the diet plan.'),
	(627, 1, 7, 'propertyID', 'propertyID', 'A commonly used identifier for the characteristic represented by the property, e.g. a manufacturer or a standard code for a property. propertyID can be\n(1) a prefixed string, mainly meant to be used with standards for product properties; (2) a site-specific, non-prefixed string (e.g. the primary key of the property or the vendor-specific ID of the property), or (3)\na URL indicating the type of the property, either pointing to an external vocabulary, or a Web resource that describes the property (e.g. a glossary entry).\nStandards bodies should promote a standard prefix for the identifiers of properties from their standards.'),
	(628, 1, 7, 'dateIssued', 'dateIssued', 'The date the ticket was issued.'),
	(629, 1, 7, 'directors', 'directors', 'A director of e.g. TV, radio, movie, video games etc. content. Directors can be associated with individual items or with a series, episode, clip.'),
	(630, 1, 7, 'director', 'director', 'A director of e.g. TV, radio, movie, video gaming etc. content, or of an event. Directors can be associated with individual items or with a series, episode, clip.'),
	(631, 1, 7, 'map', 'map', 'A URL to a map of the place.'),
	(632, 1, 7, 'hasMap', 'hasMap', 'A URL to a map of the place.'),
	(633, 1, 7, 'stageAsNumber', 'stageAsNumber', 'The stage represented as a number, e.g. 3.'),
	(634, 1, 7, 'awards', 'awards', 'Awards won by or for this item.'),
	(635, 1, 7, 'award', 'award', 'An award won by or for this item.'),
	(636, 1, 7, 'associatedDisease', 'associatedDisease', 'Disease associated to this BioChemEntity. Such disease can be a MedicalCondition or a URL. If you want to add an evidence supporting the association, please use PropertyValue.'),
	(637, 1, 7, 'amenityFeature', 'amenityFeature', 'An amenity feature (e.g. a characteristic or service) of the Accommodation. This generic property does not make a statement about whether the feature is included in an offer for the main accommodation or available at extra costs.'),
	(638, 1, 7, 'birthDate', 'birthDate', 'Date of birth.'),
	(639, 1, 7, 'valueMaxLength', 'valueMaxLength', 'Specifies the allowed range for number of characters in a literal value.'),
	(640, 1, 7, 'programName', 'programName', 'The program providing the membership.'),
	(641, 1, 7, 'isRelatedTo', 'isRelatedTo', 'A pointer to another, somehow related product (or multiple products).'),
	(642, 1, 7, 'vehicleModelDate', 'vehicleModelDate', 'The release date of a vehicle model (often used to differentiate versions of the same make and model).'),
	(643, 1, 7, 'typicalCreditsPerTerm', 'typicalCreditsPerTerm', 'The number of credits or units a full-time student would be expected to take in 1 term however \'term\' is defined by the institution.'),
	(644, 1, 7, 'titleEIDR', 'titleEIDR', 'An [EIDR](https://eidr.org/) (Entertainment Identifier Registry) [[identifier]] representing at the most general/abstract level, a work of film or television.\n\nFor example, the motion picture known as "Ghostbusters" has a titleEIDR of  "10.5240/7EC7-228A-510A-053E-CBB8-J". This title (or work) may have several variants, which EIDR calls "edits". See [[editEIDR]].\n\nSince schema.org types like [[Movie]] and [[TVEpisode]] can be used for both works and their multiple expressions, it is possible to use [[titleEIDR]] alone (for a general description), or alongside [[editEIDR]] for a more edit-specific description.\n'),
	(645, 1, 7, 'editEIDR', 'editEIDR', 'An [EIDR](https://eidr.org/) (Entertainment Identifier Registry) [[identifier]] representing a specific edit / edition for a work of film or television.\n\nFor example, the motion picture known as "Ghostbusters" whose [[titleEIDR]] is "10.5240/7EC7-228A-510A-053E-CBB8-J" has several edits, e.g. "10.5240/1F2A-E1C5-680A-14C6-E76B-I" and "10.5240/8A35-3BEE-6497-5D12-9E4F-3".\n\nSince schema.org types like [[Movie]] and [[TVEpisode]] can be used for both works and their multiple expressions, it is possible to use [[titleEIDR]] alone (for a general description), or alongside [[editEIDR]] for a more edit-specific description.\n'),
	(646, 1, 7, 'embeddedTextCaption', 'embeddedTextCaption', 'Represents textual captioning from a [[MediaObject]], e.g. text of a \'meme\'.'),
	(647, 1, 7, 'caption', 'caption', 'The caption for this object. For downloadable machine formats (closed caption, subtitles etc.) use MediaObject and indicate the [[encodingFormat]].'),
	(648, 1, 7, 'recommendedIntake', 'recommendedIntake', 'Recommended intake of this supplement for a given population as defined by a specific recommending authority.'),
	(649, 1, 7, 'instructor', 'instructor', 'A person assigned to instruct or provide instructional assistance for the [[CourseInstance]].'),
	(650, 1, 7, 'administrationRoute', 'administrationRoute', 'A route by which this drug may be administered, e.g. \'oral\'.'),
	(651, 1, 7, 'postOp', 'postOp', 'A description of the postoperative procedures, care, and/or followups for this device.'),
	(652, 1, 7, 'subStructure', 'subStructure', 'Component (sub-)structure(s) that comprise this anatomical structure.'),
	(653, 1, 7, 'isResizable', 'isResizable', 'Whether the 3DModel allows resizing. For example, room layout applications often do not allow 3DModel elements to be resized to reflect reality.'),
	(654, 1, 7, 'affectedBy', 'affectedBy', 'Drugs that affect the test\'s results.'),
	(655, 1, 7, 'healthPlanPharmacyCategory', 'healthPlanPharmacyCategory', 'The category or type of pharmacy associated with this cost sharing.'),
	(656, 1, 7, 'authenticator', 'authenticator', 'The Organization responsible for authenticating the user\'s subscription. For example, many media apps require a cable/satellite provider to authenticate your subscription before playing media.'),
	(657, 1, 7, 'vehicleIdentificationNumber', 'vehicleIdentificationNumber', 'The Vehicle Identification Number (VIN) is a unique serial number used by the automotive industry to identify individual motor vehicles.'),
	(658, 1, 7, 'serialNumber', 'serialNumber', 'The serial number or any alphanumeric identifier of a particular product. When attached to an offer, it is a shortcut for the serial number of the product included in the offer.'),
	(659, 1, 7, 'coverageStartTime', 'coverageStartTime', 'The time when the live blog will begin covering the Event. Note that coverage may begin before the Event\'s start time. The LiveBlogPosting may also be created before coverage begins.'),
	(660, 1, 7, 'contentReferenceTime', 'contentReferenceTime', 'The specific time described by a creative work, for works (e.g. articles, video objects etc.) that emphasise a particular moment within an Event.'),
	(661, 1, 7, 'epidemiology', 'epidemiology', 'The characteristics of associated patients, such as age, gender, race etc.'),
	(662, 1, 7, 'schoolClosuresInfo', 'schoolClosuresInfo', 'Information about school closures.'),
	(663, 1, 7, 'callSign', 'callSign', 'A [callsign](https://en.wikipedia.org/wiki/Call_sign), as used in broadcasting and radio communications to identify people, radio and TV stations, or vehicles.'),
	(664, 1, 7, 'acquiredFrom', 'acquiredFrom', 'The organization or person from which the product was acquired.'),
	(665, 1, 7, 'branchCode', 'branchCode', 'A short textual code (also called "store code") that uniquely identifies a place of business. The code is typically assigned by the parentOrganization and used in structured URLs.\\n\\nFor example, in the URL http://www.starbucks.co.uk/store-locator/etc/detail/3047 the code "3047" is a branchCode for a particular branch.\n      '),
	(666, 1, 7, 'drug', 'drug', 'Specifying a drug or medicine used in a medication procedure.'),
	(667, 1, 7, 'code', 'code', 'A medical code for the entity, taken from a controlled vocabulary or ontology such as ICD-9, DiseasesDB, MeSH, SNOMED-CT, RxNorm, etc.'),
	(668, 1, 7, 'codingSystem', 'codingSystem', 'The coding system, e.g. \'ICD-10\'.'),
	(669, 1, 7, 'gtin12', 'gtin12', 'The GTIN-12 code of the product, or the product to which the offer refers. The GTIN-12 is the 12-digit GS1 Identification Key composed of a U.P.C. Company Prefix, Item Reference, and Check Digit used to identify trade items. See [GS1 GTIN Summary](http://www.gs1.org/barcodes/technical/idkeys/gtin) for more details.'),
	(670, 1, 7, 'gtin', 'gtin', 'A Global Trade Item Number ([GTIN](https://www.gs1.org/standards/id-keys/gtin)). GTINs identify trade items, including products and services, using numeric identification codes.\n\nThe GS1 [digital link specifications](https://www.gs1.org/standards/Digital-Link/) express GTINs as URLs (URIs, IRIs, etc.). Details including regular expression examples can be found in, Section 6 of the GS1 URI Syntax specification; see also [schema.org tracking issue](https://github.com/schemaorg/schemaorg/issues/3156#issuecomment-1209522809) for schema.org-specific discussion. A correct [[gtin]] value should be a valid GTIN, which means that it should be an all-numeric string of either 8, 12, 13 or 14 digits, or a "GS1 Digital Link" URL based on such a string. The numeric component should also have a [valid GS1 check digit](https://www.gs1.org/services/check-digit-calculator) and meet the other rules for valid GTINs. See also [GS1\'s GTIN Summary](http://www.gs1.org/barcodes/technical/idkeys/gtin) and [Wikipedia](https://en.wikipedia.org/wiki/Global_Trade_Item_Number) for more details. Left-padding of the gtin values is not required or encouraged. The [[gtin]] property generalizes the earlier [[gtin8]], [[gtin12]], [[gtin13]], and [[gtin14]] properties.\n\nNote also that this is a definition for how to include GTINs in Schema.org data, and not a definition of GTINs in general - see the GS1 documentation for authoritative details.'),
	(671, 1, 7, 'applicationStartDate', 'applicationStartDate', 'The date at which the program begins collecting applications for the next enrollment cycle.'),
	(672, 1, 7, 'includesObject', 'includesObject', 'This links to a node or nodes indicating the exact quantity of the products included in  an [[Offer]] or [[ProductCollection]].'),
	(673, 1, 7, 'volumeNumber', 'volumeNumber', 'Identifies the volume of publication or multi-part work; for example, "iii" or "2".'),
	(674, 1, 7, 'acceptedOffer', 'acceptedOffer', 'The offer(s) -- e.g., product, quantity and price combinations -- included in the order.'),
	(675, 1, 7, 'cvdNumC19HospPats', 'cvdNumC19HospPats', 'numc19hosppats - HOSPITALIZED: Patients currently hospitalized in an inpatient care location who have suspected or confirmed COVID-19.'),
	(676, 1, 7, 'entertainmentBusiness', 'entertainmentBusiness', 'A sub property of location. The entertainment business where the action occurred.'),
	(677, 1, 7, 'educationalLevel', 'educationalLevel', 'The level in terms of progression through an educational or training context. Examples of educational levels include \'beginner\', \'intermediate\' or \'advanced\', and formal sets of level indicators.'),
	(678, 1, 7, 'uploadDate', 'uploadDate', 'Date when this media object was uploaded to this site.'),
	(679, 1, 7, 'programType', 'programType', 'The type of educational or occupational program. For example, classroom, internship, alternance, etc.'),
	(680, 1, 7, 'highPrice', 'highPrice', 'The highest price of all offers available.\\n\\nUsage guidelines:\\n\\n* Use values from 0123456789 (Unicode \'DIGIT ZERO\' (U+0030) to \'DIGIT NINE\' (U+0039)) rather than superficially similar Unicode symbols.\\n* Use \'.\' (Unicode \'FULL STOP\' (U+002E)) rather than \',\' to indicate a decimal point. Avoid using these symbols as a readability separator.'),
	(681, 1, 7, 'byDay', 'byDay', 'Defines the day(s) of the week on which a recurring [[Event]] takes place. May be specified using either [[DayOfWeek]], or alternatively [[Text]] conforming to iCal\'s syntax for byDay recurrence rules.'),
	(682, 1, 7, 'additionalProperty', 'additionalProperty', 'A property-value pair representing an additional characteristic of the entity, e.g. a product feature or another characteristic for which there is no matching property in schema.org.\\n\\nNote: Publishers should be aware that applications designed to use specific schema.org properties (e.g. https://schema.org/width, https://schema.org/color, https://schema.org/gtin13, ...) will typically expect such data to be provided using those properties, rather than using the generic property/value mechanism.\n'),
	(683, 1, 7, 'catalog', 'catalog', 'A data catalog which contains this dataset.'),
	(684, 1, 7, 'includedInDataCatalog', 'includedInDataCatalog', 'A data catalog which contains this dataset.'),
	(685, 1, 7, 'seriousAdverseOutcome', 'seriousAdverseOutcome', 'A possible serious complication and/or serious side effect of this therapy. Serious adverse outcomes include those that are life-threatening; result in death, disability, or permanent damage; require hospitalization or prolong existing hospitalization; cause congenital anomalies or birth defects; or jeopardize the patient and may require medical or surgical intervention to prevent one of the outcomes in this definition.'),
	(686, 1, 7, 'brand', 'brand', 'The brand(s) associated with a product or service, or the brand(s) maintained by an organization or business person.'),
	(687, 1, 7, 'isLiveBroadcast', 'isLiveBroadcast', 'True if the broadcast is of a live event.'),
	(688, 1, 7, 'sensoryRequirement', 'sensoryRequirement', 'A description of any sensory requirements and levels necessary to function on the job, including hearing and vision. Defined terms such as those in O*net may be used, but note that there is no way to specify the level of ability as well as its nature when using a defined term.'),
	(689, 1, 7, 'linkRelationship', 'linkRelationship', 'Indicates the relationship type of a Web link. '),
	(690, 1, 7, 'productSupported', 'productSupported', 'The product or service this support contact point is related to (such as product support for a particular product line). This can be a specific product or product line (e.g. "iPhone") or a general category of products or services (e.g. "smartphones").'),
	(691, 1, 7, 'ccRecipient', 'ccRecipient', 'A sub property of recipient. The recipient copied on a message.'),
	(692, 1, 7, 'recipient', 'recipient', 'A sub property of participant. The participant who is at the receiving end of the action.'),
	(693, 1, 7, 'occupationalCategory', 'occupationalCategory', 'A category describing the job, preferably using a term from a taxonomy such as [BLS O*NET-SOC](http://www.onetcenter.org/taxonomy.html), [ISCO-08](https://www.ilo.org/public/english/bureau/stat/isco/isco08/) or similar, with the property repeated for each applicable value. Ideally the taxonomy should be identified, and both the textual label and formal code for the category should be provided.\\n\nNote: for historical reasons, any textual label and formal code provided as a literal may be assumed to be from O*NET-SOC.'),
	(694, 1, 7, 'responsibilities', 'responsibilities', 'Responsibilities associated with this role or Occupation.'),
	(695, 1, 7, 'productReturnLink', 'productReturnLink', 'Indicates a Web page or service by URL, for product return.'),
	(696, 1, 7, 'merchantReturnLink', 'merchantReturnLink', 'Specifies a Web page or service by URL, for product returns.'),
	(697, 1, 7, 'nonEqual', 'nonEqual', 'This ordering relation for qualitative values indicates that the subject is not equal to the object.'),
	(698, 1, 7, 'qualifications', 'qualifications', 'Specific qualifications required for this role or Occupation.'),
	(699, 1, 7, 'contactlessPayment', 'contactlessPayment', 'A secure method for consumers to purchase products or services via debit, credit or smartcards by using RFID or NFC technology.'),
	(700, 1, 7, 'passengerPriorityStatus', 'passengerPriorityStatus', 'The priority status assigned to a passenger for security or boarding (e.g. FastTrack or Priority).'),
	(701, 1, 7, 'freeShippingThreshold', 'freeShippingThreshold', 'A monetary value above (or at) which the shipping rate becomes free. Intended to be used via an [[OfferShippingDetails]] with [[shippingSettingsLink]] matching this [[ShippingRateSettings]].'),
	(702, 1, 7, 'marginOfError', 'marginOfError', 'A marginOfError for an [[Observation]].'),
	(703, 1, 7, 'causeOf', 'causeOf', 'The condition, complication, symptom, sign, etc. caused.'),
	(704, 1, 7, 'pageStart', 'pageStart', 'The page on which the work starts; for example "135" or "xiii".'),
	(705, 1, 7, 'dateRead', 'dateRead', 'The date/time at which the message has been read by the recipient if a single recipient exists.'),
	(706, 1, 7, 'tool', 'tool', 'A sub property of instrument. An object used (but not consumed) when performing instructions or a direction.'),
	(707, 1, 7, 'priceCurrency', 'priceCurrency', 'The currency of the price, or a price component when attached to [[PriceSpecification]] and its subtypes.\\n\\nUse standard formats: [ISO 4217 currency format](http://en.wikipedia.org/wiki/ISO_4217), e.g. "USD"; [Ticker symbol](https://en.wikipedia.org/wiki/List_of_cryptocurrencies) for cryptocurrencies, e.g. "BTC"; well known names for [Local Exchange Trading Systems](https://en.wikipedia.org/wiki/Local_exchange_trading_system) (LETS) and other currency types, e.g. "Ithaca HOUR".'),
	(708, 1, 7, 'sugarContent', 'sugarContent', 'The number of grams of sugar.'),
	(709, 1, 7, 'thumbnail', 'thumbnail', 'Thumbnail image for an image or video.'),
	(710, 1, 7, 'hasMenuSection', 'hasMenuSection', 'A subgrouping of the menu (by dishes, course, serving time period, etc.).'),
	(711, 1, 7, 'loanRepaymentForm', 'loanRepaymentForm', 'A form of paying back money previously borrowed from a lender. Repayment usually takes the form of periodic payments that normally include part principal plus interest in each payment.'),
	(712, 1, 7, 'publisherImprint', 'publisherImprint', 'The publishing division which published the comic.'),
	(713, 1, 7, 'productionCompany', 'productionCompany', 'The production company or studio responsible for the item, e.g. series, video game, episode etc.'),
	(714, 1, 7, 'startTime', 'startTime', 'The startTime of something. For a reserved event or service (e.g. FoodEstablishmentReservation), the time that it is expected to start. For actions that span a period of time, when the action was performed. E.g. John wrote a book from *January* to December. For media, including audio and video, it\'s the time offset of the start of a clip within a larger file.\\n\\nNote that Event uses startDate/endDate instead of startTime/endTime, even when describing dates with times. This situation may be clarified in future revisions.'),
	(715, 1, 7, 'contactPoints', 'contactPoints', 'A contact point for a person or organization.'),
	(716, 1, 7, 'contactPoint', 'contactPoint', 'A contact point for a person or organization.'),
	(717, 1, 7, 'candidate', 'candidate', 'A sub property of object. The candidate subject of this action.'),
	(718, 1, 7, 'object', 'object', 'The object upon which the action is carried out, whose state is kept intact or changed. Also known as the semantic roles patient, affected or undergoer (which change their state) or theme (which doesn\'t). E.g. John read *a book*.'),
	(719, 1, 7, 'netWorth', 'netWorth', 'The total financial value of the person as calculated by subtracting assets from liabilities.'),
	(720, 1, 7, 'recordLabel', 'recordLabel', 'The label that issued the release.'),
	(721, 1, 7, 'offerCount', 'offerCount', 'The number of offers for the product.'),
	(722, 1, 7, 'seasons', 'seasons', 'A season in a media series.'),
	(723, 1, 7, 'season', 'season', 'A season in a media series.'),
	(724, 1, 7, 'status', 'status', 'The status of the study (enumerated).'),
	(725, 1, 7, 'includedComposition', 'includedComposition', 'Smaller compositions included in this work (e.g. a movement in a symphony).'),
	(726, 1, 7, 'inventoryLevel', 'inventoryLevel', 'The current approximate inventory level for the item or items.'),
	(727, 1, 7, 'isPlanForApartment', 'isPlanForApartment', 'Indicates some accommodation that this floor plan describes.'),
	(728, 1, 7, 'teaches', 'teaches', 'The item being described is intended to help a person learn the competency or learning outcome defined by the referenced term.'),
	(729, 1, 7, 'numberedPosition', 'numberedPosition', 'A number associated with a role in an organization, for example, the number on an athlete\'s jersey.'),
	(730, 1, 7, 'governmentBenefitsInfo', 'governmentBenefitsInfo', 'governmentBenefitsInfo provides information about government benefits associated with a SpecialAnnouncement.'),
	(731, 1, 7, 'cvdNumC19OverflowPats', 'cvdNumC19OverflowPats', 'numc19overflowpats - ED/OVERFLOW: Patients with suspected or confirmed COVID-19 who are in the ED or any overflow location awaiting an inpatient bed.'),
	(732, 1, 7, 'procedure', 'procedure', 'A description of the procedure involved in setting up, using, and/or installing the device.'),
	(733, 1, 7, 'paymentUrl', 'paymentUrl', 'The URL for sending a payment.'),
	(734, 1, 7, 'endTime', 'endTime', 'The endTime of something. For a reserved event or service (e.g. FoodEstablishmentReservation), the time that it is expected to end. For actions that span a period of time, when the action was performed. E.g. John wrote a book from January to *December*. For media, including audio and video, it\'s the time offset of the end of a clip within a larger file.\\n\\nNote that Event uses startDate/endDate instead of startTime/endTime, even when describing dates with times. This situation may be clarified in future revisions.'),
	(735, 1, 7, 'itemListElement', 'itemListElement', 'For itemListElement values, you can use simple strings (e.g. "Peter", "Paul", "Mary"), existing entities, or use ListItem.\\n\\nText values are best if the elements in the list are plain strings. Existing entities are best for a simple, unordered list of existing things in your data. ListItem is used with ordered lists when you want to provide additional context about the element in that list or when the same item might be in different places in different lists.\\n\\nNote: The order of elements in your mark-up is not sufficient for indicating the order or elements.  Use ListItem with a \'position\' property in such cases.'),
	(736, 1, 7, 'successorOf', 'successorOf', 'A pointer from a newer variant of a product  to its previous, often discontinued predecessor.'),
	(737, 1, 7, 'cvdNumVent', 'cvdNumVent', 'numvent - MECHANICAL VENTILATORS: Total number of ventilators available.'),
	(738, 1, 7, 'numberOfRooms', 'numberOfRooms', 'The number of rooms (excluding bathrooms and closets) of the accommodation or lodging business.\nTypical unit code(s): ROM for room or C62 for no unit. The type of room can be put in the unitText property of the QuantitativeValue.'),
	(739, 1, 7, 'potentialUse', 'potentialUse', 'Intended use of the BioChemEntity by humans.'),
	(740, 1, 7, 'characterAttribute', 'characterAttribute', 'A piece of data that represents a particular aspect of a fictional character (skill, power, character points, advantage, disadvantage).'),
	(741, 1, 7, 'chemicalComposition', 'chemicalComposition', 'The chemical composition describes the identity and relative ratio of the chemical elements that make up the substance.'),
	(742, 1, 7, 'numberOfSeasons', 'numberOfSeasons', 'The number of seasons in this series.'),
	(743, 1, 7, 'offersPrescriptionByMail', 'offersPrescriptionByMail', 'Whether prescriptions can be delivered by mail.'),
	(744, 1, 7, 'lyricist', 'lyricist', 'The person who wrote the words.'),
	(745, 1, 7, 'sdPublisher', 'sdPublisher', 'Indicates the party responsible for generating and publishing the current structured data markup, typically in cases where the structured data is derived automatically from existing published content but published on a different site. For example, student projects and open data initiatives often re-publish existing content with more explicitly structured metadata. The\n[[sdPublisher]] property helps make such practices more explicit.'),
	(746, 1, 7, 'isAvailableGenerically', 'isAvailableGenerically', 'True if the drug is available in a generic form (regardless of name).'),
	(747, 1, 7, 'algorithm', 'algorithm', 'The algorithm or rules to follow to compute the score.'),
	(748, 1, 7, 'includedRiskFactor', 'includedRiskFactor', 'A modifiable or non-modifiable risk factor included in the calculation, e.g. age, coexisting condition.'),
	(749, 1, 7, 'colorist', 'colorist', 'The individual who adds color to inked drawings.'),
	(750, 1, 7, 'recipeInstructions', 'recipeInstructions', 'A step in making the recipe, in the form of a single item (document, video, etc.) or an ordered list with HowToStep and/or HowToSection items.'),
	(751, 1, 7, 'repeatFrequency', 'repeatFrequency', 'Defines the frequency at which [[Event]]s will occur according to a schedule [[Schedule]]. The intervals between\n      events should be defined as a [[Duration]] of time.'),
	(752, 1, 7, 'frequency', 'frequency', 'How often the dose is taken, e.g. \'daily\'.'),
	(753, 1, 7, 'beneficiaryBank', 'beneficiaryBank', 'A bank or bank’s branch, financial institution or international financial institution operating the beneficiary’s bank account or releasing funds for the beneficiary.'),
	(754, 1, 7, 'arrivalGate', 'arrivalGate', 'Identifier of the flight\'s arrival gate.'),
	(755, 1, 7, 'contentType', 'contentType', 'The supported content type(s) for an EntryPoint response.'),
	(756, 1, 7, 'arrivalBoatTerminal', 'arrivalBoatTerminal', 'The terminal or port from which the boat arrives.'),
	(757, 1, 7, 'address', 'address', 'Physical address of the item.'),
	(758, 1, 7, 'checkoutTime', 'checkoutTime', 'The latest someone may check out of a lodging establishment.'),
	(759, 1, 7, 'billingAddress', 'billingAddress', 'The billing address for the order.'),
	(760, 1, 7, 'eventSchedule', 'eventSchedule', 'Associates an [[Event]] with a [[Schedule]]. There are circumstances where it is preferable to share a schedule for a series of\n      repeating events rather than data on the individual events themselves. For example, a website or application might prefer to publish a schedule for a weekly\n      gym class rather than provide data on every event. A schedule could be processed by applications to add forthcoming events to a calendar. An [[Event]] that\n      is associated with a [[Schedule]] using this property should not have [[startDate]] or [[endDate]] properties. These are instead defined within the associated\n      [[Schedule]], this avoids any ambiguity for clients using the data. The property might have repeated values to specify different schedules, e.g. for different months\n      or seasons.'),
	(761, 1, 7, 'validThrough', 'validThrough', 'The date after when the item is not valid. For example the end of an offer, salary period, or a period of opening hours.'),
	(762, 1, 7, 'warrantyPromise', 'warrantyPromise', 'The warranty promise(s) included in the offer.'),
	(763, 1, 7, 'warranty', 'warranty', 'The warranty promise(s) included in the offer.'),
	(764, 1, 7, 'relatedTherapy', 'relatedTherapy', 'A medical therapy related to this anatomy.'),
	(765, 1, 7, 'slogan', 'slogan', 'A slogan or motto associated with the item.'),
	(766, 1, 7, 'employmentUnit', 'employmentUnit', 'Indicates the department, unit and/or facility where the employee reports and/or in which the job is to be performed.'),
	(767, 1, 7, 'geographicArea', 'geographicArea', 'The geographic area associated with the audience.'),
	(768, 1, 7, 'inverseOf', 'inverseOf', 'Relates a property to a property that is its inverse. Inverse properties relate the same pairs of items to each other, but in reversed direction. For example, the \'alumni\' and \'alumniOf\' properties are inverseOf each other. Some properties don\'t have explicit inverses; in these situations RDFa and JSON-LD syntax for reverse properties can be used.'),
	(769, 1, 7, 'broadcastTimezone', 'broadcastTimezone', 'The timezone in [ISO 8601 format](http://en.wikipedia.org/wiki/ISO_8601) for which the service bases its broadcasts.'),
	(770, 1, 7, 'timeOfDay', 'timeOfDay', 'The time of day the program normally runs. For example, "evenings".'),
	(771, 1, 7, 'bestRating', 'bestRating', 'The highest value allowed in this rating system. If bestRating is omitted, 5 is assumed.'),
	(772, 1, 7, 'processingTime', 'processingTime', 'Estimated processing time for the service using this channel.'),
	(773, 1, 7, 'membershipPointsEarned', 'membershipPointsEarned', 'The number of membership points earned by the member. If necessary, the unitText can be used to express the units the points are issued in. (E.g. stars, miles, etc.)'),
	(774, 1, 7, 'elevation', 'elevation', 'The elevation of a location ([WGS 84](https://en.wikipedia.org/wiki/World_Geodetic_System)). Values may be of the form \'NUMBER UNIT\\_OF\\_MEASUREMENT\' (e.g., \'1,000 m\', \'3,200 ft\') while numbers alone should be assumed to be a value in meters.'),
	(775, 1, 7, 'creditedTo', 'creditedTo', 'The group the release is credited to if different than the byArtist. For example, Red and Blue is credited to "Stefani Germanotta Band", but by Lady Gaga.'),
	(776, 1, 7, 'sport', 'sport', 'A type of sport (e.g. Baseball).'),
	(777, 1, 7, 'seeks', 'seeks', 'A pointer to products or services sought by the organization or person (demand).'),
	(778, 1, 7, 'additionalName', 'additionalName', 'An additional name for a Person, can be used for a middle name.'),
	(779, 1, 7, 'alternateName', 'alternateName', 'An alias for the item.'),
	(780, 1, 7, 'downPayment', 'downPayment', 'a type of payment made in cash during the onset of the purchase of an expensive good/service. The payment typically represents only a percentage of the full purchase price.'),
	(781, 1, 7, 'postOfficeBoxNumber', 'postOfficeBoxNumber', 'The post office box number for PO box addresses.'),
	(782, 1, 7, 'energyEfficiencyScaleMax', 'energyEfficiencyScaleMax', 'Specifies the most energy efficient class on the regulated EU energy consumption scale for the product category a product belongs to. For example, energy consumption for televisions placed on the market after January 1, 2020 is scaled from D to A+++.'),
	(783, 1, 7, 'userInteractionCount', 'userInteractionCount', 'The number of interactions for the CreativeWork using the WebSite or SoftwareApplication.'),
	(784, 1, 7, 'sizeGroup', 'sizeGroup', 'The size group (also known as "size type") for a product\'s size. Size groups are common in the fashion industry to define size segments and suggested audiences for wearable products. Multiple values can be combined, for example "men\'s big and tall", "petite maternity" or "regular"'),
	(785, 1, 7, 'productionDate', 'productionDate', 'The date of production of the item, e.g. vehicle.'),
	(786, 1, 7, 'hostingOrganization', 'hostingOrganization', 'The organization (airline, travelers\' club, etc.) the membership is made with.'),
	(787, 1, 7, 'addOn', 'addOn', 'An additional offer that can only be obtained in combination with the first base offer (e.g. supplements and extensions that are available for a surcharge).'),
	(788, 1, 7, 'hasOfferCatalog', 'hasOfferCatalog', 'Indicates an OfferCatalog listing for this Organization, Person, or Service.'),
	(789, 1, 7, 'shippingDetails', 'shippingDetails', 'Indicates information about the shipping policies and options associated with an [[Offer]].'),
	(790, 1, 7, 'seasonNumber', 'seasonNumber', 'Position of the season within an ordered group of seasons.'),
	(791, 1, 7, 'productReturnDays', 'productReturnDays', 'The productReturnDays property indicates the number of days (from purchase) within which relevant product return policy is applicable.'),
	(792, 1, 7, 'merchantReturnDays', 'merchantReturnDays', 'Specifies either a fixed return date or the number of days (from the delivery date) that a product can be returned. Used when the [[returnPolicyCategory]] property is specified as [[MerchantReturnFiniteReturnWindow]].'),
	(793, 1, 7, 'loanType', 'loanType', 'The type of a loan or credit.'),
	(794, 1, 7, 'documentation', 'documentation', 'Further documentation describing the Web API in more detail.'),
	(795, 1, 7, 'domiciledMortgage', 'domiciledMortgage', 'Whether borrower is a resident of the jurisdiction where the property is located.'),
	(796, 1, 7, 'drugUnit', 'drugUnit', 'The unit in which the drug is measured, e.g. \'5 mg tablet\'.'),
	(797, 1, 7, 'physicalRequirement', 'physicalRequirement', 'A description of the types of physical activity associated with the job. Defined terms such as those in O*net may be used, but note that there is no way to specify the level of ability as well as its nature when using a defined term.'),
	(798, 1, 7, 'numberOfCredits', 'numberOfCredits', 'The number of credits or units awarded by a Course or required to complete an EducationalOccupationalProgram.'),
	(799, 1, 7, 'funder', 'funder', 'A person or organization that supports (sponsors) something through some kind of financial contribution.'),
	(800, 1, 7, 'sponsor', 'sponsor', 'A person or organization that supports a thing through a pledge, promise, or financial contribution. E.g. a sponsor of a Medical Study or a corporate sponsor of an event.'),
	(801, 1, 7, 'nonProprietaryName', 'nonProprietaryName', 'The generic name of this drug or supplement.'),
	(802, 1, 7, 'returnPolicyCountry', 'returnPolicyCountry', 'The country where the product has to be sent to for returns, for example "Ireland" using the [[name]] property of [[Country]]. You can also provide the two-letter [ISO 3166-1 alpha-2 country code](http://en.wikipedia.org/wiki/ISO_3166-1). Note that this can be different from the country where the product was originally shipped from or sent to.'),
	(803, 1, 7, 'screenCount', 'screenCount', 'The number of screens in the movie theater.'),
	(804, 1, 7, 'cashBack', 'cashBack', 'A cardholder benefit that pays the cardholder a small percentage of their net expenditures.'),
	(805, 1, 7, 'underName', 'underName', 'The person or organization the reservation or ticket is for.'),
	(806, 1, 7, 'logo', 'logo', 'An associated logo.'),
	(807, 1, 7, 'image', 'image', 'An image of the item. This can be a [[URL]] or a fully described [[ImageObject]].'),
	(808, 1, 7, 'domainIncludes', 'domainIncludes', 'Relates a property to a class that is (one of) the type(s) the property is expected to be used on.'),
	(809, 1, 7, 'inChI', 'inChI', 'Non-proprietary identifier for molecular entity that can be used in printed and electronic data sources thus enabling easier linking of diverse data compilations.'),
	(810, 1, 7, 'quarantineGuidelines', 'quarantineGuidelines', 'Guidelines about quarantine rules, e.g. in the context of a pandemic.'),
	(811, 1, 7, 'discountCode', 'discountCode', 'Code used to redeem a discount.'),
	(812, 1, 7, 'musicalKey', 'musicalKey', 'The key, mode, or scale this composition uses.'),
	(813, 1, 7, 'productID', 'productID', 'The product identifier, such as ISBN. For example: ``` meta itemprop="productID" content="isbn:123-456-789" ```.'),
	(814, 1, 7, 'breastfeedingWarning', 'breastfeedingWarning', 'Any precaution, guidance, contraindication, etc. related to this drug\'s use by breastfeeding mothers.'),
	(815, 1, 7, 'relatedStructure', 'relatedStructure', 'Related anatomical structure(s) that are not part of the system but relate or connect to it, such as vascular bundles associated with an organ system.'),
	(816, 1, 7, 'currency', 'currency', 'The currency in which the monetary amount is expressed.\\n\\nUse standard formats: [ISO 4217 currency format](http://en.wikipedia.org/wiki/ISO_4217), e.g. "USD"; [Ticker symbol](https://en.wikipedia.org/wiki/List_of_cryptocurrencies) for cryptocurrencies, e.g. "BTC"; well known names for [Local Exchange Trading Systems](https://en.wikipedia.org/wiki/Local_exchange_trading_system) (LETS) and other currency types, e.g. "Ithaca HOUR".'),
	(817, 1, 7, 'cvdNumC19MechVentPats', 'cvdNumC19MechVentPats', 'numc19mechventpats - HOSPITALIZED and VENTILATED: Patients hospitalized in an NHSN inpatient care location who have suspected or confirmed COVID-19 and are on a mechanical ventilator.'),
	(818, 1, 7, 'ethicsPolicy', 'ethicsPolicy', 'Statement about ethics policy, e.g. of a [[NewsMediaOrganization]] regarding journalistic and publishing practices, or of a [[Restaurant]], a page describing food source policies. In the case of a [[NewsMediaOrganization]], an ethicsPolicy is typically a statement describing the personal, organizational, and corporate standards of behavior expected by the organization.'),
	(819, 1, 7, 'refundType', 'refundType', 'A refund type, from an enumerated list.'),
	(820, 1, 7, 'postalCodeRange', 'postalCodeRange', 'A defined range of postal codes.'),
	(821, 1, 7, 'recognizedBy', 'recognizedBy', 'An organization that acknowledges the validity, value or utility of a credential. Note: recognition may include a process of quality assurance or accreditation.'),
	(822, 1, 7, 'workPerformed', 'workPerformed', 'A work performed in some event, for example a play performed in a TheaterEvent.'),
	(823, 1, 7, 'workFeatured', 'workFeatured', 'A work featured in some event, e.g. exhibited in an ExhibitionEvent.\n       Specific subproperties are available for workPerformed (e.g. a play), or a workPresented (a Movie at a ScreeningEvent).'),
	(824, 1, 7, 'mentions', 'mentions', 'Indicates that the CreativeWork contains a reference to, but is not necessarily about a concept.'),
	(825, 1, 7, 'customerRemorseReturnLabelSource', 'customerRemorseReturnLabelSource', 'The method (from an enumeration) by which the customer obtains a return shipping label for a product returned due to customer remorse.'),
	(826, 1, 7, 'legislationConsolidates', 'legislationConsolidates', 'Indicates another legislation taken into account in this consolidated legislation (which is usually the product of an editorial process that revises the legislation). This property should be used multiple times to refer to both the original version or the previous consolidated version, and to the legislations making the change.'),
	(827, 1, 7, 'aggregateRating', 'aggregateRating', 'The overall rating, based on a collection of reviews or ratings, of the item.'),
	(828, 1, 7, 'itinerary', 'itinerary', 'Destination(s) ( [[Place]] ) that make up a trip. For a trip where destination order is important use [[ItemList]] to specify that order (see examples).'),
	(829, 1, 7, 'globalLocationNumber', 'globalLocationNumber', 'The [Global Location Number](http://www.gs1.org/gln) (GLN, sometimes also referred to as International Location Number or ILN) of the respective organization, person, or place. The GLN is a 13-digit number used to identify parties and physical locations.'),
	(830, 1, 7, 'applicantLocationRequirements', 'applicantLocationRequirements', 'The location(s) applicants can apply from. This is usually used for telecommuting jobs where the applicant does not need to be in a physical office. Note: This should not be used for citizenship or work visa requirements.'),
	(831, 1, 7, 'unitCode', 'unitCode', 'The unit of measurement given using the UN/CEFACT Common Code (3 characters) or a URL. Other codes than the UN/CEFACT Common Code may be used with a prefix followed by a colon.'),
	(832, 1, 7, 'parents', 'parents', 'A parents of the person.'),
	(833, 1, 7, 'parent', 'parent', 'A parent of this person.'),
	(834, 1, 7, 'renegotiableLoan', 'renegotiableLoan', 'Whether the terms for payment of interest can be renegotiated during the life of the loan.'),
	(835, 1, 7, 'priceComponent', 'priceComponent', 'This property links to all [[UnitPriceSpecification]] nodes that apply in parallel for the [[CompoundPriceSpecification]] node.'),
	(836, 1, 7, 'eligibleDuration', 'eligibleDuration', 'The duration for which the given offer is valid.'),
	(837, 1, 7, 'copyrightYear', 'copyrightYear', 'The year during which the claimed copyright for the CreativeWork was first asserted.'),
	(838, 1, 7, 'trialDesign', 'trialDesign', 'Specifics about the trial design (enumerated).'),
	(839, 1, 7, 'serviceAudience', 'serviceAudience', 'The audience eligible for this service.'),
	(840, 1, 7, 'audience', 'audience', 'An intended audience, i.e. a group for whom something was created.'),
	(841, 1, 7, 'vehicleSpecialUsage', 'vehicleSpecialUsage', 'Indicates whether the vehicle has been used for special purposes, like commercial rental, driving school, or as a taxi. The legislation in many countries requires this information to be revealed when offering a car for sale.'),
	(842, 1, 7, 'comment', 'comment', 'Comments, typically from users.'),
	(843, 1, 7, 'publicationType', 'publicationType', 'The type of the medical article, taken from the US NLM MeSH publication type catalog. See also [MeSH documentation](http://www.nlm.nih.gov/mesh/pubtypes.html).'),
	(844, 1, 7, 'availableIn', 'availableIn', 'The location in which the strength is available.'),
	(845, 1, 7, 'legislationIdentifier', 'legislationIdentifier', 'An identifier for the legislation. This can be either a string-based identifier, like the CELEX at EU level or the NOR in France, or a web-based, URL/URI identifier, like an ELI (European Legislation Identifier) or an URN-Lex.'),
	(846, 1, 7, 'discount', 'discount', 'Any discount applied (to an Order).'),
	(847, 1, 7, 'model', 'model', 'The model of the product. Use with the URL of a ProductModel or a textual representation of the model identifier. The URL of the ProductModel can be from an external source. It is recommended to additionally provide strong product identifiers via the gtin8/gtin13/gtin14 and mpn properties.'),
	(848, 1, 7, 'numberOfEpisodes', 'numberOfEpisodes', 'The number of episodes in this season or series.'),
	(849, 1, 7, 'deathDate', 'deathDate', 'Date of death.'),
	(850, 1, 7, 'servingSize', 'servingSize', 'The serving size, in terms of the number of volume or mass.'),
	(851, 1, 7, 'ownershipFundingInfo', 'ownershipFundingInfo', 'For an [[Organization]] (often but not necessarily a [[NewsMediaOrganization]]), a description of organizational ownership structure; funding and grants. In a news/media setting, this is with particular reference to editorial independence.   Note that the [[funder]] is also available and can be used to make basic funder information machine-readable.'),
	(852, 1, 7, 'playerType', 'playerType', 'Player type required&#x2014;for example, Flash or Silverlight.'),
	(853, 1, 7, 'priceComponentType', 'priceComponentType', 'Identifies a price component (for example, a line item on an invoice), part of the total price for an offer.'),
	(854, 1, 7, 'abridged', 'abridged', 'Indicates whether the book is an abridged edition.'),
	(855, 1, 7, 'reviewAspect', 'reviewAspect', 'This Review or Rating is relevant to this part or facet of the itemReviewed.'),
	(856, 1, 7, 'advanceBookingRequirement', 'advanceBookingRequirement', 'The amount of time that is required between accepting the offer and the actual usage of the resource or service.'),
	(857, 1, 7, 'sender', 'sender', 'A sub property of participant. The participant who is at the sending end of the action.'),
	(858, 1, 7, 'participant', 'participant', 'Other co-agents that participated in the action indirectly. E.g. John wrote a book with *Steve*.'),
	(859, 1, 7, 'ingredients', 'ingredients', 'A single ingredient used in the recipe, e.g. sugar, flour or garlic.'),
	(860, 1, 7, 'supply', 'supply', 'A sub-property of instrument. A supply consumed when performing instructions or a direction.'),
	(861, 1, 7, 'recipeIngredient', 'recipeIngredient', 'A single ingredient used in the recipe, e.g. sugar, flour or garlic.'),
	(862, 1, 7, 'area', 'area', 'The area within which users can expect to reach the broadcast service.'),
	(863, 1, 7, 'serviceArea', 'serviceArea', 'The geographic area where the service is provided.'),
	(864, 1, 7, 'downvoteCount', 'downvoteCount', 'The number of downvotes this question, answer or comment has received from the community.'),
	(865, 1, 7, 'children', 'children', 'A child of the person.'),
	(866, 1, 7, 'hasProductReturnPolicy', 'hasProductReturnPolicy', 'Indicates a ProductReturnPolicy that may be applicable.'),
	(867, 1, 7, 'hasMerchantReturnPolicy', 'hasMerchantReturnPolicy', 'Specifies a MerchantReturnPolicy that may be applicable.'),
	(868, 1, 7, 'arrivalPlatform', 'arrivalPlatform', 'The platform where the train arrives.'),
	(869, 1, 7, 'firstPerformance', 'firstPerformance', 'The date and place the work was first performed.'),
	(870, 1, 7, 'ratingValue', 'ratingValue', 'The rating for the content.\\n\\nUsage guidelines:\\n\\n* Use values from 0123456789 (Unicode \'DIGIT ZERO\' (U+0030) to \'DIGIT NINE\' (U+0039)) rather than superficially similar Unicode symbols.\\n* Use \'.\' (Unicode \'FULL STOP\' (U+002E)) rather than \',\' to indicate a decimal point. Avoid using these symbols as a readability separator.'),
	(871, 1, 7, 'collectionSize', 'collectionSize', 'The number of items in the [[Collection]].'),
	(872, 1, 7, 'resultReview', 'resultReview', 'A sub property of result. The review that resulted in the performing of the action.'),
	(873, 1, 7, 'result', 'result', 'The result produced in the action. E.g. John wrote *a book*.'),
	(874, 1, 7, 'albums', 'albums', 'A collection of music albums.'),
	(875, 1, 7, 'album', 'album', 'A music album.'),
	(876, 1, 7, 'datePublished', 'datePublished', 'Date of first broadcast/publication.'),
	(877, 1, 7, 'includesAttraction', 'includesAttraction', 'Attraction located at destination.'),
	(878, 1, 7, 'publishedOn', 'publishedOn', 'A broadcast service associated with the publication event.'),
	(879, 1, 7, 'actionStatus', 'actionStatus', 'Indicates the current disposition of the Action.'),
	(880, 1, 7, 'orderDate', 'orderDate', 'Date order was placed.'),
	(881, 1, 7, 'prescribingInfo', 'prescribingInfo', 'Link to prescribing information for the drug.'),
	(882, 1, 7, 'contributor', 'contributor', 'A secondary contributor to the CreativeWork or Event.'),
	(883, 1, 7, 'yearBuilt', 'yearBuilt', 'The year an [[Accommodation]] was constructed. This corresponds to the [YearBuilt field in RESO](https://ddwiki.reso.org/display/DDW17/YearBuilt+Field). '),
	(884, 1, 7, 'trainingSalary', 'trainingSalary', 'The estimated salary earned while in the program.'),
	(885, 1, 7, 'orderQuantity', 'orderQuantity', 'The number of the item ordered. If the property is not set, assume the quantity is one.'),
	(886, 1, 7, 'bioChemInteraction', 'bioChemInteraction', 'A BioChemEntity that is known to interact with this item.'),
	(887, 1, 7, 'healthPlanId', 'healthPlanId', 'The 14-character, HIOS-generated Plan ID number. (Plan IDs must be unique, even across different markets.)'),
	(888, 1, 7, 'valuePattern', 'valuePattern', 'Specifies a regular expression for testing literal values according to the HTML spec.'),
	(889, 1, 7, 'orderItemNumber', 'orderItemNumber', 'The identifier of the order item.'),
	(890, 1, 7, 'accommodationCategory', 'accommodationCategory', 'Category of an [[Accommodation]], following real estate conventions, e.g. RESO (see [PropertySubType](https://ddwiki.reso.org/display/DDW17/PropertySubType+Field), and [PropertyType](https://ddwiki.reso.org/display/DDW17/PropertyType+Field) fields  for suggested values).'),
	(891, 1, 7, 'category', 'category', 'A category for the item. Greater signs or slashes can be used to informally indicate a category hierarchy.'),
	(892, 1, 7, 'sdLicense', 'sdLicense', 'A license document that applies to this structured data, typically indicated by URL.'),
	(893, 1, 7, 'broadcastFrequency', 'broadcastFrequency', 'The frequency used for over-the-air broadcasts. Numeric values or simple ranges, e.g. 87-99. In addition a shortcut idiom is supported for frequences of AM and FM radio channels, e.g. "87 FM".'),
	(894, 1, 7, 'abstract', 'abstract', 'An abstract is a short description that summarizes a [[CreativeWork]].'),
	(895, 1, 7, 'floorSize', 'floorSize', 'The size of the accommodation, e.g. in square meter or squarefoot.\nTypical unit code(s): MTK for square meter, FTK for square foot, or YDK for square yard '),
	(896, 1, 7, 'measurementTechnique', 'measurementTechnique', 'A technique or technology used in a [[Dataset]] (or [[DataDownload]], [[DataCatalog]]),\ncorresponding to the method used for measuring the corresponding variable(s) (described using [[variableMeasured]]). This is oriented towards scientific and scholarly dataset publication but may have broader applicability; it is not intended as a full representation of measurement, but rather as a high level summary for dataset discovery.\n\nFor example, if [[variableMeasured]] is: molecule concentration, [[measurementTechnique]] could be: "mass spectrometry" or "nmr spectroscopy" or "colorimetry" or "immunofluorescence".\n\nIf the [[variableMeasured]] is "depression rating", the [[measurementTechnique]] could be "Zung Scale" or "HAM-D" or "Beck Depression Inventory".\n\nIf there are several [[variableMeasured]] properties recorded for some given data object, use a [[PropertyValue]] for each [[variableMeasured]] and attach the corresponding [[measurementTechnique]].\n      '),
	(897, 1, 7, 'seatRow', 'seatRow', 'The row location of the reserved seat (e.g., B).'),
	(898, 1, 7, 'programPrerequisites', 'programPrerequisites', 'Prerequisites for enrolling in the program.'),
	(899, 1, 7, 'endOffset', 'endOffset', 'The end time of the clip expressed as the number of seconds from the beginning of the work.'),
	(900, 1, 7, 'associatedClaimReview', 'associatedClaimReview', 'An associated [[ClaimReview]], related by specific common content, topic or claim. The expectation is that this property would be most typically used in cases where a single activity is conducting both claim reviews and media reviews, in which case [[relatedMediaReview]] would commonly be used on a [[ClaimReview]], while [[relatedClaimReview]] would be used on [[MediaReview]].'),
	(901, 1, 7, 'application', 'application', 'An application that can complete the request.'),
	(902, 1, 7, 'actionApplication', 'actionApplication', 'An application that can complete the request.'),
	(903, 1, 7, 'cookTime', 'cookTime', 'The time it takes to actually cook the dish, in [ISO 8601 duration format](http://en.wikipedia.org/wiki/ISO_8601).'),
	(904, 1, 7, 'performTime', 'performTime', 'The length of time it takes to perform instructions or a direction (not including time to prepare the supplies), in [ISO 8601 duration format](http://en.wikipedia.org/wiki/ISO_8601).'),
	(905, 1, 7, 'availableChannel', 'availableChannel', 'A means of accessing the service (e.g. a phone bank, a web site, a location, etc.).'),
	(906, 1, 7, 'seatNumber', 'seatNumber', 'The location of the reserved seat (e.g., 27).'),
	(907, 1, 7, 'costCategory', 'costCategory', 'The category of cost, such as wholesale, retail, reimbursement cap, etc.'),
	(908, 1, 7, 'associatedAnatomy', 'associatedAnatomy', 'The anatomy of the underlying organ system or structures associated with this entity.'),
	(909, 1, 7, 'homeTeam', 'homeTeam', 'The home team in a sports event.'),
	(910, 1, 7, 'competitor', 'competitor', 'A competitor in a sports event.'),
	(911, 1, 7, 'iswcCode', 'iswcCode', 'The International Standard Musical Work Code for the composition.'),
	(912, 1, 7, 'inChIKey', 'inChIKey', 'InChIKey is a hashed version of the full InChI (using the SHA-256 algorithm).'),
	(913, 1, 7, 'gameAvailabilityType', 'gameAvailabilityType', 'Indicates the availability type of the game content associated with this action, such as whether it is a full version or a demo.'),
	(914, 1, 7, 'publishedBy', 'publishedBy', 'An agent associated with the publication event.'),
	(915, 1, 7, 'shippingOrigin', 'shippingOrigin', 'Indicates the origin of a shipment, i.e. where it should be coming from.'),
	(916, 1, 7, 'requirements', 'requirements', 'Component dependency requirements for application. This includes runtime environments and shared libraries that are not included in the application distribution package, but required to run the application (examples: DirectX, Java or .NET runtime).'),
	(917, 1, 7, 'softwareRequirements', 'softwareRequirements', 'Component dependency requirements for application. This includes runtime environments and shared libraries that are not included in the application distribution package, but required to run the application (examples: DirectX, Java or .NET runtime).'),
	(918, 1, 7, 'thumbnailUrl', 'thumbnailUrl', 'A thumbnail image relevant to the Thing.'),
	(919, 1, 7, 'newsUpdatesAndGuidelines', 'newsUpdatesAndGuidelines', 'Indicates a page with news updates and guidelines. This could often be (but is not required to be) the main page containing [[SpecialAnnouncement]] markup on a site.'),
	(920, 1, 7, 'priceSpecification', 'priceSpecification', 'One or more detailed price specifications, indicating the unit price and delivery or payment charges.'),
	(921, 1, 7, 'availableStrength', 'availableStrength', 'An available dosage strength for the drug.'),
	(922, 1, 7, 'musicArrangement', 'musicArrangement', 'An arrangement derived from the composition.'),
	(923, 1, 7, 'healthPlanCoinsuranceOption', 'healthPlanCoinsuranceOption', 'Whether the coinsurance applies before or after deductible, etc. TODO: Is this a closed set?'),
	(924, 1, 7, 'datePosted', 'datePosted', 'Publication date of an online listing.'),
	(925, 1, 7, 'reviews', 'reviews', 'Review of the item.'),
	(926, 1, 7, 'review', 'review', 'A review of the item.'),
	(927, 1, 7, 'validUntil', 'validUntil', 'The date when the item is no longer valid.'),
	(928, 1, 7, 'requiresSubscription', 'requiresSubscription', 'Indicates if use of the media require a subscription  (either paid or free). Allowed values are ```true``` or ```false``` (note that an earlier version had \'yes\', \'no\').'),
	(929, 1, 7, 'ratingCount', 'ratingCount', 'The count of total number of ratings.'),
	(930, 1, 7, 'expectedArrivalFrom', 'expectedArrivalFrom', 'The earliest date the package may arrive.'),
	(931, 1, 7, 'version', 'version', 'The version of the CreativeWork embodied by a specified resource.'),
	(932, 1, 7, 'dropoffTime', 'dropoffTime', 'When a rental car can be dropped off.'),
	(933, 1, 7, 'infectiousAgentClass', 'infectiousAgentClass', 'The class of infectious agent (bacteria, prion, etc.) that causes the disease.'),
	(934, 1, 7, 'doseValue', 'doseValue', 'The value of the dose, e.g. 500.'),
	(935, 1, 7, 'cvdNumC19Died', 'cvdNumC19Died', 'numc19died - DEATHS: Patients with suspected or confirmed COVID-19 who died in the hospital, ED, or any overflow location.'),
	(936, 1, 7, 'alternativeHeadline', 'alternativeHeadline', 'A secondary title of the CreativeWork.'),
	(937, 1, 7, 'longitude', 'longitude', 'The longitude of a location. For example ```-122.08585``` ([WGS 84](https://en.wikipedia.org/wiki/World_Geodetic_System)).'),
	(938, 1, 7, 'energyEfficiencyScaleMin', 'energyEfficiencyScaleMin', 'Specifies the least energy efficient class on the regulated EU energy consumption scale for the product category a product belongs to. For example, energy consumption for televisions placed on the market after January 1, 2020 is scaled from D to A+++.'),
	(939, 1, 7, 'appliesToPaymentMethod', 'appliesToPaymentMethod', 'The payment method(s) to which the payment charge specification applies.'),
	(940, 1, 7, 'credentialCategory', 'credentialCategory', 'The category or type of credential being described, for example "degree”, “certificate”, “badge”, or more specific term.'),
	(941, 1, 7, 'appliesToDeliveryMethod', 'appliesToDeliveryMethod', 'The delivery method(s) to which the delivery charge or payment charge specification applies.'),
	(942, 1, 7, 'targetName', 'targetName', 'The name of a node in an established educational framework.'),
	(943, 1, 7, 'repetitions', 'repetitions', 'Number of times one should repeat the activity.'),
	(944, 1, 7, 'originatesFrom', 'originatesFrom', 'The vasculature the lymphatic structure originates, or afferents, from.'),
	(945, 1, 7, 'positiveNotes', 'positiveNotes', 'Provides positive considerations regarding something, for example product highlights or (alongside [[negativeNotes]]) pro/con lists for reviews.\n\nIn the case of a [[Review]], the property describes the [[itemReviewed]] from the perspective of the review; in the case of a [[Product]], the product itself is being described.\n\nThe property values can be expressed either as unstructured text (repeated as necessary), or if ordered, as a list (in which case the most positive is at the beginning of the list).'),
	(946, 1, 7, 'passengerSequenceNumber', 'passengerSequenceNumber', 'The passenger\'s sequence number as assigned by the airline.'),
	(947, 1, 7, 'clipNumber', 'clipNumber', 'Position of the clip within an ordered group of clips.'),
	(948, 1, 7, 'gtin13', 'gtin13', 'The GTIN-13 code of the product, or the product to which the offer refers. This is equivalent to 13-digit ISBN codes and EAN UCC-13. Former 12-digit UPC codes can be converted into a GTIN-13 code by simply adding a preceding zero. See [GS1 GTIN Summary](http://www.gs1.org/barcodes/technical/idkeys/gtin) for more details.'),
	(949, 1, 7, 'hasAdultConsideration', 'hasAdultConsideration', 'Used to tag an item to be intended or suitable for consumption or use by adults only.'),
	(950, 1, 7, 'asin', 'asin', 'An Amazon Standard Identification Number (ASIN) is a 10-character alphanumeric unique identifier assigned by Amazon.com and its partners for product identification within the Amazon organization (summary from [Wikipedia](https://en.wikipedia.org/wiki/Amazon_Standard_Identification_Number)\'s article).\n\nNote also that this is a definition for how to include ASINs in Schema.org data, and not a definition of ASINs in general - see documentation from Amazon for authoritative details.\nASINs are most commonly encoded as text strings, but the [asin] property supports URL/URI as potential values too.'),
	(951, 1, 7, 'reservedTicket', 'reservedTicket', 'A ticket associated with the reservation.'),
	(952, 1, 7, 'commentCount', 'commentCount', 'The number of comments this CreativeWork (e.g. Article, Question or Answer) has received. This is most applicable to works published in Web sites with commenting system; additional comments may exist elsewhere.'),
	(953, 1, 7, 'programMembershipUsed', 'programMembershipUsed', 'Any membership in a frequent flyer, hotel loyalty program, etc. being applied to the reservation.'),
	(954, 1, 7, 'alcoholWarning', 'alcoholWarning', 'Any precaution, guidance, contraindication, etc. related to consumption of alcohol while taking this drug.'),
	(955, 1, 7, 'typicalTest', 'typicalTest', 'A medical test typically performed given this condition.'),
	(956, 1, 7, 'duringMedia', 'duringMedia', 'A media object representing the circumstances while performing this direction.'),
	(957, 1, 7, 'valueMinLength', 'valueMinLength', 'Specifies the minimum allowed range for number of characters in a literal value.'),
	(958, 1, 7, 'cvdNumC19HOPats', 'cvdNumC19HOPats', 'numc19hopats - HOSPITAL ONSET: Patients hospitalized in an NHSN inpatient care location with onset of suspected or confirmed COVID-19 14 or more days after hospitalization.'),
	(959, 1, 7, 'citation', 'citation', 'A citation or reference to another creative work, such as another publication, web page, scholarly article, etc.'),
	(960, 1, 7, 'musicGroupMember', 'musicGroupMember', 'A member of a music group&#x2014;for example, John, Paul, George, or Ringo.'),
	(961, 1, 7, 'member', 'member', 'A member of an Organization or a ProgramMembership. Organizations can be members of organizations; ProgramMembership is typically for individuals.'),
	(962, 1, 7, 'cvdNumICUBedsOcc', 'cvdNumICUBedsOcc', 'numicubedsocc - ICU BED OCCUPANCY: Total number of staffed inpatient ICU beds that are occupied.'),
	(963, 1, 7, 'numberOfEmployees', 'numberOfEmployees', 'The number of employees in an organization, e.g. business.'),
	(964, 1, 7, 'subStageSuffix', 'subStageSuffix', 'The substage, e.g. \'a\' for Stage IIIa.'),
	(965, 1, 7, 'coursePrerequisites', 'coursePrerequisites', 'Requirements for taking the Course. May be completion of another [[Course]] or a textual description like "permission of instructor". Requirements may be a pre-requisite competency, referenced using [[AlignmentObject]].'),
	(966, 1, 7, 'variablesMeasured', 'variablesMeasured', 'Originally named [[variablesMeasured]], the [[variableMeasured]] property can indicate (repeated as necessary) the  variables that are measured in some dataset, either described as text or as pairs of identifier and description using PropertyValue.'),
	(967, 1, 7, 'sharedContent', 'sharedContent', 'A CreativeWork such as an image, video, or audio clip shared as part of this posting.'),
	(968, 1, 7, 'urlTemplate', 'urlTemplate', 'An url template (RFC6570) that will be used to construct the target of the execution of the action.'),
	(969, 1, 7, 'gtin8', 'gtin8', 'The GTIN-8 code of the product, or the product to which the offer refers. This code is also known as EAN/UCC-8 or 8-digit EAN. See [GS1 GTIN Summary](http://www.gs1.org/barcodes/technical/idkeys/gtin) for more details.'),
	(970, 1, 7, 'vehicleEngine', 'vehicleEngine', 'Information about the engine or engines of the vehicle.'),
	(971, 1, 7, 'priceRange', 'priceRange', 'The price range of the business, for example ```$$$```.'),
	(972, 1, 7, 'numberOfAvailableAccommodationUnits', 'numberOfAvailableAccommodationUnits', 'Indicates the number of available accommodation units in an [[ApartmentComplex]], or the number of accommodation units for a specific [[FloorPlan]] (within its specific [[ApartmentComplex]]). See also [[numberOfAccommodationUnits]].'),
	(973, 1, 7, 'priceType', 'priceType', 'Defines the type of a price specified for an offered product, for example a list price, a (temporary) sale price or a manufacturer suggested retail price. If multiple prices are specified for an offer the [[priceType]] property can be used to identify the type of each such specified price. The value of priceType can be specified as a value from enumeration PriceTypeEnumeration or as a free form text string for price types that are not already predefined in PriceTypeEnumeration.'),
	(974, 1, 7, 'verificationFactCheckingPolicy', 'verificationFactCheckingPolicy', 'Disclosure about verification and fact-checking processes for a [[NewsMediaOrganization]] or other fact-checking [[Organization]].'),
	(975, 1, 7, 'negativeNotes', 'negativeNotes', 'Provides negative considerations regarding something, most typically in pro/con lists for reviews (alongside [[positiveNotes]]). For symmetry \n\nIn the case of a [[Review]], the property describes the [[itemReviewed]] from the perspective of the review; in the case of a [[Product]], the product itself is being described. Since product descriptions \ntend to emphasise positive claims, it may be relatively unusual to find [[negativeNotes]] used in this way. Nevertheless for the sake of symmetry, [[negativeNotes]] can be used on [[Product]].\n\nThe property values can be expressed either as unstructured text (repeated as necessary), or if ordered, as a list (in which case the most negative is at the beginning of the list).'),
	(976, 1, 7, 'startOffset', 'startOffset', 'The start time of the clip expressed as the number of seconds from the beginning of the work.'),
	(977, 1, 7, 'codeRepository', 'codeRepository', 'Link to the repository where the un-compiled, human readable code and related code is located (SVN, GitHub, CodePlex).'),
	(978, 1, 7, 'differentialDiagnosis', 'differentialDiagnosis', 'One of a set of differential diagnoses for the condition. Specifically, a closely-related or competing diagnosis typically considered later in the cognitive process whereby this medical condition is distinguished from others most likely responsible for a similar collection of signs and symptoms to reach the most parsimonious diagnosis or diagnoses in a patient.'),
	(979, 1, 7, 'free', 'free', 'A flag to signal that the item, event, or place is accessible for free.'),
	(980, 1, 7, 'isAccessibleForFree', 'isAccessibleForFree', 'A flag to signal that the item, event, or place is accessible for free.'),
	(981, 1, 7, 'subEvents', 'subEvents', 'Events that are a part of this event. For example, a conference event includes many presentations, each subEvents of the conference.'),
	(982, 1, 7, 'subEvent', 'subEvent', 'An Event that is part of this event. For example, a conference event includes many presentations, each of which is a subEvent of the conference.'),
	(983, 1, 7, 'amountOfThisGood', 'amountOfThisGood', 'The quantity of the goods included in the offer.'),
	(984, 1, 7, 'geoEquals', 'geoEquals', 'Represents spatial relations in which two geometries (or the places they represent) are topologically equal, as defined in [DE-9IM](https://en.wikipedia.org/wiki/DE-9IM). "Two geometries are topologically equal if their interiors intersect and no part of the interior or boundary of one geometry intersects the exterior of the other" (a symmetric relationship).'),
	(985, 1, 7, 'geoMidpoint', 'geoMidpoint', 'Indicates the GeoCoordinates at the centre of a GeoShape, e.g. GeoCircle.'),
	(986, 1, 7, 'backstory', 'backstory', 'For an [[Article]], typically a [[NewsArticle]], the backstory property provides a textual summary giving a brief explanation of why and how an article was created. In a journalistic setting this could include information about reporting process, methods, interviews, data sources, etc.'),
	(987, 1, 7, 'acceptedAnswer', 'acceptedAnswer', 'The answer(s) that has been accepted as best, typically on a Question/Answer site. Sites vary in their selection mechanisms, e.g. drawing on community opinion and/or the view of the Question author.'),
	(988, 1, 7, 'suggestedAnswer', 'suggestedAnswer', 'An answer (possibly one of several, possibly incorrect) to a Question, e.g. on a Question/Answer site.'),
	(989, 1, 7, 'cvdNumTotBeds', 'cvdNumTotBeds', 'numtotbeds - ALL HOSPITAL BEDS: Total number of all inpatient and outpatient beds, including all staffed, ICU, licensed, and overflow (surge) beds used for inpatients or outpatients.'),
	(990, 1, 7, 'educationRequirements', 'educationRequirements', 'Educational background needed for the position or Occupation.'),
	(991, 1, 7, 'programmingModel', 'programmingModel', 'Indicates whether API is managed or unmanaged.'),
	(992, 1, 7, 'blogPosts', 'blogPosts', 'Indicates a post that is part of a [[Blog]]. Note that historically, what we term a "Blog" was once known as a "weblog", and that what we term a "BlogPosting" is now often colloquially referred to as a "blog".'),
	(993, 1, 7, 'blogPost', 'blogPost', 'A posting that is part of this blog.'),
	(994, 1, 7, 'validFor', 'validFor', 'The duration of validity of a permit or similar thing.'),
	(995, 1, 7, 'biomechnicalClass', 'biomechnicalClass', 'The biomechanical properties of the bone.'),
	(996, 1, 7, 'codeValue', 'codeValue', 'A short textual code that uniquely identifies the value.'),
	(997, 1, 7, 'termCode', 'termCode', 'A code that identifies this [[DefinedTerm]] within a [[DefinedTermSet]]'),
	(998, 1, 7, 'biologicalRole', 'biologicalRole', 'A role played by the BioChemEntity within a biological context.'),
	(999, 1, 7, 'occupationalCredentialAwarded', 'occupationalCredentialAwarded', 'A description of the qualification, award, certificate, diploma or other occupational credential awarded as a consequence of successful completion of this course or program.'),
	(1000, 1, 7, 'greater', 'greater', 'This ordering relation for qualitative values indicates that the subject is greater than the object.'),
	(1001, 1, 7, 'unnamedSourcesPolicy', 'unnamedSourcesPolicy', 'For an [[Organization]] (typically a [[NewsMediaOrganization]]), a statement about policy on use of unnamed sources and the decision process required.'),
	(1002, 1, 7, 'naturalProgression', 'naturalProgression', 'The expected progression of the condition if it is not treated and allowed to progress naturally.'),
	(1003, 1, 7, 'geoContains', 'geoContains', 'Represents a relationship between two geometries (or the places they represent), relating a containing geometry to a contained geometry. "a contains b iff no points of b lie in the exterior of a, and at least one point of the interior of b lies in the interior of a". As defined in [DE-9IM](https://en.wikipedia.org/wiki/DE-9IM).'),
	(1004, 1, 7, 'announcementLocation', 'announcementLocation', 'Indicates a specific [[CivicStructure]] or [[LocalBusiness]] associated with the SpecialAnnouncement. For example, a specific testing facility or business with special opening hours. For a larger geographic region like a quarantine of an entire region, use [[spatialCoverage]].'),
	(1005, 1, 7, 'runtime', 'runtime', 'Runtime platform or script interpreter dependencies (example: Java v1, Python 2.3, .NET Framework 3.0).'),
	(1006, 1, 7, 'runtimePlatform', 'runtimePlatform', 'Runtime platform or script interpreter dependencies (example: Java v1, Python 2.3, .NET Framework 3.0).'),
	(1007, 1, 7, 'currenciesAccepted', 'currenciesAccepted', 'The currency accepted.\\n\\nUse standard formats: [ISO 4217 currency format](http://en.wikipedia.org/wiki/ISO_4217), e.g. "USD"; [Ticker symbol](https://en.wikipedia.org/wiki/List_of_cryptocurrencies) for cryptocurrencies, e.g. "BTC"; well known names for [Local Exchange Trading Systems](https://en.wikipedia.org/wiki/Local_exchange_trading_system) (LETS) and other currency types, e.g. "Ithaca HOUR".'),
	(1008, 1, 7, 'touristType', 'touristType', 'Attraction suitable for type(s) of tourist. E.g. children, visitors from a particular country, etc. '),
	(1009, 1, 7, 'printPage', 'printPage', 'If this NewsArticle appears in print, this field indicates the name of the page on which the article is found. Please note that this field is intended for the exact page name (e.g. A5, B18).'),
	(1010, 1, 7, 'typicalAgeRange', 'typicalAgeRange', 'The typical expected age range, e.g. \'7-9\', \'11-\'.'),
	(1011, 1, 7, 'suitableForDiet', 'suitableForDiet', 'Indicates a dietary restriction or guideline for which this recipe or menu item is suitable, e.g. diabetic, halal etc.'),
	(1012, 1, 7, 'shippingRate', 'shippingRate', 'The shipping rate is the cost of shipping to the specified destination. Typically, the maxValue and currency values (of the [[MonetaryAmount]]) are most appropriate.'),
	(1013, 1, 7, 'assemblyVersion', 'assemblyVersion', 'Associated product/technology version. E.g., .NET Framework 4.5.'),
	(1014, 1, 7, 'publicAccess', 'publicAccess', 'A flag to signal that the [[Place]] is open to public visitors.  If this property is omitted there is no assumed default boolean value'),
	(1015, 1, 7, 'occupationLocation', 'occupationLocation', ' The region/country for which this occupational description is appropriate. Note that educational requirements and qualifications can vary between jurisdictions.'),
	(1016, 1, 7, 'benefitsSummaryUrl', 'benefitsSummaryUrl', 'The URL that goes directly to the summary of benefits and coverage for the specific standard plan or plan variation.'),
	(1017, 1, 7, 'targetProduct', 'targetProduct', 'Target Operating System / Product to which the code applies.  If applies to several versions, just the product name can be used.'),
	(1018, 1, 7, 'workPresented', 'workPresented', 'The movie presented during this event.'),
	(1019, 1, 7, 'carrierRequirements', 'carrierRequirements', 'Specifies specific carrier(s) requirements for the application (e.g. an application may only work on a specific carrier network).'),
	(1020, 1, 7, 'dateReceived', 'dateReceived', 'The date/time the message was received if a single recipient exists.'),
	(1021, 1, 7, 'handlingTime', 'handlingTime', 'The typical delay between the receipt of the order and the goods either leaving the warehouse or being prepared for pickup, in case the delivery method is on site pickup. Typical properties: minValue, maxValue, unitCode (d for DAY).  This is by common convention assumed to mean business days (if a unitCode is used, coded as "d"), i.e. only counting days when the business normally operates.'),
	(1022, 1, 7, 'educationalAlignment', 'educationalAlignment', 'An alignment to an established educational framework.\n\nThis property should not be used where the nature of the alignment can be described using a simple property, for example to express that a resource [[teaches]] or [[assesses]] a competency.'),
	(1023, 1, 7, 'deliveryTime', 'deliveryTime', 'The total delay between the receipt of the order and the goods reaching the final customer.'),
	(1024, 1, 7, 'iupacName', 'iupacName', 'Systematic method of naming chemical compounds as recommended by the International Union of Pure and Applied Chemistry (IUPAC).'),
	(1025, 1, 7, 'trailerWeight', 'trailerWeight', 'The permitted weight of a trailer attached to the vehicle.\\n\\nTypical unit code(s): KGM for kilogram, LBR for pound\\n* Note 1: You can indicate additional information in the [[name]] of the [[QuantitativeValue]] node.\\n* Note 2: You may also link to a [[QualitativeValue]] node that provides additional information using [[valueReference]].\\n* Note 3: Note that you can use [[minValue]] and [[maxValue]] to indicate ranges.'),
	(1026, 1, 7, 'shippingLabel', 'shippingLabel', 'Label to match an [[OfferShippingDetails]] with a [[ShippingRateSettings]] (within the context of a [[shippingSettingsLink]] cross-reference).'),
	(1027, 1, 7, 'publication', 'publication', 'A publication event associated with the item.'),
	(1028, 1, 7, 'partySize', 'partySize', 'Number of people the reservation should accommodate.'),
	(1029, 1, 7, 'payload', 'payload', 'The permitted weight of passengers and cargo, EXCLUDING the weight of the empty vehicle.\\n\\nTypical unit code(s): KGM for kilogram, LBR for pound\\n\\n* Note 1: Many databases specify the permitted TOTAL weight instead, which is the sum of [[weight]] and [[payload]]\\n* Note 2: You can indicate additional information in the [[name]] of the [[QuantitativeValue]] node.\\n* Note 3: You may also link to a [[QualitativeValue]] node that provides additional information using [[valueReference]].\\n* Note 4: Note that you can use [[minValue]] and [[maxValue]] to indicate ranges.'),
	(1030, 1, 7, 'termDuration', 'termDuration', 'The amount of time in a term as defined by the institution. A term is a length of time where students take one or more classes. Semesters and quarters are common units for term.'),
	(1031, 1, 7, 'itemReviewed', 'itemReviewed', 'The item that is being reviewed/rated.'),
	(1032, 1, 7, 'recipe', 'recipe', 'A sub property of instrument. The recipe/instructions used to perform the action.'),
	(1033, 1, 7, 'telephone', 'telephone', 'The telephone number.'),
	(1034, 1, 7, 'exchangeRateSpread', 'exchangeRateSpread', 'The difference between the price at which a broker or other intermediary buys and sells foreign currency.'),
	(1035, 1, 7, 'itemDefectReturnShippingFeesAmount', 'itemDefectReturnShippingFeesAmount', 'Amount of shipping costs for defect product returns. Applicable when property [[itemDefectReturnFees]] equals [[ReturnShippingFees]].'),
	(1036, 1, 7, 'addressRegion', 'addressRegion', 'The region in which the locality is, and which is in the country. For example, California or another appropriate first-level [Administrative division](https://en.wikipedia.org/wiki/List_of_administrative_divisions_by_country).'),
	(1037, 1, 7, 'spatial', 'spatial', 'The "spatial" property can be used in cases when more specific properties\n(e.g. [[locationCreated]], [[spatialCoverage]], [[contentLocation]]) are not known to be appropriate.'),
	(1038, 1, 7, 'estimatedCost', 'estimatedCost', 'The estimated cost of the supply or supplies consumed when performing instructions.'),
	(1039, 1, 7, 'financialAidEligible', 'financialAidEligible', 'A financial aid type or program which students may use to pay for tuition or fees associated with the program.'),
	(1040, 1, 7, 'sensoryUnit', 'sensoryUnit', 'The neurological pathway extension that inputs and sends information to the brain or spinal cord.'),
	(1041, 1, 7, 'awayTeam', 'awayTeam', 'The away team in a sports event.'),
	(1042, 1, 7, 'antagonist', 'antagonist', 'The muscle whose action counteracts the specified muscle.'),
	(1043, 1, 7, 'orderDelivery', 'orderDelivery', 'The delivery of the parcel related to this order or order item.'),
	(1044, 1, 7, 'supplyTo', 'supplyTo', 'The area to which the artery supplies blood.'),
	(1045, 1, 7, 'bookingTime', 'bookingTime', 'The date and time the reservation was booked.'),
	(1046, 1, 7, 'circle', 'circle', 'A circle is the circular region of a specified radius centered at a specified latitude and longitude. A circle is expressed as a pair followed by a radius in meters.'),
	(1047, 1, 7, 'beforeMedia', 'beforeMedia', 'A media object representing the circumstances before performing this direction.'),
	(1048, 1, 7, 'episodeNumber', 'episodeNumber', 'Position of the episode within an ordered group of episodes.'),
	(1049, 1, 7, 'gracePeriod', 'gracePeriod', 'The period of time after any due date that the borrower has to fulfil its obligations before a default (failure to pay) is deemed to have occurred.'),
	(1050, 1, 7, 'addressLocality', 'addressLocality', 'The locality in which the street address is, and which is in the region. For example, Mountain View.'),
	(1051, 1, 7, 'learningResourceType', 'learningResourceType', 'The predominant type or kind characterizing the learning resource. For example, \'presentation\', \'handout\'.'),
	(1052, 1, 7, 'fuelType', 'fuelType', 'The type of fuel suitable for the engine or engines of the vehicle. If the vehicle has only one engine, this property can be attached directly to the vehicle.'),
	(1053, 1, 7, 'accessibilityAPI', 'accessibilityAPI', 'Indicates that the resource is compatible with the referenced accessibility API. Values should be drawn from the [approved vocabulary](https://www.w3.org/2021/a11y-discov-vocab/latest/#accessibilityAPI-vocabulary).'),
	(1054, 1, 7, 'masthead', 'masthead', 'For a [[NewsMediaOrganization]], a link to the masthead page or a page listing top editorial management.'),
	(1055, 1, 7, 'ticketToken', 'ticketToken', 'Reference to an asset (e.g., Barcode, QR code image or PDF) usable for entrance.'),
	(1056, 1, 7, 'eligibleRegion', 'eligibleRegion', 'The ISO 3166-1 (ISO 3166-1 alpha-2) or ISO 3166-2 code, the place, or the GeoShape for the geo-political region(s) for which the offer or delivery charge specification is valid.\\n\\nSee also [[ineligibleRegion]].\n    '),
	(1057, 1, 7, 'areaServed', 'areaServed', 'The geographic area where a service or offered item is provided.'),
	(1058, 1, 7, 'disambiguatingDescription', 'disambiguatingDescription', 'A sub property of description. A short description of the item used to disambiguate from other, similar items. Information from other properties (in particular, name) may be necessary for the description to be useful for disambiguation.'),
	(1059, 1, 7, 'description', 'description', 'A description of the item.'),
	(1060, 1, 7, 'suggestedMaxAge', 'suggestedMaxAge', 'Maximum recommended age in years for the audience or user.'),
	(1061, 1, 7, 'quest', 'quest', 'The task that a player-controlled character, or group of characters may complete in order to gain a reward.'),
	(1062, 1, 7, 'containedIn', 'containedIn', 'The basic containment relation between a place and one that contains it.'),
	(1063, 1, 7, 'containedInPlace', 'containedInPlace', 'The basic containment relation between a place and one that contains it.'),
	(1064, 1, 7, 'contraindication', 'contraindication', 'A contraindication for this therapy.'),
	(1065, 1, 7, 'recipeYield', 'recipeYield', 'The quantity produced by the recipe (for example, number of people served, number of servings, etc).'),
	(1066, 1, 7, 'yield', 'yield', 'The quantity that results by performing instructions. For example, a paper airplane, 10 personalized candles.'),
	(1067, 1, 7, 'cvdCollectionDate', 'cvdCollectionDate', 'collectiondate - Date for which patient counts are reported.'),
	(1068, 1, 7, 'requiredMinAge', 'requiredMinAge', 'Audiences defined by a person\'s minimum age.'),
	(1069, 1, 7, 'referencesOrder', 'referencesOrder', 'The Order(s) related to this Invoice. One or more Orders may be combined into a single Invoice.'),
	(1070, 1, 7, 'identifyingTest', 'identifyingTest', 'A diagnostic test that can identify this sign.'),
	(1071, 1, 7, 'inker', 'inker', 'The individual who traces over the pencil drawings in ink after pencils are complete.'),
	(1072, 1, 7, 'operatingSystem', 'operatingSystem', 'Operating systems supported (Windows 7, OS X 10.6, Android 1.6).'),
	(1073, 1, 7, 'byMonth', 'byMonth', 'Defines the month(s) of the year on which a recurring [[Event]] takes place. Specified as an [[Integer]] between 1-12. January is 1.'),
