	(1339, 1, 7, 'structuralClass', 'structuralClass', 'The name given to how bone physically connects to each other.'),
	(1340, 1, 7, 'workload', 'workload', 'Quantitative measure of the physiologic output of the exercise; also referred to as energy expenditure.'),
	(1341, 1, 7, 'repeatCount', 'repeatCount', 'Defines the number of times a recurring [[Event]] will take place.'),
	(1342, 1, 7, 'adverseOutcome', 'adverseOutcome', 'A possible complication and/or side effect of this therapy. If it is known that an adverse outcome is serious (resulting in death, disability, or permanent damage; requiring hospitalization; or otherwise life-threatening or requiring immediate medical attention), tag it as a seriousAdverseOutcome instead.'),
	(1343, 1, 7, 'departureStation', 'departureStation', 'The station from which the train departs.'),
	(1344, 1, 7, 'proteinContent', 'proteinContent', 'The number of grams of protein.'),
	(1345, 1, 7, 'accessibilityHazard', 'accessibilityHazard', 'A characteristic of the described resource that is physiologically dangerous to some users. Related to WCAG 2.0 guideline 2.3. Values should be drawn from the [approved vocabulary](https://www.w3.org/2021/a11y-discov-vocab/latest/#accessibilityHazard-vocabulary).'),
	(1346, 1, 7, 'regionDrained', 'regionDrained', 'The anatomical or organ system drained by this vessel; generally refers to a specific part of an organ.'),
	(1347, 1, 7, 'commentTime', 'commentTime', 'The time at which the UserComment was made.'),
	(1348, 1, 7, 'boardingPolicy', 'boardingPolicy', 'The type of boarding policy used by the airline (e.g. zone-based or group-based).'),
	(1349, 1, 7, 'vehicleConfiguration', 'vehicleConfiguration', 'A short text indicating the configuration of the vehicle, e.g. \'5dr hatchback ST 2.5 MT 225 hp\' or \'limited edition\'.'),
	(1350, 1, 7, 'billingIncrement', 'billingIncrement', 'This property specifies the minimal quantity and rounding increment that will be the basis for the billing. The unit of measurement is specified by the unitCode property.'),
