	(1356, 1, 7, 'toRecipient', 'toRecipient', 'A sub property of recipient. The recipient who was directly sent the message.'),
	(1357, 1, 7, 'numberOfPartialBathrooms', 'numberOfPartialBathrooms', 'Number of partial bathrooms - The total number of half and ¼ bathrooms in an [[Accommodation]]. This corresponds to the [BathroomsPartial field in RESO](https://ddwiki.reso.org/display/DDW17/BathroomsPartial+Field). '),
	(1358, 1, 7, 'arrivalTerminal', 'arrivalTerminal', 'Identifier of the flight\'s arrival terminal.'),
	(1359, 1, 7, 'hasCourse', 'hasCourse', 'A course or class that is one of the learning opportunities that constitute an educational / occupational program. No information is implied about whether the course is mandatory or optional; no guarantee is implied about whether the course will be available to everyone on the program.'),
	(1360, 1, 7, 'includedInHealthInsurancePlan', 'includedInHealthInsurancePlan', 'The insurance plans that cover this drug.'),
	(1361, 1, 7, 'valueRequired', 'valueRequired', 'Whether the property must be filled in to complete the action.  Default is false.'),
	(1362, 1, 7, 'processorRequirements', 'processorRequirements', 'Processor architecture required to run the application (e.g. IA64).'),
	(1363, 1, 7, 'minPrice', 'minPrice', 'The lowest price if the price is a range.'),
	(1364, 1, 7, 'diseaseSpreadStatistics', 'diseaseSpreadStatistics', 'Statistical information about the spread of a disease, either as [[WebContent]], or\n  described directly as a [[Dataset]], or the specific [[Observation]]s in the dataset. When a [[WebContent]] URL is\n  provided, the page indicated might also contain more such markup.'),
	(1365, 1, 7, 'cutoffTime', 'cutoffTime', 'Order cutoff time allows merchants to describe the time after which they will no longer process orders received on that day. For orders processed after cutoff time, one day gets added to the delivery time estimate. This property is expected to be most typically used via the [[ShippingRateSettings]] publication pattern. The time is indicated using the ISO-8601 Time format, e.g. "23:30:00-05:00" would represent 6:30 pm Eastern Standard Time (EST) which is 5 hours behind Coordinated Universal Time (UTC).'),
	(1366, 1, 7, 'legislationChanges', 'legislationChanges', 'Another legislation that this legislation changes. This encompasses the notions of amendment, replacement, correction, repeal, or other types of change. This may be a direct change (textual or non-textual amendment) or a consequential or indirect change. The property is to be used to express the existence of a change relationship between two acts rather than the existence of a consolidated version of the text that shows the result of the change. For consolidation relationships, use the <a href="/legislationConsolidates">legislationConsolidates</a> property.'),
	(1367, 1, 7, 'episodes', 'episodes', 'An episode of a TV/radio series or season.'),
	(1368, 1, 7, 'episode', 'episode', 'An episode of a TV, radio or game media within a series or season.'),
	(1369, 1, 7, 'permissions', 'permissions', 'Permission(s) required to run the app (for example, a mobile app may require full internet access or may run only on wifi).'),
	(1370, 1, 7, 'strengthUnit', 'strengthUnit', 'The units of an active ingredient\'s strength, e.g. mg.'),
	(1371, 1, 7, 'endDate', 'endDate', 'The end date and time of the item (in [ISO 8601 date format](http://en.wikipedia.org/wiki/ISO_8601)).'),
	(1372, 1, 7, 'shippingDestination', 'shippingDestination', 'indicates (possibly multiple) shipping destinations. These can be defined in several ways, e.g. postalCode ranges.'),
	(1373, 1, 7, 'accessCode', 'accessCode', 'Password, PIN, or access code needed for delivery (e.g. from a locker).'),
	(1374, 1, 7, 'smiles', 'smiles', 'A specification in form of a line notation for describing the structure of chemical species using short ASCII strings.  Double bond stereochemistry \\ indicators may need to be escaped in the string in formats where the backslash is an escape character.'),
	(1375, 1, 7, 'afterMedia', 'afterMedia', 'A media object representing the circumstances after performing this direction.'),
	(1376, 1, 7, 'gameTip', 'gameTip', 'Links to tips, tactics, etc.'),
	(1377, 1, 7, 'yearsInOperation', 'yearsInOperation', 'The age of the business.'),
	(1378, 1, 7, 'speakable', 'speakable', 'Indicates sections of a Web page that are particularly \'speakable\' in the sense of being highlighted as being especially appropriate for text-to-speech conversion. Other sections of a page may also be usefully spoken in particular circumstances; the \'speakable\' property serves to indicate the parts most likely to be generally useful for speech.\n\nThe *speakable* property can be repeated an arbitrary number of times, with three kinds of possible \'content-locator\' values:\n\n1.) *id-value* URL references - uses *id-value* of an element in the page being annotated. The simplest use of *speakable* has (potentially relative) URL values, referencing identified sections of the document concerned.\n\n2.) CSS Selectors - addresses content in the annotated page, e.g. via class attribute. Use the [[cssSelector]] property.\n\n3.)  XPaths - addresses content via XPaths (assuming an XML view of the content). Use the [[xpath]] property.\n\n\nFor more sophisticated markup of speakable sections beyond simple ID references, either CSS selectors or XPath expressions to pick out document section(s) as speakable. For this\nwe define a supporting type, [[SpeakableSpecification]]  which is defined to be a possible value of the *speakable* property.\n         '),
	(1379, 1, 7, 'accessMode', 'accessMode', 'The human sensory perceptual system or cognitive faculty through which a person may process or perceive information. Values should be drawn from the [approved vocabulary](https://www.w3.org/2021/a11y-discov-vocab/latest/#accessMode-vocabulary).'),
	(1380, 1, 7, 'orderNumber', 'orderNumber', 'The identifier of the transaction.'),
	(1381, 1, 7, 'foundingDate', 'foundingDate', 'The date that this organization was founded.'),
	(1382, 1, 7, 'fuelEfficiency', 'fuelEfficiency', 'The distance traveled per unit of fuel used; most commonly miles per gallon (mpg) or kilometers per liter (km/L).\\n\\n* Note 1: There are unfortunately no standard unit codes for miles per gallon or kilometers per liter. Use [[unitText]] to indicate the unit of measurement, e.g. mpg or km/L.\\n* Note 2: There are two ways of indicating the fuel consumption, [[fuelConsumption]] (e.g. 8 liters per 100 km) and [[fuelEfficiency]] (e.g. 30 miles per gallon). They are reciprocal.\\n* Note 3: Often, the absolute value is useful only when related to driving speed ("at 80 km/h") or usage pattern ("city traffic"). You can use [[valueReference]] to link the value for the fuel economy to another value.'),
	(1383, 1, 7, 'hasOccupation', 'hasOccupation', 'The Person\'s occupation. For past professions, use Role for expressing dates.'),
	(1384, 1, 7, 'inAlbum', 'inAlbum', 'The album to which this recording belongs.'),
	(1385, 1, 7, 'knownVehicleDamages', 'knownVehicleDamages', 'A textual description of known damages, both repaired and unrepaired.'),
	(1386, 1, 7, 'dataFeedElement', 'dataFeedElement', 'An item within a data feed. Data feeds may have many elements.'),
	(1387, 1, 7, 'expressedIn', 'expressedIn', 'Tissue, organ, biological sample, etc in which activity of this gene has been observed experimentally. For example brain, digestive system.'),
	(1388, 1, 7, 'size', 'size', 'A standardized size of a product or creative work, specified either through a simple textual string (for example \'XL\', \'32Wx34L\'), a  QuantitativeValue with a unitCode, or a comprehensive and structured [[SizeSpecification]]; in other cases, the [[width]], [[height]], [[depth]] and [[weight]] properties may be more applicable. '),
	(1389, 1, 7, 'customer', 'customer', 'Party placing the order or paying the invoice.'),
	(1390, 1, 7, 'employees', 'employees', 'People working for this organization.'),
	(1391, 1, 7, 'employee', 'employee', 'Someone working for this organization.'),
	(1392, 1, 7, 'providesService', 'providesService', 'The service provided by this channel.'),
	(1393, 1, 7, 'printSection', 'printSection', 'If this NewsArticle appears in print, this field indicates the print section in which the article appeared.'),
	(1394, 1, 7, 'text', 'text', 'The textual content of this CreativeWork.'),
	(1395, 1, 7, 'legislationLegalValue', 'legislationLegalValue', 'The legal value of this legislation file. The same legislation can be written in multiple files with different legal values. Typically a digitally signed PDF have a "stronger" legal value than the HTML file of the same act.'),
	(1396, 1, 7, 'earlyPrepaymentPenalty', 'earlyPrepaymentPenalty', 'The amount to be paid as a penalty in the event of early payment of the loan.'),
	(1397, 1, 7, 'returnMethod', 'returnMethod', 'The type of return method offered, specified from an enumeration.'),
	(1398, 1, 7, 'commentText', 'commentText', 'The text of the UserComment.'),
	(1399, 1, 7, 'geoTouches', 'geoTouches', 'Represents spatial relations in which two geometries (or the places they represent) touch: "they have at least one boundary point in common, but no interior points." (A symmetric relationship, as defined in [DE-9IM](https://en.wikipedia.org/wiki/DE-9IM).)'),
	(1400, 1, 7, 'labelDetails', 'labelDetails', 'Link to the drug\'s label details.'),
	(1401, 1, 7, 'answerCount', 'answerCount', 'The number of answers this question has received.'),
	(1402, 1, 7, 'archivedAt', 'archivedAt', 'Indicates a page or other link involved in archival of a [[CreativeWork]]. In the case of [[MediaReview]], the items in a [[MediaReviewItem]] may often become inaccessible, but be archived by archival, journalistic, activist, or law enforcement organizations. In such cases, the referenced page may not directly publish the content.'),
	(1403, 1, 7, 'relatedAnatomy', 'relatedAnatomy', 'Anatomical systems or structures that relate to the superficial anatomy.'),
	(1404, 1, 7, 'accountMinimumInflow', 'accountMinimumInflow', 'A minimum amount that has to be paid in every month.'),
	(1405, 1, 7, 'photos', 'photos', 'Photographs of this place.'),
