	(1639, 1, 7, 'memoryRequirements', 'memoryRequirements', 'Minimum memory requirements.'),
	(1640, 1, 7, 'leaseLength', 'leaseLength', 'Length of the lease for some [[Accommodation]], either particular to some [[Offer]] or in some cases intrinsic to the property.'),
	(1641, 1, 7, 'webFeed', 'webFeed', 'The URL for a feed, e.g. associated with a podcast series, blog, or series of date-stamped updates. This is usually RSS or Atom.'),
	(1642, 1, 7, 'creditText', 'creditText', 'Text that can be used to credit person(s) and/or organization(s) associated with a published Creative Work.'),
	(1643, 1, 7, 'reservationStatus', 'reservationStatus', 'The current status of the reservation.'),
	(1644, 1, 7, 'insertion', 'insertion', 'The place of attachment of a muscle, or what the muscle moves.'),
	(1645, 1, 7, 'fileFormat', 'fileFormat', 'Media type, typically MIME format (see [IANA site](http://www.iana.org/assignments/media-types/media-types.xhtml)) of the content, e.g. application/zip of a SoftwareApplication binary. In cases where a CreativeWork has several media type representations, \'encoding\' can be used to indicate each MediaObject alongside particular fileFormat information. Unregistered or niche file formats can be indicated instead via the most appropriate URL, e.g. defining Web page or a Wikipedia entry.'),
	(1646, 1, 7, 'encodingFormat', 'encodingFormat', 'Media type typically expressed using a MIME format (see [IANA site](http://www.iana.org/assignments/media-types/media-types.xhtml) and [MDN reference](https://developer.mozilla.org/en-US/docs/Web/HTTP/Basics_of_HTTP/MIME_types)), e.g. application/zip for a SoftwareApplication binary, audio/mpeg for .mp3 etc.\n\nIn cases where a [[CreativeWork]] has several media type representations, [[encoding]] can be used to indicate each [[MediaObject]] alongside particular [[encodingFormat]] information.\n\nUnregistered or niche encoding and file formats can be indicated instead via the most appropriate URL, e.g. defining Web page or a Wikipedia/Wikidata entry.'),
	(1647, 1, 7, 'scheduledTime', 'scheduledTime', 'The time the object is scheduled to.'),
	(1648, 1, 7, 'availabilityEnds', 'availabilityEnds', 'The end of the availability of the product or service included in the offer.'),
	(1649, 1, 7, 'video', 'video', 'An embedded video object.'),
	(1650, 1, 7, 'fuelConsumption', 'fuelConsumption', 'The amount of fuel consumed for traveling a particular distance or temporal duration with the given vehicle (e.g. liters per 100 km).\\n\\n* Note 1: There are unfortunately no standard unit codes for liters per 100 km.  Use [[unitText]] to indicate the unit of measurement, e.g. L/100 km.\\n* Note 2: There are two ways of indicating the fuel consumption, [[fuelConsumption]] (e.g. 8 liters per 100 km) and [[fuelEfficiency]] (e.g. 30 miles per gallon). They are reciprocal.\\n* Note 3: Often, the absolute value is useful only when related to driving speed ("at 80 km/h") or usage pattern ("city traffic"). You can use [[valueReference]] to link the value for the fuel consumption to another value.'),
	(1651, 1, 7, 'greaterOrEqual', 'greaterOrEqual', 'This ordering relation for qualitative values indicates that the subject is greater than or equal to the object.'),
	(1652, 1, 7, 'layoutImage', 'layoutImage', 'A schematic image showing the floorplan layout.'),
	(1653, 1, 7, 'broadcastAffiliateOf', 'broadcastAffiliateOf', 'The media network(s) whose content is broadcast on this station.'),
	(1654, 1, 7, 'siblings', 'siblings', 'A sibling of the person.'),
	(1655, 1, 7, 'sibling', 'sibling', 'A sibling of the person.'),
	(1656, 1, 7, 'returnFees', 'returnFees', 'The type of return fees for purchased products (for any return reason).'),
	(1657, 1, 7, 'defaultValue', 'defaultValue', 'The default value of the input.  For properties that expect a literal, the default is a literal value, for properties that expect an object, it\'s an ID reference to one of the current values.'),
