	(1689, 1, 7, 'tongueWeight', 'tongueWeight', 'The permitted vertical load (TWR) of a trailer attached to the vehicle. Also referred to as Tongue Load Rating (TLR) or Vertical Load Rating (VLR).\\n\\nTypical unit code(s): KGM for kilogram, LBR for pound\\n\\n* Note 1: You can indicate additional information in the [[name]] of the [[QuantitativeValue]] node.\\n* Note 2: You may also link to a [[QualitativeValue]] node that provides additional information using [[valueReference]].\\n* Note 3: Note that you can use [[minValue]] and [[maxValue]] to indicate ranges.'),
	(1690, 1, 7, 'predecessorOf', 'predecessorOf', 'A pointer from a previous, often discontinued variant of the product to its newer variant.'),
	(1691, 1, 7, 'paymentAccepted', 'paymentAccepted', 'Cash, Credit Card, Cryptocurrency, Local Exchange Tradings System, etc.'),
	(1692, 1, 7, 'sportsTeam', 'sportsTeam', 'A sub property of participant. The sports team that participated on this action.'),
	(1693, 1, 7, 'wordCount', 'wordCount', 'The number of words in the text of the Article.'),
	(1694, 1, 7, 'vendor', 'vendor', '\'vendor\' is an earlier term for \'seller\'.'),
