	(1913, 1, 7, 'tributary', 'tributary', 'The anatomical or organ system that the vein flows into; a larger structure that the vein connects to.'),
	(1914, 1, 7, 'discussionUrl', 'discussionUrl', 'A link to the page containing the comments of the CreativeWork.'),
