	(1939, 1, 7, 'albumRelease', 'albumRelease', 'A release of this album.'),
	(1940, 1, 7, 'partOfTrip', 'partOfTrip', 'Identifies that this [[Trip]] is a subTrip of another Trip.  For example Day 1, Day 2, etc. of a multi-day trip.'),
	(1941, 1, 7, 'subTrip', 'subTrip', 'Identifies a [[Trip]] that is a subTrip of this Trip.  For example Day 1, Day 2, etc. of a multi-day trip.'),
	(1942, 1, 7, 'encodesCreativeWork', 'encodesCreativeWork', 'The CreativeWork encoded by this media object.'),
	(1943, 1, 7, 'subOrganization', 'subOrganization', 'A relationship between two organizations where the first includes the second, e.g., as a subsidiary. See also: the more specific \'department\' property.'),
	(1944, 1, 7, 'isVariantOf', 'isVariantOf', 'Indicates the kind of product that this is a variant of. In the case of [[ProductModel]], this is a pointer (from a ProductModel) to a base product from which this product is a variant. It is safe to infer that the variant inherits all product features from the base model, unless defined locally. This is not transitive. In the case of a [[ProductGroup]], the group description also serves as a template, representing a set of Products that vary on explicitly defined, specific dimensions only (so it defines both a set of variants, as well as which values distinguish amongst those variants). When used with [[ProductGroup]], this property can apply to any [[Product]] included in the group.'),
	(1945, 1, 7, 'hasVariant', 'hasVariant', 'Indicates a [[Product]] that is a member of this [[ProductGroup]] (or [[ProductModel]]).'),
	(1946, 1, 7, 'gameServer', 'gameServer', 'The server on which  it is possible to play the game.'),
	(1947, 1, 7, 'game', 'game', 'Video game which is played on this server.'),
	(1948, 1, 7, 'containsSeason', 'containsSeason', 'A season that is part of the media series.'),
	(1949, 1, 7, 'workTranslation', 'workTranslation', 'A work that is a translation of the content of this work. E.g. 西遊記 has an English workTranslation “Journey to the West”, a German workTranslation “Monkeys Pilgerfahrt” and a Vietnamese  translation Tây du ký bình khảo.'),
	(1950, 1, 7, 'translationOfWork', 'translationOfWork', 'The work that this work has been translated from. E.g. 物种起源 is a translationOf “On the Origin of Species”.'),
	(1951, 1, 7, 'alumniOf', 'alumniOf', 'An organization that the person is an alumni of.'),
	(1952, 1, 7, 'alumni', 'alumni', 'Alumni of an organization.'),
	(1953, 1, 7, 'recordedAt', 'recordedAt', 'The Event where the CreativeWork was recorded. The CreativeWork may capture all or part of the event.'),
	(1954, 1, 7, 'recordedIn', 'recordedIn', 'The CreativeWork that captured all or part of this Event.'),
	(1955, 1, 7, 'containsPlace', 'containsPlace', 'The basic containment relation between a place and another that it contains.'),
	(1956, 1, 7, 'exampleOfWork', 'exampleOfWork', 'A creative work that this work is an example/instance/realization/derivation of.'),
	(1957, 1, 7, 'contentLocation', 'contentLocation', 'The location depicted or described in the content. For example, the location in a photograph or painting.'),
	(1958, 1, 7, 'superEvent', 'superEvent', 'An event that this event is a part of. For example, a collection of individual music performances might each have a music festival as their superEvent.'),
