	(422, 1, 7, 'BedAndBreakfast', 'BedAndBreakfast', 'Bed and breakfast.\r\n<br /><br />\r\nSee also the <a href="/docs/hotels.html">dedicated document on the use of schema.org for marking up hotels and other forms of accommodations</a>.\r\n'),
	(423, 1, 7, 'PaintAction', 'PaintAction', 'The act of producing a painting, typically with paint and canvas as instruments.'),
	(424, 1, 7, 'CheckInAction', 'CheckInAction', 'The act of an agent communicating (service provider, social media, etc) their arrival by registering/confirming for a previously reserved service (e.g. flight check-in) or at a place (e.g. hotel), possibly resulting in a result (boarding pass, etc).\\n\\nRelated actions:\\n\\n* [[CheckOutAction]]: The antonym of CheckInAction.\\n* [[ArriveAction]]: Unlike ArriveAction, CheckInAction implies that the agent is informing/confirming the start of a previously reserved service.\\n* [[ConfirmAction]]: Unlike ConfirmAction, CheckInAction implies that the agent is informing/confirming the *start* of a previously reserved service rather than its validity/existence.'),
	(425, 1, 7, 'SiteNavigationElement', 'SiteNavigationElement', 'A navigation element of the page.'),
