	(523, 1, 7, 'EventSeries', 'EventSeries', 'A series of [[Event]]s. Included events can relate with the series using the [[superEvent]] property.\n\nAn EventSeries is a collection of events that share some unifying characteristic. For example, "The Olympic Games" is a series, which\nis repeated regularly. The "2012 London Olympics" can be presented both as an [[Event]] in the series "Olympic Games", and as an\n[[EventSeries]] that included a number of sporting competitions as Events.\n\nThe nature of the association between the events in an [[EventSeries]] can vary, but typical examples could\ninclude a thematic event series (e.g. topical meetups or classes), or a series of regular events that share a location, attendee group and/or organizers.\n\nEventSeries has been defined as a kind of Event to make it easy for publishers to use it in an Event context without\nworrying about which kinds of series are really event-like enough to call an Event. In general an EventSeries\nmay seem more Event-like when the period of time is compact and when aspects such as location are fixed, but\nit may also sometimes prove useful to describe a longer-term series as an Event.\n   '),
	(524, 1, 7, 'ExerciseGym', 'ExerciseGym', 'A gym.'),
	(525, 1, 7, 'DanceGroup', 'DanceGroup', 'A dance group&#x2014;for example, the Alvin Ailey Dance Theater or Riverdance.'),
	(526, 1, 7, 'SkiResort', 'SkiResort', 'A ski resort.'),
	(527, 1, 7, 'LakeBodyOfWater', 'LakeBodyOfWater', 'A lake (for example, Lake Pontrachain).'),
	(528, 1, 7, 'AppendAction', 'AppendAction', 'The act of inserting at the end if an ordered collection.'),
	(529, 1, 7, 'AdultEntertainment', 'AdultEntertainment', 'An adult entertainment establishment.'),
	(530, 1, 7, 'TaxiStand', 'TaxiStand', 'A taxi stand.'),
	(531, 1, 7, 'Canal', 'Canal', 'A canal, like the Panama Canal.'),
	(532, 1, 7, 'HomeGoodsStore', 'HomeGoodsStore', 'A home goods store.'),
	(533, 1, 7, 'AnimalShelter', 'AnimalShelter', 'Animal shelter.'),
	(534, 1, 7, 'URL', 'URL', 'Data type: URL.'),
	(535, 1, 7, 'Diet', 'Diet', 'A strategy of regulating the intake of food to achieve or maintain a specific health-related goal.'),
