	(537, 1, 7, 'StructuredValue', 'StructuredValue', 'Structured values are used when the value of a property has a more complex structure than simply being a textual value or a reference to another thing.'),
	(538, 1, 7, 'MediaReviewItem', 'MediaReviewItem', 'Represents an item or group of closely related items treated as a unit for the sake of evaluation in a [[MediaReview]]. Authorship etc. apply to the items rather than to the curation/grouping or reviewing party.'),
	(539, 1, 7, 'MusicRelease', 'MusicRelease', 'A MusicRelease is a specific release of a music album.'),
