INSERT INTO `site` (`id`, `thumbnail_id`, `homepage_id`, `owner_id`, `slug`, `theme`, `title`, `summary`, `navigation`, `item_pool`, `created`, `modified`, `is_public`, `assign_new_items`) VALUES
	(1, NULL, NULL, 1, 'MSS-Coul', 'default', 'Couleurs et matériaux des Manuscrits', 'Coupler les données produites par les laboratoires de recherche et de conservation  avec des informations historiques et iconographiques sur les enluminures des manuscrits analysés, pour servir l\'ensemble au sein de diverses recherches.', '[{"type":"browse","data":{"label":"Parcourir","query":""},"links":[]},{"type":"page","links":[],"data":{"id":2,"label":null}},{"type":"page","links":[],"data":{"id":6,"label":null}},{"type":"page","links":[],"data":{"id":7,"label":null}}]', '[]', '2023-05-09 15:21:39', '2023-06-05 12:22:14', 1, 1),
	(2, NULL, 5, 1, 'inha_fab', 'default', 'Panneaux peints en Méditerranée', 'Prenant naissance dans l’étude des processus de création des icônes éthiopiennes, ce projet se propose de travailler sur les transferts de techniques et de matériaux à l’oeuvre en Méditerranée entre le XIIIe et le XVIe siècle, afin d’en comprendre les modalités et de mettre au jour les liens entre les différentes traditions de création de panneaux peints.', '[{"type":"browse","data":{"label":"Parcourir","query":""},"links":[]}]', '[]', '2023-05-16 23:57:23', '2023-05-19 15:09:39', 1, 1);
